INSERT INTO pathwaysdos.scenarios VALUES (1, 1, 382, 1213, 6, 23, 4003, 1, 1, '{"Patient:  Joe Bloggs, Age Gender Selected: Adult, Male","Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1775, Hiccups","A palliative care plan was not in place.","There was no new or increased breathlessness.","There was no chest or upper back pain at the time of the assessment.","There was no abdominal pain.","The problem did not begin after starting new medication.","Hiccups had persisted for 48 hours or more.","The individual needs to contact a primary care service within 12 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","Sipping ice-cold water may help the hiccups.","Most cases of hiccups are not serious. They usually stop on their own after a short period of time.","Breath-holding for short periods also works for some people.","Tasting vinegar or biting on a lemon may also help."}', '2023-02-27 11:48:10.936625+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2, 1, 383, 1213, 128, 101, 4143, 2, 2, '{"Patient:  Joe Bloggs, Age Gender Selected: Child, Female","Pathway Selected: PFC1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the contact was not chest/upper back pain, recent fit/seizure, suicide attempt or new confusion.","The main reason for contact was not declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1775, Hiccups","A palliative care plan was in place.","The individual needs to speak to a primary care service within 1 hour for palliative care.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Remember to take a list of any current medications if you go to the out of hours surgery.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 11:48:11.025425+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (3, 1, 381, 1140, 1, 18, 4245, 1, 1, '{"Patient:  Joe Bloggs, Age Gender Selected: Adult, Male","Pathway Selected: PMA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was breathing and conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","There was a predetermined management plan.","Predetermined course of action menu - continued to next list.","The predetermined plan specified that a mental health service should be contacted.","The individual had not attacked, threatened or intended to harm anyone.","There was suicidal intent.","The individual did not have both a plan and means available for a suicide attempt.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Remember to take a list of any current medications if you go to the out of hours surgery.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 11:48:11.115027+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (4, 1, 380, 1172, 22, 38, 4405, 4, 1, '{"Patient:  Joe Bloggs, Age Gender Selected: Infant, Male","Pathway Selected: PMI, Calling About Someone Else","Birth had not occurred within the last hour.","An injury or health problem was the reason for the contact.","The individual was breathing and conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child was not limp, floppy and/or unresponsive.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW808, Unwell","There was a fever at the time of assessment or within the previous 12 hours.","There were no breathing problems.","Severe illness and a rash suggestive of septicaemia were not described.","There was no difficulty rousing.","The individual had no redcurrant jelly stools, tarry, black stools or red bowel motions.","There was no vomiting.","There had been no travel within the last 4 weeks from a country affected by the current Ebola outbreak.","Exposure to Ebola virus disease in the last 4 weeks was not declared.","The baby was jaundiced.","The individual needs to speak to a midwife within 1 hour.","You need to contact the individual''s midwife within 1 hour.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Don''t give both together unless recommended to do so by a health care professional.","UNDER 12 WEEKS OLD: A baby under 12 weeks should not be given any medicine unless it has been prescribed or advised by a doctor, nurse, health visitor or pharmacist.","Follow the instructions in the pack. If in doubt ask a pharmacist.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","Becoming limp, floppy, unresponsive or having a fit - DIAL 999.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Give them plenty to drink, little and often is best. If breastfeeding, breast milk is best.","Jaundice is common in newborn babies. It is not always serious but should be checked .","Bottle-fed babies should continue to be given their normal, full strength formula to prevent dehydration.","Breast-fed babies should continue to be breast-fed as normal to prevent dehydration."}', '2023-02-27 11:48:11.276246+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (5, 1, 390, 1168, 14, 31, 4411, 1, 2, '{"Patient:  Joe Bloggs, Age Gender Selected: Adult, Female","Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was breathing and conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW620, Dental Injury","There was no bleeding following the dental injury.","An assault had not occurred.","There was damage to the teeth.","The injury was less than 24 hours old.","A tooth or teeth had been knocked out.","There was no associated head, facial or neck injury.","The individual had kept the tooth.","Tooth loss occurred less than 2 hours previously.","There was no known increased susceptibilty to infection.","The tooth needs to be reimplanted as soon as possible.","Do not touch the root of the tooth. Only touch the part that is usually visible.","If it is dirty, rinse gently in milk or under running water. Do not scrub or clean with disinfectant.","Push the root of the tooth gently back in the socket as far as it will easily go.","Hold the tooth in place by gently biting on a piece of clean, folded cloth.","The individual needs to contact a dental practice within 1 hour.","Take a mobile phone if possible.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist."}', '2023-02-27 11:48:11.415152+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (6, 1, 384, 1108, 1, 18, 4410, 1, 1, '{"Patient:  Joe Bloggs, Age Gender Selected: Adult, Male","Pathway Selected: PMA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was breathing and conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1260, Hand or Wrist Injury, Penetrating","The wound was not bleeding freely at the time of assessment.","The individual had no associated arm injury.","The hand had not become cold, pale or blue.","There was no bone protruding through the skin.","There was no new hand or wrist deformity.","The individual was able to get up from the floor.","There was no amputation of a finger or part of a finger.","There was no foreign body in the wound.","An assault had not occurred.","The problem was not a needlestick injury.","The injury was not a complex wound.","The wound was caused by a hydraulic or high-pressure injection.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","If it starts to bleed again fold a cloth into a pad and press gently but firmly on the wound to stop the bleeding.","IN LIMBS: raise the injured area above the level of the heart using pillows or a sling.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","Use pillows or a sling to keep the injured area raised.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","IN LIMBS: raise the injured area above the level of the heart and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If helping someone else: try to keep their blood off your skin.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","Use a dry dressing or a clean cloth folded into a pad and press gently but firmly on the wound to stop the bleeding.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Remove any jewellery or tight clothing from around the swelling.","Raise a swollen ankle or knee by sitting with the foot on a stool, or lying with it propped on pillows.","The individual should not eat or drink anything before going to hospital (a sip of water is fine if medication needs to be taken).","Raise a swollen hand or wrist above the level of the heart with a sling. When in bed raise it on pillows.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake."}', '2023-02-27 11:48:11.578236+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (7, 1, 385, 1086, 1, 18, 4410, 1, 2, '{"Patient:  Joe Bloggs, Age Gender Selected: Adult, Female","Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was breathing and conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1264, Finger or Thumb Injury, Penetrating","There was no injury to any other part of the hand.","The individual was able to get up from the floor.","There was no amputation of a finger or part of a finger.","The wound was not bleeding freely at the time of assessment.","There was no foreign body in the wound.","The injury was not a complex wound.","The finger or thumb had not become cold, pale or blue.","There was no new deformity.","An assault had not occurred.","The problem was not a needlestick injury.","The wound was caused by a hydraulic or high-pressure injection.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","If it starts to bleed again fold a cloth into a pad and press gently but firmly on the wound to stop the bleeding.","IN LIMBS: raise the injured area above the level of the heart using pillows or a sling.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","Use pillows or a sling to keep the injured area raised.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","IN LIMBS: raise the injured area above the level of the heart and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If helping someone else: try to keep their blood off your skin.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","Use a dry dressing or a clean cloth folded into a pad and press gently but firmly on the wound to stop the bleeding.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist."}', '2023-02-27 11:48:11.734839+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (8, 1, 391, 1020, 5, 22, 4398, 1, 2, '{"Patient:  Joe Bloggs, Age Gender Selected: Adult, Female","Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was breathing and conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1575, Bites and Stings","The bite or sting was caused by an insect or spider.","The sting/bite had occurred within the previous 6 hours.","There was no rapid facial/oral swelling, wheezing or breathlessness following the bite/sting.","There was no rapidly spreading rash or widespread tingling sensation.","There was no visual disturbance, faintness or dizziness following the bite/sting.","The individual had been stung less than 10 times","The individual had not experienced nausea or vomiting since the sting.","The sting did not involve the eyes or mouth.","An insect/insect part remained attached to the skin.","The bite was from a tick.","The whole tick was still attached.","There was a red rash around the tick bite.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Remember to take a list of any current medications if you go to the out of hours surgery.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t scratch the area.","To help reduce pain and swelling, put a cold flannel on the area and raise above the level of the heart if possible. Don''t put ice on the skin.","Wash the area with soap and water.","If the sting is visible in the skin, brush or scrape it out with your fingernail or the edge of a credit card. Don''t try to pull it out with tweezers.","Remove any jewellery or tight clothing from the area.","Antihistamine medication and creams help reduce swelling and itching. They can be bought from pharmacies. Talk to the pharmacist for advice. Follow the instructions in the pack.","Don''t scratch the area. This can introduce infection.","Wash the area with soap and water.","Remove any jewellery or tight clothing from the area near the bite."}', '2023-02-27 11:48:11.888832+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (9, 1, 387, 1055, 22, 38, 4405, 4, 2, '{"Patient:  Joe Bloggs, Age Gender Selected: Infant, Female","Pathway Selected: PFI, Calling About Someone Else","Birth had not occurred within the last hour.","An injury or health problem was the reason for the contact.","The individual was breathing and conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child was not limp, floppy and/or unresponsive.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1708, Diarrhoea and Vomiting","The individual had not coughed or vomited blood.","There was no fever at the time of assessment or within the previous 12 hours.","Severe illness and a rash suggestive of septicaemia were not described.","There was no difficulty rousing.","The individual had no redcurrant jelly stools, tarry, black stools or red bowel motions.","There had been no ingestion of a potentially harmful substance or object.","The baby was jaundiced.","The individual needs to speak to a midwife within 1 hour.","You need to contact the individual''s midwife within 1 hour.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","Wash hands after changing nappies or dealing with the vomit. Don''t share towels with others.","Jaundice is common in newborn babies. It is not always serious but should be checked .","Bottle-fed babies should continue to be given their normal, full strength formula to prevent dehydration.","Breast-fed babies should continue to be breast-fed as normal to prevent dehydration."}', '2023-02-27 11:48:12.028704+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (10, 1, 393, 1054, 130, 35, 4403, 1, 1, '{"Patient:  Joe Bloggs, Age Gender Selected: Adult, Male","Pathway Selected: PMA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was breathing and conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW631, Diarrhoea","There was no vomiting.","There was no abdominal pain.","Severe illness and a rash suggestive of septicaemia were not described.","Severe illness and inability to flex the neck or photophobia were not described.","There was no new loss of bladder control or leg movement and no saddle or lower limb paraesthesia","There had been no black and tarry or red/maroon bowel motions.","The individual had not ingested a harmful or toxic substance.","There had been travel within the last 4 weeks from a country affected by the current Ebola outbreak.","There was a fever at the time of assessment or within the previous 24 hours.","Private transport to hospital was available.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual, which must only be a member of the household.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","I will inform the Emergency Department that the individual will be attending.","When seen or spoken to by a health care professional make sure they are told about the recent travel to West Africa or contact with Ebola. This is very important.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Remember to take a list of any current medications if you go to the out of hours surgery.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","Becoming very drowsy, unresponsive or having a fit - DIAL 999.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Only wear light clothing. Don''t wrap up to try to sweat out the fever.","It is important to have plenty of fluids, little and often is best."}', '2023-02-27 11:48:12.187289+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (11, 1, 392, 1156, 131, 95, 4402, 1, 2, '{"Patient:  Joe Bloggs, Age Gender Selected: Adult, Female","Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was breathing and conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW854, Sore Throat or Hoarse Voice","The problem involved  a sore throat without a hoarse voice.","There was no pain on swallowing at the time of the assessment.","There was no associated chest pain.","The individual had not experienced aching pain associated with exercise or emotion.","There was no new or worsening breathlessness.","Severe illness and a rash suggestive of septicaemia were not described.","Severe illness and inability to flex the neck or photophobia were not described.","There had been no travel within the last 4 weeks from a country affected by the current Ebola outbreak.","Exposure to Ebola virus disease in the last 4 weeks was declared.","There was no fever at the time of assessment or within the previous 24 hours.","The individual needs to speak to a primary care service within 1 hour.","I will arrange for a clinician to speak to the individual.","When seen or spoken to by a health care professional make sure they are told about the recent travel to West Africa or contact with Ebola. This is very important.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","Avoid exposure to tobacco smoke.","Even though swallowing is painful, warm or cold drinks, ice lollies and ice cream can all soothe a sore throat.","Paracetamol and ibuprofen are both used to relieve pain and reduce high temperature and fever.","IN PREGNANCY: Don''t take ibuprofen, except on the advice of a doctor, midwife or pharmacist. Use paracetamol instead.","However, ibuprofen can be used instead of paracetamol. Follow the instructions in the pack. If in doubt ask a pharmacist.","Unless advised not to, or it has already been given, paracetamol is best for relieving a sore throat."}', '2023-02-27 11:48:12.334901+00', NULL);
