normal, full strength formula to prevent dehydration.","Breast-fed babies should continue to be breast-fed as normal to prevent dehydration."}', '2023-02-27 11:48:12.476095+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (13, 1, 388, 1187, 4, 21, 4399, 1, 1, '{"Patient:  Joe Bloggs, Age Gender Selected: Adult, Male","Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","Declared diabetic hypo or hyperglycaemia was the main reason for the contact.","The concern was that the blood sugar was too low.","The blood sugar level had been measured.","The testing machine reported in units of millimoles per litre.","The blood sugar level was less than 4mmol/L.","A high-sugar drink was available.","EITHER: have a sweet drink (e.g. cola). Don''t use diet drinks.","OR: have a dessert spoon of sugar, jam, honey syrup or treacle.","The sugar starts to work within a few minutes, complete recovery may take up to half an hour.","Sugary drink, food or glucose gel had been administered.","Administration of the medication produced an improvement in the individual''s condition.","The individual had not clinically deteriorated nor felt particularly unwell in the previous 24 hours.","There were similar episodes that week.","There was a diagnosis of insulin dependent diabetes.","Insulin was delivered via an insulin pump.","The individual needs to contact a Primary Care Service within 2 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","If not able to manage full meals have smaller, frequent starchy snacks such as biscuits or cereals, or drinks such as milk and cola. Don''t have diet drinks.","Test blood sugar at least 4 times a day.","Carry on with insulin or other diabetic medication as normal. Don''t stop or reduce the dose unless told to by a doctor.","Eat something now. If a meal is not due have a sandwich, some biscuits, a bowl of cereal or some fruit.","Collapse or unconsciousness - DIAL 999. If they are unconscious don''t put food or drink in their mouth as they could choke.","The individual should always have something sugary with them to have if a hypo is coming on."}', '2023-02-27 11:48:12.615145+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (14, 1, 389, 1187, 1, 18, 4052, 1, 2, '{"Patient:  Joe Bloggs, Age Gender Selected: Adult, Female","Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","Declared diabetic hypo or hyperglycaemia was the main reason for the contact.","The concern was that the blood sugar was too high.","The skin on the torso felt normal, warm or hot.","Severe illness and a rash suggestive of septicaemia were not described.","The blood sugar level had been measured.","The testing machine reported in units of millimoles per litre.","The blood sugar level was 28mmol/L or more.","There was a diagnosis of insulin dependent diabetes.","The blood had been tested for ketones.","The blood ketone level was above 3mmol/L.","There was no new or worsening confusion.","There was no abdominal pain.","The individual did not have a deep, sighing pattern of breathing.","There was no possibility of pregnancy.","The individual had not clinically deteriorated nor felt particularly unwell in the previous 24 hours.","There was somebody available to offer safe transport to hospital.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","Have plenty of sugar-free fluids.","Test urine or blood for ketones.","Carry on with insulin or other diabetic medication as normal. Don''t stop or reduce the dose unless told to by a doctor or diabetes specialist nurse.","Test urine or blood for sugar at least 4 times a day."}', '2023-02-27 11:48:12.788603+00', NULL);
