INSERT INTO pathwaysdos.scenarios VALUES (25, 2, 407, 1130, 130, 103, 4403, 4, 2, '{"Patient:  Joe Bloggs, Age Gender Selected: Infant, Female","Pathway Selected: PFI, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was breathing and conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child was not limp, floppy and/or unresponsive.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1711, Nasal Congestion","There were significant breathing problems.","There was a fever at the time of assessment or within the previous 12 hours.","There were no signs of chest or abdominal recession.","There was no rapid swelling of the lips, face, throat or tongue.","Severe illness and a rash suggestive of septicaemia were not described.","There was no difficulty rousing.","There had not been episode(s) of cessation of breathing for more than 20 seconds that day.","There were no grunting sounds when breathing.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","The individual had no redcurrant jelly stools, tarry, black stools or red bowel motions.","There had been no travel to the Middle East or South Korea in the past 2 weeks.","There had been no episode of choking within the previous 24 hours.","There was no vomiting.","There had been travel within the last 4 weeks from a country affected by the current Ebola outbreak.","Private transport to hospital was available.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual, which must only be a member of the household.","Take any medicines and medical rec