INSERT INTO pathwaysdos.scenarios VALUES (39, 2, 402, 1047, 131, 104, 4402, 4, 2, '{"Patient:  Joe Bloggs, Age Gender Selected: Infant, Female","Pathway Selected: PFI, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was breathing and conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child was not limp, floppy and/or unresponsive.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1705, Cough","The individual had not coughed or vomited blood.","Breathing was not normal between bouts of coughing.","There was no fever at the time of assessment or within the previous 12 hours.","There were no signs of chest or abdominal recession.","There was no rapid swelling of the lips, face, throat or tongue.","Severe illness and a rash suggestive of septicaemia were not described.","There was no difficulty rousing.","There had not been episode(s) of cessation of breathing for more than 20 seconds that day.","There were no grunting sounds when breathing.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","The individual had no redcurrant jelly stools, tarry, black stools or red bowel motions.","There had been no travel to the Middle East or South Korea in the past 2 weeks.","There had been no episode of choking within the previous 24 hours.","There was no vomiting.","There had been travel within the last 4 weeks from a country affected by the current Ebola outbreak.","The individual needs to speak to a primary care service within 1 hour.","I will arrange for a clinician to speak to the individual.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","UNDER 12 WEEKS OLD: A baby under 12 weeks should not be given any medicine unless it has been prescribed by a doctor, nurse or health visitor.","Cough medicines are not suitable for children under 6 years old.","Have plenty of fluids to loosen the phlegm.","Avoid exposure to tobacco smoke.","Don''t give them honey or corn syrup."}', '2023-02-27 13:37:45.018766+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (40, 3, 429, 1146, 103, 77, 4416, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1684, Sexual or Menstrual Concerns","A sexual assault had not occurred.","The problem was not contraception, the menopause, premenstrual symptoms or concerns about sexual activity or identity.","The individual did not have a genital injury.","The problem was not heavy or missed periods.","The problem was not vaginal bleeding, discharge or swelling.","There was no retained vaginal foreign body.","The problem did not concern a rectal foreign body.","The problem did not relate to a piercing or jewellery.","There were no concerns about acquiring HIV, AIDS or hepatitis.","There had been no recent sexual contact with a person known to have a sexually transmitted infection.","The problem was not painful intercourse, loss of interest in sex, vaginal dryness or orgasm difficulties.","The problem was related to a support pessary.","The device had become displaced or lost.","If symptoms don''t improve, or go away and come back, get in touch with the GP practice for a non-urgent appointment.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:38:11.285935+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (41, 3, 428, 1192, 42, 58, 4413, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","Reason for call menu - continued to next list.","A prescription request was the main reason for the contact.","The main reason for the contact was not a new or worsening illness.","The individual did not have enough medication to last until the surgery next opened.","The individual has some of the medication available.","The medication runs out within 6 hours.","The individual needs a repeat prescription.","I will arrange for a clinician to speak to the individual.","DOS call"}', '2023-02-27 13:38:11.345308+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (42, 3, 421, 1157, 117, 90, 4010, 3, 1, '{"Pathway Selected: PMT, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1719, Stoma Problems","The stoma type was for passing faeces.","Pain was the main problem.","The pain was mainly in the abdomen.","The pain was severe.","There was stomal bleeding.","The rectal bleeding was not constant.","The individual did not have redcurrant jelly stools.","The individual had not passed red blood in a bowel motion.","The individual had not passed a black, tarry bowel motion.","The individual was not very breathless at the time of assessment.","A sexual assault had occurred.","The individual needs to attend an emergency treatment centre within 1 hour for Sexual Assault Assessment.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","If it is to be reported to the police don''t wash or change clothes until seen by a doctor or specialist nurse, to avoid destroying important evidence.","DOS call","Unless advised not to, or it has already been given, paracetamol may be used to relieve abdominal pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use ibuprofen or any other anti-inflammatory medication such as aspirin, as they can irritate the stomach.","Any cuts can be covered with a dry dressing. Dirt or anything else should not be cleaned out of the wound as this may be important evidence.","Don''t wash or change clothes until seen by a doctor, to avoid destroying important evidence.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:38:11.50281+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (43, 3, 438, 1055, 9, 26, 4405, 4, 2, '{"Pathway Selected: PFI, Calling About Someone Else","Birth had not occurred within the last hour.","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1708, Diarrhoea and Vomiting","The individual had not coughed or vomited blood.","There was no fever at the time of assessment or within the previous 12 hours.","Severe illness and a rash suggestive of septicaemia were not described.","The individual was responding normally.","The individual had no redcurrant jelly stools, tarry, black stools or red bowel motions.","There had been no ingestion of a potentially harmful substance or object.","The baby was jaundiced.","The individual needs to speak to a primary care service within 1 hour.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Breast-fed babies should continue to be breast-fed as normal to prevent dehydration.","Bottle-fed babies should continue to be given their normal, full strength formula to prevent dehydration.","Wash hands after changing nappies or dealing with the vomit. Don''t share towels with others.","Jaundice is common in newborn babies. It is not always serious but should be checked .","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:38:11.639657+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (44, 3, 439, 1181, 6, 23, 4003, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1709, Wound Problems, Plaster Casts, Tubes and Metal Appliances","The problem involved a wound or dressing.","The pain was not severe.","The wound was not to the abdomen or a limb.","There was no complete wound dehiscence.","The wound was not bleeding freely.","There was a fever at the time of assessment or within the previous 12 hours.","There was no increasing pain or swelling in the area.","The individual needs to contact a primary care service within 12 hours.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","It is important to have plenty of fluids, little and often is best.","Only wear light clothing. Don''t wrap up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Becoming very drowsy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Use a dry dressing or a clean cloth folded into a pad and press gently but firmly on the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","IN LIMBS: raise the area above the level of the heart and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","If you have been given dressings, take them with you when you go to get the wound redressed.","If you have a care plan take that too.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:38:11.76604+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (45, 3, 420, 1004, 117, 90, 4010, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1719, Stoma Problems","The stoma type was for passing faeces.","Pain was the main problem.","The pain was mainly in the abdomen.","The pain was severe.","The individual was 55 years of age or older.","There was no possibility of pregnancy.","Childbirth had not occurred within the previous 6 weeks.","The pain was not so severe that the individual had to keep completely still.","The pain was not causing the individual to writhe or roll around.","The individual had not ingested a harmful or toxic substance.","There was stomal bleeding.","The individual had not passed a black, tarry bowel motion.","The bleeding from the stoma was not constant.","The individual had not passed red blood in a bowel motion.","A sexual assault had occurred.","The individual needs to attend an emergency treatment centre within 1 hour for Sexual Assault Assessment.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","If it is to be reported to the police don''t wash or change clothes until seen by a doctor or specialist nurse, to avoid destroying important evidence.","DOS call","Unless advised not to, or it has already been given, paracetamol may be used to relieve abdominal pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use ibuprofen or any other anti-inflammatory medication such as aspirin, as they can irritate the stomach.","IN ADULTS: if the incident is likely to be reported to the police anyone who treats the individual should be made aware of this and should avoid destroying potential evidence.","Any cuts can be covered with a dry dressing. Dirt or anything else should not be cleaned out of the wound as this may be important evidence.","If it is to be reported to the police don''t wash or change clothes until seen by a doctor or specialist nurse, to avoid destroying important evidence.","If the situation appears to endanger anyone - DIAL 999 FOR THE POLICE.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:38:12.046783+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (46, 3, 422, 1195, 10, 27, 4003, 4, 2, '{"Pathway Selected: PFI, Calling About Someone Else","Birth had not occurred within the last hour.","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was symptoms of flu.","Referral was not from the NHS national flu pandemic service or a healthcare professional.","There was a fever at the time of assessment or within the previous 12 hours.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The child was not a pale, blue, grey or mottled colour.","Severe illness and a rash suggestive of septicaemia were not described.","Features suggestive of serious illness were not described.","The individual needs to speak to a primary care service within 2 hours.","I will arrange for a clinician to speak to the individual.","IF THE RECOMMENDED TIMEFRAME FALLS DURING PRACTICE HOURS: Contact the practice to arrange for the individual to be spoken to within 2 hours.","IF THE RECOMMENDED TIMEFRAME FALLS OUTSIDE PRACTICE HOURS: I will arrange for a clinician to speak to the individual.","The individual should register as a temporary resident with a GP practice if they are not already registered.","DOS call","Give them plenty to drink, little and often is best. If breastfeeding, breast milk is best.","Dress them in light clothes e.g. a T-shirt and nappy. Don''t wrap them up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","UNDER 12 WEEKS OLD: A baby under 12 weeks should not be given any medicine unless it has been prescribed or advised by a doctor, nurse, health visitor or pharmacist.","OVER 12 WEEKS OLD: Unless advised not to, or they have already been given, either paracetamol OR  ibuprofen can be used to relieve pain or reduce a fever.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:38:12.177478+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (47, 3, 440, 1140, 128, 101, 4143, 1, 2, '{"Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","There was a predetermined management plan.","The predetermined plan specified that palliative care services should be contacted.","The problem was not only related to a syringe driver.","The individual needs to speak to a primary care service within 1 hour for palliative care.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:38:12.257243+00', NULL);
