INSERT INTO pathwaysdos.scenarios VALUES (49, 3, 442, 1018, 115, 76, 4245, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1749, Behaviour Change","The mood or behaviour change was not part of a previously diagnosed mental health problem.","The individual had not attacked, threatened or intended to harm anyone.","There was no ingestion/inhalation of something harmful in the last 72 hours.","The duration of the problem was less than 2 weeks.","Severe illness and a rash suggestive of septicaemia were not described.","There had been no episodes of inability to raise both arms, speech difficulty or unilateral facial weakness.","There had been no episode of unilateral leg weakness.","There was no fainting or loss of consciousness in the previous 24 hours.","Severe illness and inability to flex the neck or photophobia were not described.","There had been no exposure to extremes of temperature in the previous 24 hours.","There had been no head injury in the previous 7 days.","The individual was able to stay awake.","The individual was having suicidal thoughts.","The individual had not made a plan for a suicide attempt.","The individual needs to attend an emergency treatment centre within 1 hour for further assessment.","Someone else should drive the individual.","Make sure you have a list of any current medications.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:38:12.445622+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (50, 3, 437, 1054, 9, 26, 4405, 4, 1, '{"Pathway Selected: PMI, Calling About Someone Else","Birth had not occurred within the last hour.","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1715, Diarrhoea","The child was unwell.","There was no fever at the time of assessment or within the previous 12 hours.","Severe illness and a rash suggestive of septicaemia were not described.","The individual was responding normally.","The individual had no redcurrant jelly stools, tarry, black stools or red bowel motions.","There had been no ingestion of a potentially harmful substance or object.","The baby was under 29 days old.","The baby was jaundiced.","The baby was under 10 days old.","The individual needs to speak to a primary care service within 1 hour.","I will arrange for a clinician to speak to the individual.","IF THE RECOMMENDED TIMEFRAME FALLS DURING PRACTICE HOURS: Contact the practice to arrange for the individual to be spoken to.","IF THE RECOMMENDED TIMEFRAME FALLS OUTSIDE PRACTICE HOURS: I will arrange for a clinician to speak to the individual.","The individual should register as a temporary resident with a GP practice if they are not already registered.","SAFEGUARDING: From what I have heard there may be safeguarding concerns.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Breast-fed babies should continue to be breast-fed as normal to prevent dehydration.","Bottle-fed babies should continue to be given their normal, full strength formula to prevent dehydration.","OVER 12 WEEKS: give bottle-fed babies frequent, small amounts of freshly boiled and cooled water to prevent dehydration.","Jaundice is common in newborn babies. It is not always serious but should be checked .","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:38:12.606035+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (51, 3, 423, 1002, 1, 18, 4052, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW508, Abdominal or Flank Injury, Penetrating","There was no possibility of pregnancy.","There was no new/worsening breathlessness since the injury.","The wound was bleeding freely at the time of assessment.","There was no foreign body in the wound.","There was no severe pain in the chest or back.","There was no spinal pain, loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There was no very severe and constant pain or very severe pain worsened by movement","There had been no vomiting of red or altered (coffee grounds) blood.","There had been no black and tarry or red/maroon bowel motions.","The individual has been able to weight-bear since the injury.","There was no new shoulder tip pain.","An assault had not occurred.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Use a dry dressing or a clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight."}', '2023-02-27 13:38:12.742944+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (52, 3, 436, 1213, 7, 24, 4003, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1775, Hiccups","There were no other symptoms, apart from hiccups","The problem did not begin after starting new medication.","Hiccups had persisted for 48 hours or more.","The individual needs to contact a primary care service within 24 hours.","I will arrange for the individual to be seen. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Most cases of hiccups are not serious. They usually stop on their own after a short period of time.","Sipping ice-cold water may help the hiccups.","Tasting vinegar or biting on a lemon may also help.","Breath-holding for short periods also works for some people.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:38:12.852486+00', NULL);
