INSERT INTO pathwaysdos.scenarios VALUES (557, 33, 472, 1018, 9, 26, 4053, 1, 1, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW1749, Behaviour Change","Referral to Mental Health Service required.","Speaking to a mental health service within 1 hour was considered appropriate.","The individual needs to speak to a primary care service within 1 hour.","I will arrange for a clinician to speak to the individual.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:55:32.633443+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (53, 3, 434, 1172, 9, 26, 4405, 4, 1, '{"Pathway Selected: PMI, Calling About Someone Else","Birth had not occurred within the last hour.","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1804, Unwell Infant","The baby was less than 29 days old","There was no fever at the time of assessment or within the previous 12 hours.","There were no breathing problems.","Severe illness and a rash suggestive of septicaemia were not described.","The individual was responding normally.","The individual had no redcurrant jelly stools, tarry, black stools or red bowel motions.","There was no vomiting.","There had been no ingestion of a potentially harmful substance or object.","There had been no episode of choking within the previous 24 hours.","The baby was jaundiced.","The baby was under 10 days old.","The individual needs to speak to a primary care service within 1 hour.","I will arrange for a clinician to speak to the individual.","IF THE RECOMMENDED TIMEFRAME FALLS DURING PRACTICE HOURS: Contact the practice to arrange for the individual to be spoken to.","IF THE RECOMMENDED TIMEFRAME FALLS OUTSIDE PRACTICE HOURS: I will arrange for a clinician to speak to the individual.","The individual should register as a temporary resident with a GP practice if they are not already registered.","SAFEGUARDING: From what I have heard there may be safeguarding concerns.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Breast-fed babies should continue to be breast-fed as normal to prevent dehydration.","Bottle-fed babies should continue to be given their normal, full strength formula to prevent dehydration.","OVER 12 WEEKS: give bottle-fed babies frequent, small amounts of freshly boiled and cooled water to prevent dehydration.","Jaundice is common in newborn babies. It is not always serious but should be checked .","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:38:13.005916+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (54, 3, 435, 1140, 115, 76, 4245, 1, 1, '{"Pathway Selected: PMA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","There was a predetermined management plan.","Predetermined course of action menu - continued to next list.","The predetermined plan specified that a mental health service should be contacted.","The individual had not attacked, threatened or intended to harm anyone.","The individual was having suicidal thoughts.","The individual did not have a plan available for a suicide attempt.","The individual needs to attend an emergency treatment centre within 1 hour for further assessment.","Someone else should drive the individual.","Make sure you have a list of any current medications.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:38:13.100837+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (55, 3, 425, 1192, 109, 81, 4413, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","Reason for call menu - continued to next list.","A prescription request was the main reason for the contact.","The main reason for the contact was not a new or worsening illness.","The individual did not have enough medication to last until the surgery next opened.","The individual had no medication available.","The next dose was due within 2 hours.","The individual needs a repeat prescription.","I will arrange for a clinician to speak to the individual.","DOS call"}', '2023-02-27 13:38:13.163051+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (56, 3, 431, 1168, 14, 31, 4411, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW620, Dental Injury","There was no bleeding following the dental injury.","An assault had not occurred.","There was damage to the teeth.","The timing of the injury was uncertain.","A tooth or teeth had been knocked out.","There was no associated head, facial or neck injury.","The individual had kept the tooth.","Tooth loss occurred less than 2 hours previously.","There was no known increased susceptibilty to infection.","The tooth needs to be reimplanted as soon as possible.","The individual needs to contact a dental practice within 1 hour.","IF THE RECOMMENDED TIMEFRAME FALLS OUTSIDE PRACTICE HOURS: If the dental practice can''t be contacted, contact the individual''s GP practice or, if it is closed call the GP out of hours service.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:38:13.265627+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (57, 3, 430, 1018, 4, 21, 4003, 3, 2, '{"Pathway Selected: PFT, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW542, Behaviour Change","Severe illness and a rash suggestive of septicaemia were not described.","The duration of the problem was less than 2 weeks.","There was no fainting or loss of consciousness in the previous 24 hours.","Severe illness and inability to flex the neck, photophobia or not responding normally were not described.","There had been no exposure to extremes of temperature in the previous 24 hours.","There had been no head injury in the previous 7 days.","There was no new limb weakness, co-ordination problems or staggering gait.","The individual was able to stay awake.","The individual had not ingested a toxic substance.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","The individual appeared to be confused.","The individual did not use insulin or other medication for diabetes.","The individual needs to contact a Primary Care Service within 2 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:38:13.382668+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (58, 3, 424, 1146, 103, 77, 4417, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1684, Sexual or Menstrual Concerns","A sexual assault had not occurred.","The problem was not contraception, the menopause, premenstrual symptoms or concerns about sexual activity or identity.","The individual did not have a genital injury.","The problem was not heavy or missed periods.","The problem was not vaginal bleeding, discharge or swelling.","There was no retained vaginal foreign body.","The problem did not concern a rectal foreign body.","The problem did not relate to a piercing or jewellery.","There were no concerns about acquiring HIV, AIDS or hepatitis.","There had been no recent sexual contact with a person known to have a sexually transmitted infection.","The problem was not painful intercourse, loss of interest in sex, vaginal dryness or orgasm difficulties.","The problem was related to an intrauterine device.","The device had become displaced or lost.","If symptoms don''t improve, or go away and come back, get in touch with the GP practice for a non-urgent appointment.","The individual should register as a temporary resident with a GP practice if they are not already registered.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:38:13.499437+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (62, 3, 433, 1169, 17, 34, 4392, 2, 1, '{"Pathway Selected: PMC3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the contact was not chest/upper back pain, recent fit/seizure, suicide attempt, new confusion or suspected stroke.","The main reason for the assessment was not declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1611, Dental Problems","Toothache was the main problem.","There was no fever at the time of assessment or within the previous 12 hours.","There was no new lump or swelling on the face or under the jaw.","The tooth pain began after having braces fitted.","There was worsening pain.","Analgesics had not been taken.","The individual needs to contact a dental practice within 12 hours.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t wear a brace that is damaged or broken.","Dental braces can be uncomfortable initially. However, if pain is getting worse and the brace is a removable one, take it out.","Don''t try to remove a fixed brace. Only a dentist or orthodontist should do this.","If you were given dental wax by the dentist or orthodontist, put it on the part of the brace that is causing discomfort.","Do not apply gels or medication directly to the tooth or surrounding gum area. This may damage gums.","Avoid hot or cold food and drinks.","The only permanent cure for toothache is dental treatment. See a dentist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:38:13.859504+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (63, 4, 444, 1191, 136, 112, 4315, 1, 1, '{"A healthcare professional needing to speak to a colleague was the reason for the contact.","The call was from a doctor.","Response required: 4 hour.","The individual will be called back by a healthcare professional within 4 hours.","You will receive a callback. I will pass on the details.","Can I check we have the correct number for them to contact you?","Is there an answer phone? If so can we leave a message?","If the condition gets worse, changes or you have any other concerns call us back.","DOS call"}', '2023-02-27 13:38:56.207195+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (64, 4, 445, 1092, 113, 85, 4052, 3, 1, '{"Pathway Selected: PMT, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW836, Object, Ingested or Inhaled","The ingested/inhaled object was not able to be identified.","There was no new or increased breathlessness.","The individual had not vomited/coughed up blood.","Back slaps, the Heimlich manoeuvre or chest or abdominal thrusts were not used during the recovery.","There did not seem to be pain following foreign body ingestion.","The individual had not ingested a battery, a magnet, a coin or a sharp or large object.","There was no repeated vomiting.","There was no history of gastrointestinal surgery.","The individual had not passed a black, tarry bowel motion.","There had been no vomiting of altered blood (coffee grounds).","There were no new, persistent symptoms following the incident.","The individual needs to attend an emergency treatment centre within 12 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","DOS call","Don''t try to remove anything that feels like it''s stuck.","Don''t deliberately try to be sick.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:38:56.294768+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (65, 4, 442, 1176, 22, 38, 4112, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW915, Vaginal Discharge","There was no abdominal pain.","A sexual assault had not occurred.","There was no fever at the time of assessment or within the previous 12 hours.","The individual was under 55 years of age.","Pregnancy or possible pregnancy was reported.","The individual had been pregnant for 20 weeks or more.","The membranes had ruptured.","The individual needs to speak to a midwife within 1 hour.","You need to contact the individual''s midwife within 1 hour.","IF THE RECOMMENDED TIMEFRAME FALLS DURING PRACTICE HOURS: If the midwife can''t be contacted, contact the GP practice to arrange for the individual to be seen within 1 hour.","IF THE RECOMMENDED TIMEFRAME FALLS OUTSIDE PRACTICE HOURS: If the midwife can''t be contacted, call the GP out of hours service","DOS call","Wash the area daily with plain warm water and mild soap. Dry well. Washing too often can make things worse.","Don''t use perfumed products like soaps, bubble baths, gels or deodorants.","Loose-fitting cotton clothes and underwear are best.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:38:56.323912+00', NULL);
