INSERT INTO pathwaysdos.scenarios VALUES (73, 5, 456, 1127, 26, 42, 4455, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW782, Lower Back Pain","The pain did not interfere with normal activity .","Severe illness and a rash suggestive of septicaemia were not described.","The individual was under 55 years of age.","Pregnancy or possible pregnancy was reported.","The individual had been pregnant for 20 weeks or more.","The individual was not in labour.","The pain was not severe.","There was no significant vaginal bleeding.","The individual had experienced new leg swelling since symptom onset","There was no new loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There had been no black and tarry or red/maroon bowel motions.","The individual had not ingested a harmful or toxic substance.","The individual also had abdominal pain.","The pain was in the upper abdomen.","The individual needs to Speak to Midwife or Labour Suite immediately.","You need to contact your midwife or labour suite immediately","DOS call","Unless advised not to, or it has already been given, paracetamol is best for relieving back pain. Take it regularly, not just when the pain is bad.","IN PREGNANCY: Don''t take ibuprofen, except on the advice of a doctor, midwife or pharmacist. Use paracetamol instead.","Unless advised not to, or it has already been given, paracetamol may be used to relieve abdominal pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use ibuprofen or any other anti-inflammatory medication such as aspirin, as they can irritate the stomach.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:39:19.927947+00', NULL);
