INSERT INTO pathwaysdos.scenarios VALUES (75, 5, 455, 1118, 26, 42, 4455, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","Labour or childbirth was the reason for the contact.","The baby had not been born at the time of the assessment.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","There was no severe and constant abdominal pain.","The individual had been pregnant for 20 weeks or more.","There was no vaginal bleeding at the time of the assessment.","There was no abdominal tenderness.","The individual had not felt faint or passed out.","There was no cord prolapse, visible presenting part, passage of meconium, urge to push or contractions less than 5 minutes apart.","Features of onset of labour were not present.","There was new visual disturbance.","The individual needs to Speak to Midwife or Labour Suite immediately.","You need to contact your midwife or labour suite immediately","DOS call","Vaginal bleeding of more than just a few spots, or a gush of watery discharge from the vagina - CALL 999.","Severe and constant abdominal pain, or a feeling of wanting to push or of the baby coming - CALL 999.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:39:20.109072+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (76, 5, 454, 1117, 26, 42, 4455, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW774, Lower Limb Pain or Swelling","The problem affected the lower leg only.","The problem affected the knee or lower leg.","The problem did not relate to a previously diagnosed leg ulcer.","There was no swelling in the groin.","There was no pain in the groin.","There was no new loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There was no sudden onset of pain and swelling of an entire leg.","A leg had not suddenly become cold, pale or blue.","The individual had not suddenly become breathless.","There was no sharp/stabbing pain in the chest/upper back on coughing or deep breathing.","The individual had not coughed up blood.","The problem involved both legs.","There was bilateral swelling.","The individual was under 55 years of age.","Pregnancy or possible pregnancy was reported.","The individual had been pregnant for 20 weeks or more.","There was new visual disturbance.","The individual needs to Speak to Midwife or Labour Suite immediately.","You need to contact your midwife or labour suite immediately","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","IN PREGNANCY: Don''t take ibuprofen,