ny other anti-inflammatory medication such as aspirin, as they can irritate the stomach.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:39:20.382266+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (78, 5, 465, 1155, 11, 28, 4456, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","A social or domestic emergency was the main problem.","There was no immediate risk of violence.","An assault had not occurred.","The individual denied suicidal thoughts.","There was no child or vulnerable adult at risk.","There was no risk of self-harm.","The individual had been hearing voices or seeing things.","There had been a previous assessment by a doctor for this episode.","The individual had not considered harming themselves or anyone else.","No one else was considered to be vulnerable and at risk","The individual needs to speak to a primary care service within 6 hours.","I will arrange for a clinician to speak to the individual.","IF THE RECOMMENDED TIMEFRAME FALLS DURING PRACTICE HOURS: Contact the practice to arrange for the individual to be spoken to within 6 hours.","IF THE RECOMMENDED TIMEFRAME FALLS OUTSIDE PRACTICE HOURS: I will arrange for a clinician to speak to the individual.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:39:20.559946+00', NULL);
