INSERT INTO pathwaysdos.scenarios VALUES (80, 5, 458, 1179, 26, 42, 4455, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW936, Vomiting and/or Nausea","The individual had vomited.","The individual did not also have diarrhoea.","There had been no vomiting of blood or faeces.","The symptoms did not follow drinking alcohol.","There had been no head injury in the previous 7 days.","Abdominal pain was also present.","The pain did not interfere with normal activity .","There was no crushing or severe aching chest, upper back or upper abdominal pain, or pain radiating to the arm, neck, jaw or shoulder.","Severe illness and a rash suggestive of septicaemia were not described.","The individual was under 55 years of age.","There was no possibility of pregnancy.","Childbirth had occurred within the previous week.","Severe illness and inability to flex the neck or photophobia were not described.","There had been no black and tarry or red/maroon bowel motions.","The individual had not ingested a harmful or toxic substance.","There was no new eye pain.","The individual had a severe headache.","The individual needs to Speak to Midwife or Labour Suite immediately.","You need to contact your midwife or labour suite immediately","SAFEGUARDING: From what I have heard there may be safeguarding concerns.","DOS call","Unless advised not to, or it has already been given, paracetamol may be used to relieve abdominal pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use ibuprofen or any other anti-inflammatory medication such as aspirin, as they can irritate the stomach.","Don''t let them have anything to eat or drink (a sip of water is fine if medication needs to be taken).","Vomiting can be caused by gastro-enteritis (a tummy bug). Good hygiene will help to prevent spreading it to others.","Wash hands after dealing with the vomit. Don''t share towels with others.","Clean any vomit bowls with disinfectant.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:39:20.907377+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (82, 5, 466, 1203, 39, 55, 4456, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1751, Mental Health Problems","There was no worsening of a known mental health problem.","The individual had not been hearing voices, seeing things or behaving abnormally.","Depression or low mood was the main problem.","The individual had not attacked or threatened anyone.","The individual denied suicidal thoughts.","There was no new or worsening confusion.","Medication type or dosage had not changed within the previous 2 weeks.","No major life event had occurred in the previous 6 months.","There was no unexplained weight loss or gain or intolerance of extreme temperatures.","The individual had not experienced intrusive memories of a past traumatic event.","There was no recent history of severe headaches.","There had been no feelings of depression, agitation or restlessness, anxiety or panic during the last month.","Illicit drug or solvent misuse had not occurred.","Alcohol consumption was not considered to be contributing to the problem.","The problem was so severe that normal life was impossible.","The individual had not considered harming themselves or anyone else.","No one else was considered to be vulnerable and at risk","The individual MUST contact their own GP Practice within 3 working days.","The individual should register as a temporary resident with a GP practice if they are not already registered.","SAFEGUARDING: From what I have heard there may be safeguarding concerns.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:39:21.144451+00', NULL);
