INSERT INTO pathwaysdos.scenarios VALUES (107, 6, 586, 1160, 1, 18, 4052, 4, 1, '{"Birth had not occurred within the last hour.","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1774, Skin Problems","The main problem was a tattoo, birthmark or mole","The problem related to a tattoo.","The tattoo was less than 1 week old.","There was a fever at the time of assessment or within the previous 12 hours.","The baby was less than 29 days old","The individual needs to attend an emergency treatment centre within 1 hour.","SAFEGUARDING: From what I have heard there may be safeguarding concerns.","DOS call","Give them plenty to drink, little and often is best. If breastfeeding, breast milk is best."}', '2023-02-27 13:39:48.024912+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (108, 6, 582, 1148, 4, 21, 4460, 2, 1, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the contact was not chest/upper back pain, recent fit/seizure, suicide attempt, new confusion or suspected stroke.","The main reason for contact was not declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1602, Sinusitis (Declared)","The symptoms were not similar to previous episodes of sinusitis.","There was no new or worsening breathlessness.","Toothache was not associated with the pain or swelling.","The individual was so ill they had stopped doing all normal activities.","A rash suggestive of septicaemia was not described.","Inability to flex the neck, photophobia or not responding normally were not described.","There were no new lumps or swellings on the head, face or neck.","There was no fever at the time of assessment or within the previous 12 hours.","The problem did not involve the area around an eye.","There was no nasal foreign body.","The individual needs to contact a Primary Care Service within 2 hours.","I will arrange for a clinician to contact the individual. I need to ask some further questions in order to determine the best way to do this.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist."}', '2023-02-27 13:39:48.199615+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (109, 6, 596, 1206, 25, 41, 4316, 1, 2, '{"An ambulance response was not required.","Advice or information was given to  a healthcare professional.","Ambulance dispatch, referral to Emergency Treatment Centre, primary care or home management was not considered appropriate.","Referral to Community Healthcare Professional was required.","Another community healthcare professional was required.","I will pass the information on to a Community Healthcare Professional.","I will pass your information on to them.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns call us back."}', '2023-02-27 13:39:48.264597+00', NULL);
