INSERT INTO pathwaysdos.scenarios VALUES (112, 6, 555, 1060, 1, 18, 4134, 1, 2, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW636, Dizziness or Vertigo","The individual was so ill they had stopped doing all normal activities.","A rash suggestive of septicaemia was not described.","There were no palpitations with the onset of dizziness.","There had been no crushing chest, upper back or abdominal pain, or chest pain radiating to the arm, neck or jaw in the previous 24 hours.","There had been no head injury in the previous 7 days.","Pregnancy or possible pregnancy was reported.","The individual had been pregnant for 20 weeks or more.","There had been no episodes of inability to raise both arms, speech difficulty or unilateral facial weakness in the last week.","There had been no episode of unilateral leg weakness in the last week.","There was new visual loss in the last 24 hours.","There was no new severe unsteadiness.","Inability to flex the neck or photophobia were not described.","There had been no vomiting of red or altered (coffee grounds) blood.","There had been no black and tarry or red/maroon bowel motions.","There was no severe headache of sudden onset.","There was no heat exposure or overexertion prior to symptom onset.","There was no gradually worsening breathlessness in the previous few hours.","The individual did not have an implanted defibrillator or pacemaker.","The individual needs to attend an emergency treatment centre within 1 hour.","Som