INSERT INTO pathwaysdos.scenarios VALUES (224, 8, 674, 1230, 5, 22, 4003, 1, 1, '{"Senior Clinician Module","Referral to another service was required.","A referral to a primary care service or emergency treatment centre was required.","An illness or other health problem was the reason for referral.","Pathway Selected: PW1811, Clinical Hub Closure","A primary care service referral was required.","Contact Primary Care.","To contact a primary care service within 6 hours was considered appropriate.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to contact the individual. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:46:41.285013+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (225, 8, 648, 1130, 1, 18, 4489, 4, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1711, Nasal Congestion","There were no significant breathing problems.","There was a fever at the time of assessment or within the previous 12 hours.","The individual was so ill they had stopped behaving normally.","A rash suggestive of septicaemia was not described.","The individual was responding normally.","The individual had no redcurrant-jelly stools or red bowel motions.","There was no vomiting.","There was bruising.","The baby was not mobile.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Give them plenty to drink, little and often is best. If breastfeeding, breast milk is best.","Dress them in light clothes e.g. a T-shirt and nappy. Don''t wrap them up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Becoming limp, floppy, unresponsive or having a fit - CALL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - CALL 999.","OVER 12 WEEKS OLD: Unless advised not to, or they have already been given, either paracetamol OR  ibuprofen can be used to relieve pain or reduce a fever.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","Saline nose drops can help relieve a blocked or stuffy nose. Ask your pharmacist or health visitor about them.","Decongestant medicines, sprays or drops are not suitable for children under 6 years old, except on the advice of a doctor.","Avoid exposure to tobacco smoke.","It is important to have plenty of fluids, little and often is best.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:46:41.449617+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (115, 6, 568, 1090, 9, 26, 4460, 1, 2, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW716, Flank or Side Pain","The pain did not interfere with normal activity .","The individual was so ill they had stopped doing all normal activities.","A rash suggestive of septicaemia was not described.","There was no blood in the urine.","The individual was under 55 years of age.","Pregnancy or possible pregnancy was reported.","The stage of pregnancy could not be confirmed.","The individual was not in labour.","The pain was not severe.","There was no significant vaginal bleeding.","Neither pain nor swelling was present since symptom onset","Breathing harder or faster when doing nothing was not described.","The individual had not coughed up blood.","There had been no black and tarry or red/maroon bowel motions.","There was no new or worsening confusion.","There was no abdominal pain.","There was no new visual disturbance, severe headache or sudden increase in swelling/fluid retention.","There was new or worsening breathlessness since the onset of the problem.","The individual needs to speak to a primary care service within 1 hour.","I will arrange for a clinician to speak to the individual.","DOS call","Sit as upright as is comfortable."}', '2023-02-27 13:39:49.139638+00', NULL);
