INSERT INTO pathwaysdos.scenarios VALUES (125, 6, 580, 1141, 1, 18, 4134, 1, 1, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable stroke or mini-stroke was the main reason for the assessment.","The skin on the torso felt normal, warm or hot.","The individual had no new rash.","The individual was 25 years of age or older.","There had been no crushing chest, upper back or abdominal pain, or chest pain radiating to the arm, neck or jaw in the previous 24 hours.","Symptoms were present at the time of the assessment.","There was no previous history of stroke.","There was no new inability to raise both arms, new difficulty speaking or new unilateral facial weakness.","There was no new, unilateral leg weakness.","There was new visual loss in the last 24 hours.","There was no new severe unsteadiness.","There was no new or worsening confusion.","There was no severe headache of sudden onset.","There had been no head injury in the previous 7 days.","There was no fainting or loss of consciousness in the previous 24 hours.","The individual was so ill they had stopped doing all normal activities.","Inability to flex the neck or photophobia were not described.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","DOS call","NO INSTRUCTIONS GIVEN AS CALL IS BEING WARM TRANSFERRED (INTERIM CARE ADVICE MUST BE GIVEN IF THE CALL IS PLACED ON A QUEUE)"}', '2023-02-27 13:39:50.32674+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (126, 6, 594, 1187, 9, 26, 4460, 2, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the contact was not chest/upper back pain, recent fit/seizure, suicide attempt, new confusion or suspected stroke.","Declared diabetic hypo or hyperglycaemia was the main reason for the assessment.","The concern was that the blood sugar was too high.","The blood sugar level had been measured.","The testing machine reported in units of millimoles per litre.","The blood sugar level was between 13.0 and 27.9mmol/L.","The skin on the torso felt normal, warm or hot.","The individual was so ill they had stopped doing all normal activities.","A rash suggestive of septicaemia was not described.","The individual was responding normally.","New or worsening confusion could not be confirmed.","There was no diagnosis of insulin dependent diabetes.","The individual did not have a deep, sighing pattern of breathing.","The individual had clinically deteriorated or felt particularly unwell in the previous 24 hours.","Breathing harder or faster when doing nothing was not described.","There was no repeated vomiting.","There was no abdominal pain.","There was no new or worsening breathlessness.","The individual needs to speak to a primary care service within 1 hour.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Carry on with insulin or other diabetic medication as normal. Don''t stop or reduce the dose unless told to by a doctor or diabetes specialist nurse.","Test urine or blood for sugar at least 4 times a day.","Have plenty of sugar-free fluids.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:39:50.488171+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (127, 6, 609, 1206, 125, 98, 4324, 2, 2, '{"Disposition validation was required as per local policy.","An ambulance response was not required.","Advice or information was given to a healthcare professional.","Ambulance dispatch, referral to Emergency Treatment Centre, primary care or home management was not considered appropriate.","Referral to Community Healthcare Professional was required.","A community midwife was required.","I will pass the information on to the community midwife.","I will pass your information on to them.","DOS call"}', '2023-02-27 13:39:50.54795+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (128, 6, 536, 1004, 9, 26, 4460, 2, 2, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the contact was not chest/upper back pain, recent fit/seizure, suicide attempt, new confusion or suspected stroke.","The main reason for contact was not declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW517, Abdominal Pain","There was no vomiting, diarrhoea, rectal bleeding, groin pain or groin swelling.","There was no vaginal bleeding, discharge or swelling.","The individual was still able to carry out some normal activities.","The individual was 11 years of age or older.","There was no possibility of pregnancy.","Childbirth had not occurred within the previous 6 weeks.","There had been no black and tarry or red/maroon bowel motions.","The pain did not interfere with normal activity .","The individual had not ingested a harmful or toxic substance.","The child had not started having menstrual periods.","There was no new shoulder tip pain or pain in the lower right abdomen.","New or worsening confusion could not be confirmed.","Breathing harder or faster when doing nothing was described.","The individual needs to speak to a primary care service within 1 hour.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Try putting a heat pad or covered hot water bottle on the painful area.","Unless advised not to, or it has already been given, paracetamol may be used to relieve abdominal pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use ibuprofen or any other anti-inflammatory medication such as aspirin, as they can irritate the stomach.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:39:50.688106+00', NULL);
