INSERT INTO pathwaysdos.scenarios VALUES (133, 6, 610, 1228, 4, 21, 4003, 1, 2, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1543, Self-Harm","There had been ingestion/inhalation of a potentially harmful substance or object.","The nature of the suspected substance could not be confirmed.","There was no new or increased breathlessness.","There had been no loss of consciousness.","There was no blood in vomit or bowel motions or produced by coughing","There was no severe throat, chest, back or abdominal pain.","The individual was not experiencing palpitations.","There was no new or worsening confusion.","There was no excessive sweating/salivation or repeated vomiting following a possible toxic exposure.","The individual was not taking medication.","The individual had no past or current serious medical problems.","The individual''s approximate weight could not be confirmed.","Professional expertise, rather than any specific reference source, was used to determine the appropriate outcome.","The recommended response was not an emergency ambulance or Emergency Treatment Centre referral.","Ingestion of a battery, a magnet, a coin or a sharp or large object could not be confirmed.","The individual needs to contact a Primary Care Service within 2 hours.","I will arrange for a clinician to contact the individual. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Don''t deliberately try to be sick.","Don''t try to neutralise the substance with anything else (e.g. vinegar, bicarbonate of soda), except on medical advice.","Take the container, any label, and any leftover pills or substances to the hospital.","Anyone who takes an overdose or poison on purpose needs medical attention, even if they don''t appear to have suffered any ill-effects.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:39:51.299696+00', NULL);
