INSERT INTO pathwaysdos.scenarios VALUES (140, 6, 611, 1228, 1, 18, 4052, 1, 2, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1543, Self-Harm","There had been ingestion/inhalation of a potentially harmful substance or object.","The nature of the suspected substance could not be confirmed.","There was no new or increased breathlessness.","There had been no loss of consciousness.","There was no blood in vomit or bowel motions or produced by coughing","There was no severe throat, chest, back or abdominal pain.","The individual was not experiencing palpitations.","There was no new or worsening confusion.","There was no excessive sweating/salivation or repeated vomiting following a possible toxic exposure.","The individual was not taking medication.","The individual had no past or current serious medical problems.","The individual''s approximate weight could not be confirmed.","Professional expertise, rather than any specific reference source, was used to determine the appropriate outcome.","The recommended response was: Emergency Treatment Centre referral.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Don''t deliberately try to be sick.","Don''t try to neutralise the substance with anything else (e.g. vinegar, bicarbonate of soda), except on medical advice.","Take the container, any label, and any leftover pills or substances to the hospital.","Anyone who takes an overdose or poison on purpose needs medical attention, even if they don''t appear to have suffered any ill-effects.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:39:52.047911+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (144, 6, 571, 1105, 9, 26, 4460, 1, 2, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW728, Groin Pain or Groin Swelling","There was no vaginal abnormal bleeding.","There was no abdominal pain.","The individual was under 40 years of age.","There had been no previous diagnosis of aortic aneurysm or Marfan''s syndrome.","There was a swelling in the groin.","There was pain in the groin.","Pregnancy or possible pregnancy was reported.","The individual had been pregnant for 20 weeks or more.","The individual was not in labour.","The pain was not severe.","The individual was so ill they had stopped doing all normal activities.","Inability to flex the neck or photophobia were not described.","There had been no black and tarry or red/maroon bowel motions.","Neither pain nor swelling was present since symptom onset","The individual had not ingested a harmful or toxic substance.","There was new or worsening confusion.","There was no new or worsening breathlessness.","There was no new visual disturbance, severe headache or sudden increase in swelling/fluid retention.","The individual needs to speak to a primary care service within 1 hour.","I will arrange for a clinician to speak to the individual.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist."}', '2023-02-27 13:39:52.446384+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (145, 6, 559, 1065, 9, 26, 4460, 3, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1773, Skin Problems","The main problem was easy or unexplained bruising.","The individual was so ill they had stopped doing all normal activities.","A rash suggestive of septicaemia was not described.","Inability to flex the neck, photophobia or not responding normally were not described.","An assault had not occurred.","There was no fever at the time of assessment or within the previous 12 hours.","There was no apparent any pain.","Cold feet were described.","The individual needs to speak to a primary care service within 1 hour.","I will arrange for a clinician to speak to the individual.","IF THE RECOMMENDED TIMEFRAME FALLS DURING OPENING HOURS: Contact the service to arrange for the individual to be spoken to.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:39:52.566767+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (146, 6, 558, 1064, 9, 26, 4460, 3, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW654, Earache","The individual was so ill they had stopped doing all normal activities.","A rash suggestive of septicaemia was not described.","Inability to flex the neck, photophobia or not responding normally were not described.","Cold hands and feet were described.","The individual needs to speak to a primary care service within 1 hour.","I will arrange for a clinician to speak to the individual.","DOS call","A flannel soaked in warm water and held against the ear may help.","Don''t clean inside the ear, use ear drops or put anything else into the ear unless it has been prescribed.","Keep water out of the ears.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:39:52.666223+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (147, 6, 570, 1104, 9, 26, 4460, 1, 2, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","New confusion was the main reason for the contact.","The skin on the torso felt normal, warm or hot.","There was no previous history of diabetes.","Pathway Selected: PW728, Groin Pain or Groin Swelling","There was no vaginal abnormal bleeding.","There was abdominal pain as well as groin pain.","The pain did not interfere with normal activity .","The individual was under 55 years of age.","Pregnancy or possible pregnancy was reported.","The individual was less than 20 weeks pregnant.","The individual was so ill they had stopped doing all normal activities.","Neither pain nor swelling was present since symptom onset","There was no fever at the time of assessment or within the previous 12 hours.","The individual had not felt faint or passed out because of the pain.","There was no new or worsening breathlessness.","There was no new shoulder tip or one-sided lower abdominal pain","The individual needs to speak to a primary care service within 1 hour.","IF THE RECOMMENDED TIMEFRAME FALLS OUTSIDE OPENING HOURS: I will arrange for a clinician to speak to the individual.","DOS call","Try putting a heat pad or covered hot water bottle on the painful area."}', '2023-02-27 13:39:52.848434+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (159, 6, 601, 1206, 117, 90, 4010, 2, 2, '{"An ambulance response was not required.","Emergency contraception was requested.","A sexual assault had occurred.","The individual needs to attend an emergency treatment centre within 1 hour for Sexual Assault Assessment.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Don''t wash or change clothes until seen by a health care professional to avoid destroying important evidence.","When seen by the health care professional, inform them an assault has taken place.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Any cuts can be covered with a dry dressing. Dirt or anything else should not be cleaned out of the wound as this may be important evidence.","Don''t wash or change clothes until seen by a health care professional to avoid destroying important evidence.","When seen by the health care professional, inform them an assault has taken place.","If the situation appears to endanger anyone - CALL 999 FOR THE POLICE."}', '2023-02-27 13:39:54.107849+00', NULL);
