INSERT INTO pathwaysdos.scenarios VALUES (164, 6, 576, 1115, 4, 21, 4460, 2, 2, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the contact was not chest/upper back pain, recent fit/seizure, suicide attempt, new confusion or suspected stroke.","The main reason for contact was not declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW775, Lower Limb Pain or Swelling","There was pain or swelling above the knee.","There was no low back pain.","There was no swelling in the groin.","There was no pain in the groin.","The individual was so ill they had stopped doing all normal activities.","A rash suggestive of septicaemia was not described.","Inability to flex the neck, photophobia or not responding normally were not described.","There was no new loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There was no sudden onset of pain and swelling of an entire leg.","A leg had not suddenly become cold, pale or blue.","The individual had not suddenly become breathless.","There was no sharp/stabbing pain in the chest/upper back on coughing or deep breathing.","The individual had not coughed up blood.","The problem involved both legs.","One leg was not more swollen than the other one.","The individual needs to contact a Primary Care Service within 2 hours.","IF THE RECOMMENDED TIMEFRAME FALLS DURING OPENING HOURS: Contact the service to arrange for the individual to be seen within 2 hours.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist."}', '2023-02-27 13:39:54.826085+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (165, 6, 589, 1179, 1, 18, 4134, 1, 2, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","New confusion was the main reason for the assessment.","The skin on the torso felt normal, warm or hot.","There was no previous history of diabetes.","Pathway Selected: PW936, Vomiting and/or Nausea","The individual had vomited.","The individual did not also have diarrhoea.","There had been no vomiting of blood or faeces.","The symptoms did not follow drinking alcohol.","There had been no head injury in the previous 7 days.","There was no abdominal pain.","There was no crushing or severe aching chest, upper back or upper abdominal pain, or pain radiating to the arm, neck, jaw or shoulder.","The individual was so ill they had stopped doing all normal activities.","A rash suggestive of septicaemia was not described.","There had been no episodes of inability to raise both arms, speech difficulty or unilateral facial weakness in the last week.","There was new visual loss in the last 24 hours.","There was no new severe unsteadiness.","Inability to flex the neck or photophobia were not described.","There had been no black and tarry or red/maroon bowel motions.","There was no severe headache of sudden onset.","The individual had not ingested a harmful or toxic substance.","There was no new or worsening breathlessness.","There was no heat exposure or overexertion prior to symptom onset.","There was no previous diagnosis of migraine.","The individual needs to attend an emergency treatment centre within 1 hour.","SAFEGUARDING: From what I have heard there may be safeguarding concerns.","DOS call","Vomiting can be caused by gastro-enteritis (a tummy bug). Good hygiene will help to prevent spreading it to others."}', '2023-02-27 13:39:55.022165+00', NULL);
