INSERT INTO pathwaysdos.scenarios VALUES (168, 7, 614, 1045, 1, 18, 4072, 4, 1, '{"Birth had not occurred within the last hour.","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1718, Constipation","The child was unwell.","The individual was aged 6 months or older.","There was no fever at the time of assessment or within the previous 12 hours.","There were no breathing problems.","The individual was so ill they had stopped behaving normally.","A rash suggestive of septicaemia was not described.","The individual was responding normally.","The individual had no redcurrant-jelly stools or red bowel motions.","There was no vomiting.","There was testicular/scrotal pain.","Testicular pain began within the last 24 hours.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:40:13.788254+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (169, 7, 628, 1229, 117, 90, 4010, 1, 1, '{"There was bleeding from the head, face or inside the mouth.","Heavy bleeding had not occurred in the previous 2 hours.","Dental injury was the main problem.","There was no new/worsening breathlessness since the injury.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was responding normally.","The injury was not caused by a fall from 1 metre or more on to the head or falling from something moving","There was no associated head, facial or neck injury.","The problem only involved the teeth or gums.","There was no loss of consciousness, memory loss or vomiting.","There was no feeling of illness or other unusual symptoms before the injury.","The individual was not under the influence of drugs or alcohol.","A sexual assault had occurred.","A tooth or teeth had not been knocked out.","The individual needs to attend an emergency treatment centre within 1 hour for Sexual Assault Assessment.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Don''t wash or change clothes until seen by a health care professional to avoid destroying important evidence.","When seen by the health care professional, inform them an assault has taken place.","SAFEGUARDING: From what I have heard there may be safeguarding concerns.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Any cuts can be covered with a dry dressing. Dirt or anything else should not be cleaned out of the wound as this may be important evidence.","Don''t wash or change clothes until seen by a health care professional to avoid destroying important evidence.","When seen by the health care professional, inform them an assault has taken place.","If the situation appears to endanger anyone - CALL 999 FOR THE POLICE.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:40:13.969505+00', NULL);
