INSERT INTO pathwaysdos.scenarios VALUES (171, 7, 615, 1045, 9, 26, 4460, 4, 1, '{"Birth had not occurred within the last hour.","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1718, Constipation","The child was unwell.","The individual was aged 6 months or older.","There was a fever at the time of assessment or within the previous 12 hours.","There were no breathing problems.","The individual was so ill they had stopped behaving normally.","A rash suggestive of septicaemia was not described.","The individual was responding normally.","The individual had no redcurrant-jelly stools or red bowel motions.","There was no vomiting.","Cold hands were described.","The individual needs to speak to a primary care service within 1 hour.","I will arrange for a clinician to speak to the individual.","DOS call","Give them plenty to drink, little and often is best. If breastfeeding, breast milk is best.","Dress them in light clothes e.g. a T-shirt and nappy. Don''t wrap them up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:40:14.262428+00', NULL);
