INSERT INTO pathwaysdos.scenarios VALUES (173, 7, 617, 1115, 5, 22, 4481, 1, 2, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW774, Lower Limb Pain or Swelling","There was pain or swelling above the knee.","There was low back pain.","The pain did not interfere with normal activity .","The individual was able to carry out most or all normal activities.","The individual was under 55 years of age.","There was no possibility of pregnancy.","Neither leg pain nor leg swelling had developed since symptom onset","There was no new loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There was no vaginal abnormal bleeding.","There was no abdominal pain.","The pain began suddenly during physical activity.","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","The individual was completely unable to move because of pain.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to contact the individual. I need to ask some further questions in order to determine the best way to do this.","DOS call","Paracetamol and ibuprofen are both used to relieve pain and reduce high temperature and fever.","Unless advised not to, or it has already been given, paracetamol is best for relieving back pain. Take it regularly, not just when the pain is bad.","However, ibuprofen can be used instead of paracetamol. Follow the instructions in the pack. If in doubt ask a pharmacist."}', '2023-02-27 13:40:14.448119+00', NULL);
