INSERT INTO pathwaysdos.scenarios VALUES (183, 7, 620, 1130, 9, 26, 4460, 3, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1226, Nasal Congestion","Apart from the nasal congestion, there were no other breathing problems.","The individual was so ill they had stopped doing all normal activities.","A rash suggestive of septicaemia was not described.","Inability to flex the neck, photophobia or not responding normally were not described.","There was no nasal foreign body.","The nasal discharge was not unilateral.","Cold hands and feet were described.","The individual needs to speak to a primary care service within 1 hour.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Saline nose drops can help relieve a blocked or stuffy nose. Ask your pharmacist or health visitor about them.","Decongestant medicines, sprays or drops are not suitable for children under 6 years old, except on the advice of a doctor.","Avoid exposure to tobacco smoke.","It is important to have plenty of fluids, little and often is best.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:40:15.425408+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (185, 7, 622, 1152, 23, 39, 4031, 1, 1, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1771, Skin Problems","The main problem was a rash.","There was no blistering rash.","The rash had appeared within the previous 4 hours.","The individual was able to carry out most or all normal activities.","There was no rapid swelling of the lips, face, throat or tongue, wheezing, breathlessness or faintness.","There was no chest pain.","There had been no previous serious allergic reaction requiring emergency hospital care.","The skin problem did not relate to an assault.","The individual did not have a petechial/purpuric rash.","There was no new or worsening confusion.","Breathing harder or faster when doing nothing was not described.","There was no severe oropharyngeal ulceration.","Skin was not coming off in sheets.","There was no large area of redness like scalded skin.","There was no known increased susceptibilty to infection.","The rash was confined to one patch or area.","The problem did not involve just one spot or blemish.","There was no inflammation of the skin in the affected area.","There was no fever at the time of assessment or within the previous 12 hours.","There were genital sores.","This was not a recurrent episode of genital herpes.","The individual needs to contact a genito-urinary medicine clinic or other local service.","I can provide information about the nearest Genito-Urinary Medicine clinic.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:40:15.642259+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (186, 7, 623, 1155, 4, 21, 4319, 1, 1, '{"Reason for call menu - continued to next list.","A social or domestic emergency was the main reason for contact.","There was no immediate risk of violence.","An assault had not occurred.","The individual denied suicidal thoughts.","Withdrawing from alcohol was reported.","There had been no auditory or visual hallucinations.","The individual was not confused, agitated or restless.","The individual needs to contact a Primary Care Service within 2 hours.","I will arrange for a clinician to contact the individual. I need to ask some further questions in order to determine the best way to do this.","The individual should register as a temporary resident with a GP practice if they are not already registered.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","A responsible adult must stay with them until they have sobered up.","Check on them at least every 15 minutes. Make sure they wake up when spoken to or when their shoulder is shaken.","IF THEY ARE DROWSY: make sure they are lying on their side and can''t roll onto their back. Don''t put a pillow under their head.","Don''t let them have any more alcohol. They can have water to drink to prevent dehydration.","Keep them safe. Prevent them from falling and don''t let them drive or operate machinery.","They can''t be roused, have a fit, vomit without waking up, vomit blood or become violent - CALL 999.","DO NOT abruptly stop using alcohol. This can cause serious side effects, including fits.","Getting the right support is important.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:40:15.742391+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (187, 7, 627, 1203, 4, 21, 4319, 1, 1, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1751, Mental Health Problems","There was no worsening of a known mental health problem.","The individual had not been hearing voices, seeing things or behaving abnormally.","The main problem was not depression, low mood or sleep difficulty.","Help or advice about drug, alcohol or solvent misuse was not required.","The individual was experiencing anxiety.","The individual had not attacked or threatened anyone.","The individual denied suicidal thoughts.","Alcohol consumption was considered to be contributing to the problem.","Withdrawing from alcohol was reported.","The individual was not confused, agitated or restless.","The individual needs to contact a Primary Care Service within 2 hours.","I will arrange for a clinician to contact the individual. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","DO NOT abruptly stop using alcohol. This can cause serious side effects, including fits.","Getting the right support is important.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:40:15.862326+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (188, 7, 626, 1172, 9, 26, 4460, 4, 1, '{"Birth had not occurred within the last hour.","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1804, Unwell Infant","The baby was between 29 days and 16 weeks old.","There was no fever at the time of assessment or within the previous 12 hours.","There were breathing problems.","There were no signs of chest or abdominal recession.","There was no rapid swelling of the lips, face, tongue, mouth or throat.","The individual was so ill they had stopped behaving normally.","A rash suggestive of septicaemia was not described.","The individual was responding normally.","There had not been episode(s) of cessation of breathing for more than 20 seconds that day.","There were no grunting sounds when breathing.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","The individual had no redcurrant-jelly stools or red bowel motions.","There had been no travel to the Middle East in the past 2 weeks.","There had been no episode of choking within the previous 24 hours.","There was no vomiting.","Cold hands were described.","The individual needs to speak to a primary care service within 1 hour.","I will arrange for a clinician to speak to the individual.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:40:16.060289+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (270, 12, 716, 1191, 176, 176, 4474, 1, 1, '{"111 Call Handler","Reason for call menu - continued to next list.","A public health alert was the reason for contact.","Symptoms at the time of assessment.","There was no marked deterioration in the previous 24 hours.","The individual was able to manage symptoms at home.","The main reason for the contact was a request for coronavirus testing.","The caller could not access online services for COVID advice or testing.","Information on the location of a service was given.","I am going to give you the location of the service you require.","DOS call","Routine testing may not be carried out for the general public, however we will refer you to a service coordinating testing for further information.","If you have symptoms, stay at home and avoid public places.","FOR THOSE OVER 12 WEEKS OLD: Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt CALL your local pharmacy.","Any new shortness of breath, cough or fever, stay at home and you MUST go to nhs.uk online or call 111 for further advice.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:48:27.628174+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (189, 7, 618, 1128, 9, 26, 4460, 3, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW779, Lower Limb Pain or Swelling","The problem was not confined to the nail area.","There was no groin pain or swelling.","The individual was so ill they had stopped doing all normal activities.","A rash suggestive of septicaemia was not described.","Inability to flex the neck, photophobia or not responding normally were not described.","There was no sudden onset of pain and swelling of an entire leg.","A leg had not suddenly become cold, pale or blue.","There was no constriction of the limb by an object that could not be removed.","The individual was able to weight-bear.","Cold feet were described.","The individual needs to speak to a primary care service within 1 hour.","I will arrange for a clinician to speak to the individual.","The individual should register as a temporary resident with a GP practice if they are not already registered.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, either paracetamol OR ibuprofen can be used to relieve pain or reduce a fever.","It is not always necessary to use medication to treat a fever unless the child is particularly upset or uncomfortable.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","Remove any jewellery or tight clothing from around the swelling.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:40:16.187527+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (190, 7, 624, 1159, 5, 22, 4481, 1, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1346, Other Symptoms","There was no new or increased breathlessness.","The individual had lower back pain.","The pain did not interfere with normal activity .","The individual was able to carry out most or all normal activities.","Neither leg pain nor leg swelling had developed since symptom onset","There was no new loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There was no abdominal pain.","The pain began suddenly during physical activity.","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","The individual was completely unable to move because of pain.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to contact the individual. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Paracetamol and ibuprofen are both used to relieve pain and reduce high temperature and fever.","Unless advised not to, or it has already been given, paracetamol is best for relieving back pain. Take it regularly, not just when the pain is bad.","However, ibuprofen can be used instead of paracetamol. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:40:16.30861+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (191, 7, 625, 1172, 1, 18, 4072, 4, 1, '{"Birth had not occurred within the last hour.","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1804, Unwell Infant","The baby was between 29 days and 16 weeks old.","There was no fever at the time of assessment or within the previous 12 hours.","There were no breathing problems.","The individual was so ill they had stopped behaving normally.","A rash suggestive of septicaemia was not described.","Normal responsiveness could not be confirmed.","Redcurrant-jelly stools or red bowel motions could not be confirmed.","There was no vomiting.","There was a testicular/scrotal lump or swelling.","The individual appeared to be in pain.","Testicular pain began within the last 24 hours.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","OVER 12 WEEKS OLD: Unless advised not to, or they have already been given, either paracetamol OR  ibuprofen can be used to relieve pain or reduce a fever.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:40:16.448349+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (192, 7, 619, 1130, 1, 18, 4072, 4, 1, '{"Birth had not occurred within the last hour.","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1711, Nasal Congestion","There were no significant breathing problems.","There was no fever at the time of assessment or within the previous 12 hours.","The child was unwell.","The baby was between 29 days and 16 weeks old.","The individual was behaving normally.","The individual was responding normally.","The individual had no redcurrant-jelly stools or red bowel motions.","There was no vomiting.","There was testicular/scrotal pain.","Testicular pain began within the last 24 hours.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","DOS call","Saline nose drops can help relieve a blocked or stuffy nose. Ask your pharmacist or health visitor about them.","Decongestant medicines, sprays or drops are not suitable for children under 6 years old, except on the advice of a doctor.","Avoid exposure to tobacco smoke.","It is important to have plenty of fluids, little and often is best."}', '2023-02-27 13:40:16.580313+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (193, 8, 646, 1055, 1, 18, 4490, 4, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1708, Diarrhoea and Vomiting","The individual had not coughed or vomited blood.","The child was unwell.","There was a fever at the time of assessment or within the previous 12 hours.","The individual was so ill they had stopped behaving normally.","A rash suggestive of septicaemia was not described.","The individual was responding normally.","The individual had no redcurrant-jelly stools or red bowel motions.","There was no vomiting.","There was bruising.","The baby was independently mobile.","There was a new or worsening lump or swelling.","There was a new lump or swelling on the head, face or neck.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Breast-fed babies should continue to be breast-fed as normal to prevent dehydration.","Bottle-fed babies should continue to be given their normal, full strength formula to prevent dehydration.","OVER 12 WEEKS: give bottle-fed babies frequent, small amounts of freshly boiled and cooled water to prevent dehydration.","Wash hands after changing nappies or dealing with the vomit. Don''t share towels with others.","Give them plenty to drink, little and often is best. If breastfeeding, breast milk is best.","Dress them in light clothes e.g. a T-shirt and nappy. Don''t wrap them up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Becoming limp, floppy, unresponsive or having a fit - CALL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - CALL 999.","OVER 12 WEEKS OLD: Unless advised not to, or they have already been given, either paracetamol OR  ibuprofen can be used to relieve pain or reduce a fever.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:46:36.633366+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (194, 8, 652, 1047, 1, 18, 4489, 4, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1705, Cough","The individual had not coughed or vomited blood.","There were breathing problems.","There was a fever at the time of assessment or within the previous 12 hours.","There were no signs of chest or abdominal recession.","There was no rapid swelling of the lips, face, tongue, mouth or throat.","The individual was so ill they had stopped behaving normally.","A rash suggestive of septicaemia was not described.","The individual was responding normally.","There had not been episode(s) of cessation of breathing for more than 20 seconds that day.","There were no grunting sounds when breathing.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","The individual had no redcurrant-jelly stools or red bowel motions.","The individual had travelled to the Middle East in the last 2 weeks.","There had been no episode of choking within the previous 24 hours.","The individual had been vomiting.","The vomit was light or yellow-green in colour.","There was bruising.","The baby was not mobile.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Some cough medicines are not suitable for children under 6 years old. Follow the instructions in the pack. If in doubt ask a pharmacist.","Drink plenty of fluids.","Avoid exposure to tobacco smoke.","Don''t give them honey or corn syrup.","Give them plenty to drink, little and often is best. If breastfeeding, breast milk is best.","Dress them in light clothes e.g. a T-shirt and nappy. Don''t wrap them up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Becoming limp, floppy, unresponsive or having a fit - CALL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - CALL 999.","OVER 12 WEEKS OLD: Unless advised not to, or they have already been given, either paracetamol OR  ibuprofen can be used to relieve pain or reduce a fever.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","When seen or spoken to by a health care professional make sure they are told about the recent travel to the Middle East.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:46:36.82507+00', NULL);
