INSERT INTO pathwaysdos.scenarios VALUES (197, 8, 651, 1230, 1, 18, 4052, 1, 2, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1823, Cold Exposure","There had been no crushing chest, upper back or abdominal pain, or chest pain radiating to the arm, neck or jaw in the previous 24 hours.","There was no new inability to raise both arms, new difficulty speaking or new unilateral facial weakness.","The individual was not drowsy, confused or agitated.","There was no new or worsening breathlessness.","The individual was not experiencing palpitations.","The individual was not feeling unsteady or faint at the time of the assessment.","The individual was still exposed to cold conditions.","The individual was able to relocate to a warm environment.","There was uncontrollable shivering.","The individual had taken drugs.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Remove any wet outer clothing and quickly dry yourself.","Wrap yourself in dry blankets, towels or coats to keep warm. Cover your head and body first.","If possible have a warm drink and something to eat, do not drink alcohol.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:46:37.313913+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (198, 8, 645, 1054, 1, 18, 4490, 4, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1715, Diarrhoea","The child was unwell.","There was a fever at the time of assessment or within the previous 12 hours.","The individual was so ill they had stopped behaving normally.","A rash suggestive of septicaemia was not described.","The individual was responding normally.","The individual had no redcurrant-jelly stools or red bowel motions.","There was no vomiting.","There was bruising.","The baby was independently mobile.","There was a new or worsening lump or swelling.","There was a new lump or swelling on the head, face or neck.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Breast-fed babies should continue to be breast-fed as normal to prevent dehydration.","Bottle-fed babies should continue to be given their normal, full strength formula to prevent dehydration.","OVER 12 WEEKS: give bottle-fed babies frequent, small amounts of freshly boiled and cooled water to prevent dehydration.","Anti-diarrhoea medicines should not be given to babies except on the advice of a doctor.","Babies who have been weaned should continue to be fed as normal.","Diarrhoea can be caused by gastro-enteritis (a tummy bug). Good hygiene will help to prevent spreading it to others.","Wash hands after changing nappies. Don''t share towels with others.","Becoming limp, floppy, unresponsive or having a fit - CALL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - CALL 999.","Give them plenty to drink, little and often is best. If breastfeeding, breast milk is best.","Dress them in light clothes e.g. a T-shirt and nappy. Don''t wrap them up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Becoming limp, floppy, unresponsive or having a fit - CALL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - CALL 999.","OVER 12 WEEKS OLD: Unless advised not to, or they have already been given, either paracetamol OR  ibuprofen can be used to relieve pain or reduce a fever.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:46:37.492255+00', NULL);
