INSERT INTO pathwaysdos.scenarios VALUES (201, 8, 668, 1034, 1, 18, 4490, 4, 1, '{"111 Call Handler","Birth had not occurred within the last hour.","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1717, Breathing Problems, Breathlessness or Wheeze","The baby was between 29 days and 16 weeks old.","There was no fever at the time of assessment or within the previous 12 hours.","There were no signs of chest or abdominal recession.","There was no rapid swelling of the lips, face, tongue, mouth or throat.","The individual was behaving normally.","The individual was responding normally.","There had not been episode(s) of cessation of breathing for more than 20 seconds that day.","There were no grunting sounds when breathing.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","The individual had no redcurrant-jelly stools or red bowel motions.","There had been no travel to the Middle East in the past 2 weeks.","There was no bruising.","There was a new or worsening lump or swelling.","There was a new lump or swelling on the head, face or neck.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Hold the baby in a position that is comfortable for both you and the baby.","If an inhaler, spacer, or nebuliser is used, give it according to instructions on what to do if breathing gets worse.","If oxygen is prescribed and available give it according to the instructions.","Never use any medication that has been prescribed for someone else.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:46:37.929392+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (202, 8, 654, 1057, 10, 27, 4483, 1, 2, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW886, Difficulty Passing Urine","The individual was still able to carry out some normal activities.","There was no new loss of bowel control or leg movement and no saddle or lower limb paraesthesia.","There was inability to pass urine over the last 12 hours.","The pain was not getting worse.","There was no new or worsening confusion.","Breathing harder or faster when doing nothing was not described.","The individual needs to speak to a primary care service within 2 hours.","I will arrange for a clinician to speak to the individual.","The individual should register as a temporary resident with a GP practice if they are not already registered.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or it has already been given, paracetamol may be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use ibuprofen or any other anti-inflammatory medication until you have spoken to a healthcare professional.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:46:38.052294+00', NULL);
