else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:46:38.256015+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (204, 8, 641, 1020, 2, 19, 4014, 1, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 2 hours.","An injury or symptom relating to an injury was the main problem.","There was a minor injury (a bite or sting).","Pathway Selected: PW1575, Bites and Stings","The bite or sting was caused by an insect or spider.","The sting/bite had occurred within the previous 6 hours.","There was no rapid facial/oral swelling, wheezing or breathlessness following the bite/sting.","There was no rapidly spreading rash or widespread tingling sensation.","There was no visual disturbance, faintness or dizziness following the bite/sting.","The individual had been stung less than 10 times","The individual was not experiencing nausea and/or vomiting.","The sting was to a limb.","There was something constricting the limb that could not be removed.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Antihistamine medication and creams help reduce swelling and itching. They can be bought from pharmacies. Talk to the pharmacist for advice. Follow the instructions in the pack.","Remove any jewellery or tight clothing from the area.","If the sting is visible in the skin, brush or scrape it out with your fingernail or the edge of a credit card. Don''t try to pull it out with tweezers.","Wash the area with soap and water.","To help reduce pain and swelling, put a cold flannel on the area and raise above the level of the heart if possible. Don''t put ice on the skin.","Don''t scratch the area.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:46:38.368119+00', NULL);
