 not to, or they have already been given, either paracetamol OR  ibuprofen can be used to relieve pain or reduce a fever.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:46:38.627984+00', NULL);
