INSERT INTO pathwaysdos.scenarios VALUES (210, 8, 642, 1045, 1, 18, 4489, 4, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1718, Constipation","The child was unwell.","There was a fever at the time of assessment or within the previous 12 hours.","There were no breathing problems.","The individual was so ill they had stopped behaving normally.","A rash suggestive of septicaemia was not described.","The individual was responding normally.","The individual had no redcurrant-jelly stools or red bowel motions.","There was no vomiting.","There was bruising.","The baby was not mobile.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Give them plenty to drink, little and often is best. If breastfeeding, breast milk is best.","Dress them in light clothes e.g. a T-shirt and nappy. Don''t wrap them up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Becoming limp, floppy, unresponsive or having a fit - CALL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - CALL 999.","OVER 12 WEEKS OLD: Unless advised not to, or they have already been given, either paracetamol OR  ibuprofen can be used to relieve pain or reduce a fever.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:46:39.157059+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (304, 16, 746, 1225, 6, 23, 4003, 1, 1, '{"Senior Clinician Module","Coronavirus risk was not identified.","Referral to another service was required.","A referral to a primary care service or emergency treatment centre was required.","An illness or other health problem was the reason for referral.","Pathway Selected: PW1771, Skin Problems","A primary care service referral was required.","Contact Primary Care.","To contact a primary care service within 12 hours was considered appropriate.","The individual needs to contact a local service within 12 hours.","I will arrange for a clinician to contact the individual. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:49:42.397287+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (211, 8, 667, 1034, 1, 18, 4489, 4, 1, '{"111 Call Handler","Birth had not occurred within the last hour.","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1717, Breathing Problems, Breathlessness or Wheeze","Pathway Selected: PW1717, Breathing Problems, Breathlessness or Wheeze","The baby was between 16-26 weeks old.","There was no fever at the time of assessment or within the previous 12 hours.","There were no signs of chest or abdominal recession.","There was no rapid swelling of the lips, face, tongue, mouth or throat.","The individual was behaving normally.","The individual was responding normally.","There had not been episode(s) of cessation of breathing for more than 20 seconds that day.","There were no grunting sounds when breathing.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","The individual had no redcurrant-jelly stools or red bowel motions.","There had been no travel to the Middle East in the past 2 weeks.","There was bruising.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Hold the baby in a position that is comfortable for both you and the baby.","If an inhaler, spacer, or nebuliser is used, give it according to instructions on what to do if breathing gets worse.","If oxygen is prescribed and available give it according to the instructions.","Never use any medication that has been prescribed for someone else.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:46:39.3101+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (212, 8, 673, 1187, 10, 27, 4399, 1, 2, '{"111 Call Handler","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","Declared diabetic hypo or hyperglycaemia was the main reason for the contact.","The concern was that the blood sugar was too high.","The blood sugar level had been measured.","The units recorded by the testing machine could not be confirmed.","The testing machine was obtained from outside the UK.","The skin on the torso felt normal, warm or hot.","The individual was able to carry out most or all normal activities.","The individual was responding normally.","There was no new or worsening confusion.","There was a diagnosis of insulin dependent diabetes.","Insulin was delivered via an insulin pump.","The individual did not have a deep, sighing pattern of breathing.","The individual had not clinically deteriorated nor felt particularly unwell in the previous 24 hours.","The blood or urine had not been tested for ketones.","The individual was unwilling and/or unable to test the blood or urine for ketones.","The individual was under 55 years of age.","There was no possibility of pregnancy.","There were no previous diagnoses of heart or kidney failure.","There had not been a previous similar episode requiring hospital admission.","The insulin pump had not come out, come apart or stopped working.","The individual needs to speak to a primary care service within 2 hours.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:46:39.488082+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (213, 8, 672, 1172, 1, 18, 4490, 4, 1, '{"111 Call Handler","Birth had not occurred within the last hour.","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1804, Unwell Infant","The baby was older than 26 weeks.","There was a fever at the time of assessment or within the previous 12 hours.","There were breathing problems.","There were no signs of chest or abdominal recession.","There was no rapid swelling of the lips, face, tongue, mouth or throat.","The individual was behaving normally.","Normal responsiveness could not be confirmed.","There had not been episode(s) of cessation of breathing for more than 20 seconds that day.","There were no grunting sounds when breathing.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","The individual had no redcurrant-jelly stools or red bowel motions.","There had been no travel to the Middle East in the past 2 weeks.","There had been no episode of choking within the previous 24 hours.","There was no vomiting.","There was no bruising.","There was a new or worsening lump or swelling.","There was a new lump or swelling on the head, face or neck.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Give them plenty to drink, little and often is best. If breastfeeding, breast milk is best.","Dress them in light clothes e.g. a T-shirt and nappy. Don''t wrap them up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Becoming limp, floppy, unresponsive or having a fit - CALL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - CALL 999.","UNDER 12 WEEKS OLD: A baby under 12 weeks should not be given any medicine unless it has been prescribed or advised by a doctor, nurse, health visitor or pharmacist.","OVER 12 WEEKS OLD: Unless advised not to, or they have already been given, either paracetamol OR  ibuprofen can be used to relieve pain or reduce a fever.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:46:39.674097+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (214, 8, 666, 1204, 1, 18, 4492, 1, 2, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1684, Sexual or Menstrual Concerns","A sexual assault had not occurred.","There was a problem concerning contraception.","There had been a possible failure of contraception.","Contraception had been used.","A barrier contraception method appears to have failed.","Intercourse took place within the previous 48 hours.","Intercourse was with somebody known to have HIV or hepatitis.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","There are two types of emergency contraception that can be used, morning after pill or the coil (IUD).","Both types of emergency contraception are effective at preventing pregnancy if they are used soon after unprotected sex or contraceptive failure.","It''s important to get advice from a health care professional as soon as possible.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:46:39.78954+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (215, 8, 670, 1084, 1, 18, 4490, 4, 1, '{"111 Call Handler","Birth had not occurred within the last hour.","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1703, Fever","The symptoms did not follow heat exposure.","There were no significant breathing problems.","The baby was between 29 days and 16 weeks old.","The individual was behaving normally.","The individual was responding normally.","The individual had no redcurrant-jelly stools or red bowel motions.","There was no vomiting.","There was no bruising.","There was a new or worsening lump or swelling.","There was a new lump or swelling on the head, face or neck.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Give them plenty to drink, little and often is best. If breastfeeding, breast milk is best.","Dress them in light clothes e.g. a T-shirt and nappy. Don''t wrap them up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Becoming limp, floppy, unresponsive or having a fit - CALL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - CALL 999.","UNDER 12 WEEKS OLD: A baby under 12 weeks should not be given any medicine unless it has been prescribed or advised by a doctor, nurse, health visitor or pharmacist.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:46:39.94493+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (240, 9, 682, 1024, 11, 28, 4487, 1, 2, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1771, Skin Problems","The main problem was a rash.","There was a blistering rash.","The individual was able to carry out most or all normal activities.","The skin problem did not relate to an assault.","There was no rash like blood spots or bruises under the skin.","There was no new or worsening confusion.","Breathing harder or faster when doing nothing was not described.","There was no known increased susceptibilty to infection.","Lots of blisters or ulcers inside the mouth were not described.","Skin was not coming off in sheets.","There was no large area of redness like scalded skin.","Blistering did not involve an eye.","The blisters were not in a painful line or group.","There had not been a recent vaccination at the site of the problem.","The problem was said to be chickenpox.","The rash had appeared within the previous 24 hours.","The individual needs to speak to a primary care service within 6 hours.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Speak to a pharmacist for advice on suitable treatments.","If shingles or chickenpox is suspected they should avoid contact with pregnant women.","Unless advised not to take, paracetamol can be used to relieve pain or fever. Follow the instructions in the pack.","Don''t use ibuprofen if chickenpox is suspected.","If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:47:09.309323+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (216, 8, 664, 1179, 1, 18, 4493, 1, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW939, Vomiting and/or Nausea","The individual had vomited.","The individual did not also have diarrhoea.","There had been no vomiting of blood or faeces.","The symptoms did not follow drinking alcohol.","There had been a head injury in the previous 4 weeks.","There was no abdominal pain.","There was no crushing or severe aching chest, upper back or upper abdominal pain, or pain radiating to the arm, neck, jaw or shoulder.","The individual was able to carry out most or all normal activities.","There had been no episodes of inability to raise both arms, speech difficulty or unilateral facial weakness in the last week.","There was no new sudden visual loss or disturbance in the last 24 hours.","There had been no black and tarry or red/maroon bowel motions.","There was no severe headache of sudden onset.","The individual had not ingested a harmful or toxic substance.","There was no heat exposure or overexertion prior to symptom onset.","There was no new or worsening confusion.","The individual had experienced new, persistent headache since the head injury.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Don''t let them have anything to eat or drink (a sip of water is fine if medication needs to be taken).","Vomiting can be caused by gastro-enteritis (a tummy bug). Good hygiene will help to prevent spreading it to others.","Wash hands after dealing with the vomit. Don''t share towels with others.","Clean any vomit bowls with disinfectant.","Becoming very drowsy, unresponsive or having a fit - CALL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - CALL 999.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","However, if they cannot be woken up or they become dazed, groggy or have a fit - CALL 999.","If there are any problems understanding, speaking, balancing or walking - CALL 999.","If there is any loss of feeling in any part of the body, general weakness or new deafness - CALL 999."}', '2023-02-27 13:46:40.113494+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (217, 8, 658, 1110, 2, 19, 4493, 1, 1, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An injury or symptom relating to an injury was the main problem.","There was a minor injury (a scratch, graze or minor wound).","Pathway Selected: PW684, Head, Facial or Neck Injury, Blunt","There was no new/worsening breathlessness since the injury.","The individual had not experienced a seizure around the time of or since the injury.","There was no new confusion or agitation or new difficulty speaking, reading or writing.","There was no new limb weakness, coordination problems or sensory change or loss.","There was no bleeding or fluid leak from an ear and no new deafness.","The individual was responding normally.","There was no new continuous neck pain following the injury.","There was no new visual disturbance.","There was no new skull or facial deformity.","The injury was not caused by falling onto the head from something moving or hitting the head when diving.","There had not been a fall from a height of 1 metre or more.","There was no bruising around the uninjured eye or ear.","The individual was able to get up from the floor.","A minor assault had occurred.","There was no loss of consciousness or memory loss.","There was no drug or alcohol use around the time of injury or since.","There was no previous history of brain surgery.","There had been no vomiting following the head injury.","A headache has developed following the head injury.","There had not been a severe or worsening headache following the head injury.","There was no new numbness or crackly feeling near the eye.","There was no new difficulty opening or closing the jaw.","There was no worsening pain or swelling.","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","The individual fell from a standing height at ground level","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Any cuts can be covered with a dry dressing. Dirt or anything else should not be cleaned out of the wound as this may be important evidence.","Don''t wash or change clothes until seen by a health care professional to avoid destroying important evidence.","When seen by the health care professional, inform them an assault has taken place.","If the situation appears to endanger anyone - CALL 999 FOR THE POLICE.","A responsible adult should stay with anyone who has had a head injury to watch out for any problems.","Unless advised not to, or they have already been given, paracetamol can be used to relieve pain. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use any other painkillers, they can cause complications following a head injury.","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","However, if they cannot be woken up or they become dazed, groggy or have a fit - CALL 999.","If there are any problems understanding, speaking, balancing or walking - CALL 999.","If there is any loss of feeling in any part of the body, general weakness or new deafness - CALL 999.","If there is any vomiting, any change in vision, or a severe or worsening headache - GO STRAIGHT TO THE NEAREST EMERGENCY DEPARTMENT."}', '2023-02-27 13:46:40.284978+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (218, 8, 659, 1111, 2, 19, 4493, 1, 1, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An injury or symptom relating to an injury was the main problem.","There was a minor injury (a scratch, graze or minor wound).","Pathway Selected: PW692, Head, Facial or Neck Injury, Penetrating","There was no new/worsening breathlessness since the injury.","The individual had not experienced a seizure around the time of or since the injury.","The wound was not bleeding freely at the time of assessment.","There was no foreign body in the wound.","There was no new confusion or agitation or new difficulty speaking, reading or writing.","There was no new limb weakness, coordination problems or sensory change or loss.","There was no bleeding or fluid leak from an ear and no new deafness.","The individual was responding normally.","There was no new continuous neck pain following the injury.","There was no new visual disturbance.","There was no new skull or facial deformity.","The injury was not caused by falling onto the head from something moving or hitting the head when diving.","There had not been a fall from a height of 1 metre or more.","There was no bruising around the uninjured eye or ear.","The individual was able to get up from the floor.","A minor assault had occurred.","The problem was not a needlestick injury.","There was no loss of consciousness or memory loss.","There was no drug or alcohol use around the time of injury or since.","There was no previous history of brain surgery.","There had been no vomiting following the head injury.","A headache has developed following the head injury.","There had not been a severe or worsening headache following the head injury.","The injury was not a complex wound.","There was no injury to the mouth, nose or ear.","There was no new numbness or crackly feeling near the eye.","There was no new difficulty opening or closing the jaw.","There was no worsening pain or swelling.","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","The individual fell from a standing height at ground level","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Any cuts can be covered with a dry dressing. Dirt or anything else should not be cleaned out of the wound as this may be important evidence.","Don''t wash or change clothes until seen by a health care professional to avoid destroying important evidence.","When seen by the health care professional, inform them an assault has taken place.","If the situation appears to endanger anyone - CALL 999 FOR THE POLICE.","A responsible adult should stay with anyone who has had a head injury to watch out for any problems.","Unless advised not to, or they have already been given, paracetamol can be used to relieve pain. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use any other painkillers, they can cause complications following a head injury.","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","However, if they cannot be woken up or they become dazed, groggy or have a fit - CALL 999.","If there are any problems understanding, speaking, balancing or walking - CALL 999.","If there is any loss of feeling in any part of the body, general weakness or new deafness - CALL 999.","If there is any vomiting, any change in vision, or a severe or worsening headache - GO STRAIGHT TO THE NEAREST EMERGENCY DEPARTMENT.","A decision about whether tetanus immunisation is needed can be made when the injury is checked.","Use a dry dressing or a clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth."}', '2023-02-27 13:46:40.486598+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (219, 8, 665, 1112, 1, 18, 4493, 1, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW755, Headache","There had been a head injury in the previous 4 weeks.","There was no fainting or loss of consciousness in the previous 24 hours.","The individual was still able to carry out some normal activities.","There had been no episodes of inability to raise both arms, speech difficulty or unilateral facial weakness in the last week.","There had been no episode of unilateral leg weakness in the last week.","There was no new loss or disturbance of vision.","There was no severe headache of sudden onset.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","There was no new or worsening confusion.","The individual had been vomiting.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Becoming very drowsy, unresponsive or having a fit - CALL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - CALL 999.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:46:40.628146+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (220, 8, 671, 1172, 1, 18, 4489, 4, 1, '{"111 Call Handler","Birth had not occurred within the last hour.","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1804, Unwell Infant","The baby was between 16-26 weeks old.","There was no fever at the time of assessment or within the previous 12 hours.","There were no breathing problems.","The individual was behaving normally.","Normal responsiveness could not be confirmed.","The individual had no redcurrant-jelly stools or red bowel motions.","The individual had been vomiting.","The colour of the vomit was not green or yellow.","There was no testicular/scrotal pain, lump or swelling.","There was bruising.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:46:40.807984+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (221, 8, 649, 1130, 1, 18, 4490, 4, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1711, Nasal Congestion","There were no significant breathing problems.","There was a fever at the time of assessment or within the previous 12 hours.","The individual was so ill they had stopped behaving normally.","A rash suggestive of septicaemia was not described.","The individual was responding normally.","The individual had no redcurrant-jelly stools or red bowel motions.","There was no vomiting.","There was bruising.","The baby was independently mobile.","There was a new or worsening lump or swelling.","There was a new lump or swelling on the head, face or neck.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Give them plenty to drink, little and often is best. If breastfeeding, breast milk is best.","Dress them in light clothes e.g. a T-shirt and nappy. Don''t wrap them up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Becoming limp, floppy, unresponsive or having a fit - CALL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - CALL 999.","OVER 12 WEEKS OLD: Unless advised not to, or they have already been given, either paracetamol OR  ibuprofen can be used to relieve pain or reduce a fever.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","Saline nose drops can help relieve a blocked or stuffy nose. Ask your pharmacist or health visitor about them.","Decongestant medicines, sprays or drops are not suitable for children under 6 years old, except on the advice of a doctor.","Avoid exposure to tobacco smoke.","It is important to have plenty of fluids, little and often is best.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:46:40.956407+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (222, 8, 661, 1120, 2, 19, 4486, 1, 1, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An injury or symptom relating to an injury was the main problem.","There was a minor injury (a scratch, graze or minor wound).","Pathway Selected: PW1234, Leg Injury, Penetrating","The wound was not bleeding freely at the time of assessment.","The limb had not become cold, pale or blue.","There was no bone protruding through the skin.","There was no new limb deformity.","There was no apparent shortening of the leg.","The individual was able to weight-bear at the time of assessment.","There was no foreign body in the wound.","A minor assault had occurred.","The problem was not a needlestick injury.","The injury was not a complex wound.","There was no constriction of the limb by an object that could not be removed.","There was no injury within 7.5 cm of the ankle or knee.","There was ability to move the limb following the injury.","There was no worsening pain.","The individual fell from a standing height at ground level","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Any cuts can be covered with a dry dressing. Dirt or anything else should not be cleaned out of the wound as this may be important evidence.","Don''t wash or change clothes until seen by a health care professional to avoid destroying important evidence.","When seen by the health care professional, inform them an assault has taken place.","If the situation appears to endanger anyone - CALL 999 FOR THE POLICE.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Use a dry dressing or a clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","IN LIMBS: raise the injured area above the level of the heart and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","Use pillows or a sling to keep the injured area raised.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","IN LIMBS: raise the injured area above the level of the heart using pillows or a sling.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-02-27 13:46:41.096484+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (223, 8, 660, 1119, 2, 19, 4486, 1, 1, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An injury or symptom relating to an injury was the main problem.","There was a minor injury (a scratch, graze or minor wound).","Pathway Selected: PW1241, Leg Injury, Blunt","There was no doubt that the symptoms resulted from an injury.","The limb had not become cold, pale or blue.","There was no new limb deformity.","There was no apparent shortening of the leg.","The individual was able to weight-bear at the time of assessment.","A minor assault had occurred.","There was no new numbness or pins and needles in the foot or leg.","There was no constriction of the limb by an object that could not be removed.","There was no worsening pain.","There was no severe pain on joint movement.","The injury was above the knee.","The individual fell from a standing height at ground level","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Any cuts can be covered with a dry dressing. Dirt or anything else should not be cleaned out of the wound as this may be important evidence.","Don''t wash or change clothes until seen by a health care professional to avoid destroying important evidence.","When seen by the health care professional, inform them an assault has taken place.","If the situation appears to endanger anyone - CALL 999 FOR THE POLICE.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t leave ice on while asleep. Don''t put ice directly on the skin.","Raise a swollen ankle or knee by sitting with the foot on a stool, or lying with it propped on pillows.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:46:41.216326+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (226, 8, 662, 1181, 6, 23, 4485, 1, 1, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1776, Wound Problems","The pain was not severe.","The wound was not to the abdomen or a limb.","There was no complete wound dehiscence.","The wound was not bleeding freely.","The individual was able to carry out most or all normal activities.","There was no new or worsening confusion.","Breathing harder or faster when doing nothing was not described.","There was no fever at the time of assessment or within the previous 12 hours.","There was no increasing pain or swelling in the area.","Redressing was required.","The wound was due to a burn.","The individual needs to contact a primary care service within 12 hours.","I will arrange for a clinician to contact the individual. I need to ask some further questions in order to determine the best way to do this.","The individual should register as a temporary resident with a GP practice if they are not already registered.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:46:41.576017+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (227, 8, 663, 1231, 2, 19, 4052, 1, 2, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 2 hours.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had occurred.","A gunshot or stabbing injury or a rollover or ejection from a vehicle or a corrosive substance attack had not occurred.","The injury did not involve a fall of 5 metres or more, a major burn, massive blunt injury, a major wound or amputation or a suicide attempt.","The injury involved near-drowning.","The incident occurred less than 1 hour ago.","There were other injuries present.","There were no multiple major injuries, injuries affecting the head, neck or torso, or a major wound or amputation.","There was no chest pain around the time of the incident.","There was no new confusion or drowsiness.","Breathing harder or faster when doing nothing was not described.","There was no new or worsening breathlessness since the incident.","There were no palpitations at the time of the assessment.","There was persistent or severe coughing since the drowning incident.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Carefully remove any wet outer clothing and quickly dry the individual.","Wrap in dry blankets, towels or coats to keep them warm. Cover the head and body first.","If possible give a warm drink and something to eat, do not give alcohol.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Use a dry dressing or a clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","IN LIMBS: raise the injured area above the level of the heart and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","Use pillows or a sling to keep the injured area raised.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","IN LIMBS: raise the injured area above the level of the heart using pillows or a sling.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-02-27 13:46:41.736316+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (228, 9, 685, 1107, 1, 18, 4500, 2, 2, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1267, Hand or Wrist Injury, Blunt","The individual had no associated arm injury.","The individual was able to get up from the floor.","The hand had not become cold, pale or blue.","There was new hand or wrist deformity.","Injury was not restricted to the digits.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","IN PREGNANCY: Don''t take ibuprofen, except on the advice of a healthcare professional. Use paracetamol instead.","The individual should not eat or drink anything before going to hospital (a sip of water is fine if medication needs to be taken).","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","If possible raise a swollen hand or wrist with a sling. When in bed raise it on pillows.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:47:07.667949+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (229, 9, 691, 1119, 1, 18, 4501, 1, 2, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 2 hours.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1240, Leg Injury, Blunt","There was no doubt that the symptoms resulted from an injury.","There was no apparent shortening of the leg.","The limb was cold, pale or blue.","There was no new limb deformity or swelling.","There was somebody available to offer safe transport to hospital.","Avoid using the injured limb. Try to keep it supported.","Do not try to straighten anything that looks out of shape.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","IN PREGNANCY: Don''t take ibuprofen, except on the advice of a healthcare professional. Use paracetamol instead.","The individual should not eat or drink anything before going to hospital (a sip of water is fine if medication needs to be taken).","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","If possible raise a swollen ankle or knee by sitting with the foot on a stool, or lying with it propped on pillows.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:47:07.792281+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (570, 33, 483, 1052, 129, 102, 4454, 1, 1, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An injury or symptom relating to an injury was the main problem.","Pathway Selected: PW620, Dental Injury","Referral to Dental Service required.","A tooth or teeth had not been knocked out.","Referral to Emergency Dental Treatment Centre required.","The individual needs to attend an emergency dental treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:33.398141+00', NULL);
