lery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","If possible raise a swollen ankle or knee by sitting with the foot on a stool, or lying with it propped on pillows.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:47:07.925057+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (231, 9, 684, 1069, 1, 18, 4499, 4, 2, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1399, Eye Injury, Penetrating","There was an associated head, facial or neck injury.","There was no new/worsening breathlessness since the injury.","The individual had not experienced a seizure around the time of or since the injury.","The wound was not bleeding freely at the time of assessment.","There was no foreign body penetrating the eye or eye socket.","There was no fluid leak or bleeding from the ear or nose.","The individual was responding normally.","There was no new skull deformity, a bruise, swelling or wound, more than 5cm across.","There was no bruising around the uninjured eye or ear.","There had not been a fall directly onto the head.","An assault had not occurred.","There was no loss of consciousness at the time of the injury.","There was no vomiting following the injury.","There was no previous history of brain surgery.","The individual was using anticoagulant medication.","There was somebody available to offer safe transport to hospital.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there is an object stuck in or near the eye don''t try to remove it.","Don''t try to look in the eye if it is swollen shut.","Close both eyes, cover them with a soft pad or dressing and fasten it gently with some tape. Don''t put any pressure on the eyeball.","Don''t let them rub the eye.","Cover the wound with a clean cloth folded into a pad, but don''t put any pressure on the eye.","If the blood soaks through the pad don''t take it off, put another pad on top of it.","If helping someone else: try to keep their blood off your skin.","Make sure that they are with a responsible adult for 48 hours after having the head injury so that they can watch out for any problems.","Babies tend to sleep after a head injury. This is fine as long as they are woken every hour for the first 6 hours after the injury.","OVER 12 WEEKS OLD: Unless advised not to, or they have already been given, paracetamol can be used to relieve pain.","Don''t use any other painkillers, they can cause complications following a head injury.","Remove any jewellery or tight clothing from around the swelling.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Or, if the baby cannot be woken or has a fit - CALL 999."}', '2023-02-27 13:47:08.075937+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (232, 9, 692, 1120, 1, 18, 4500, 1, 2, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 2 hours.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1234, Leg Injury, Penetrating","The wound was not bleeding freely at the time of assessment.","There was no bone protruding through the skin.","There was no apparent shortening of the leg.","The limb had not become cold, pale or blue.","There was new swelling around the injured area.","The individual was unable to weight-bear at the time of assessment.","There was no foreign body in the wound.","The injury was not above the knee.","The pain was not severe.","There was somebody available to offer safe transport to hospital.","Avoid using the injured limb. Try to keep it supported.","Do not try to straighten anything that looks out of shape.","If there is an object stuck in the wound don''t try to remove it and don''t press on the object itself. Cover the wound with a clean cloth.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","IN PREGNANCY: Don''t take ibuprofen, except on the advice of a healthcare professional. Use paracetamol instead.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Use a dry dressing or a clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","IN LIMBS: If possible raise the injured area and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","Use pillows or a sling to keep the injured area raised.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","IN LIMBS: If possible raise the injured area using pillows or a sling.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-02-27 13:47:08.227799+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (233, 9, 686, 1107, 1, 18, 4501, 2, 2, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1267, Hand or Wrist Injury, Blunt","The individual had no associated arm injury.","The individual was able to get up from the floor.","The hand was cold, pale or blue.","Injury was not restricted to the digits.","There was no new limb deformity or swelling.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","IN PREGNANCY: Don''t take ibuprofen, except on the advice of a healthcare professional. Use paracetamol instead.","The individual should not eat or drink anything before going to hospital (a sip of water is fine if medication needs to be taken).","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","If possible raise a swollen hand or wrist with a sling. When in bed raise it on pillows.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:47:08.35335+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (234, 9, 679, 1014, 1, 18, 4500, 2, 1, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW895, Arm Injury, Blunt","The injury did not involve the shoulder, elbow or upper arm.","The limb had not become cold, pale or blue.","The individual was able to get up from the floor.","There was new limb deformity.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist","The individual should not eat or drink anything before going to hospital (a sip of water is fine if medication needs to be taken).","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","If possible raise a swollen hand or wrist with a sling. When in bed raise it on pillows.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:47:08.467529+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (235, 9, 678, 1012, 1, 18, 4501, 2, 2, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1518, Ankle or Foot Injury, Penetrating","The wound was not bleeding freely at the time of assessment.","There was no bone protruding through the skin.","The foot was cold, pale or blue.","There was new swelling around the injured area.","There was somebody available to offer safe transport to hospital.","Avoid using the injured limb. Try to keep it supported.","Do not try to straighten anything that looks out of shape.","If there is an object stuck in the wound don''t try to remove it and don''t press on the object itself. Cover the wound with a clean cloth.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","IN PREGNANCY: Don''t take ibuprofen, except on the advice of a healthcare professional. Use paracetamol instead.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Use a dry dressing or a clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","IN LIMBS: If possible raise the injured area and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","Use pillows or a sling to keep the injured area raised.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","IN LIMBS: If possible raise the injured area using pillows or a sling.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-02-27 13:47:08.595954+00', NULL);
