INSERT INTO pathwaysdos.scenarios VALUES (238, 9, 697, 1143, 1, 18, 4497, 1, 2, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1553, Diarrhoea and Vomiting","There had been no vomiting of blood or faeces.","There was abdominal pain with the diarrhoea and vomiting.","The pain interfered with normal activity.","There had been no previous diagnosis of aortic aneurysm or Marfan''s syndrome.","The individual was able to carry out most or all normal activities.","The individual had passed a red or maroon-coloured bowel motion.","The individual had not ingested a harmful or toxic substance.","The individual had not felt faint or dizzy.","Breathing harder or faster when doing nothing was not described.","There was no new or worsening confusion.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Drink frequent, small amounts of water. Also have some dilute fruit juice, squash or thin soups.","Wash hands after using the toilet or dealing with vomit.","Unless advised not to, paracetamol may be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use ibuprofen or any other anti-inflammatory medication until you have spoken to a healthcare professional.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:47:09.036112+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (239, 9, 683, 1068, 1, 18, 4499, 4, 2, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1397, Eye Injury, Blunt","There was no new/worsening breathlessness since the injury.","The individual had not experienced a seizure around the time of or since the injury.","There was no fluid leak or bleeding from the ear or nose.","The individual was responding normally.","There was no new skull deformity, bruise, swelling or wound more than 5cm across.","There was no bruising around the uninjured eye or ear.","There had not been a fall directly onto the head.","An assault had not occurred.","There was no loss of consciousness at the time of the injury.","There was no vomiting following the injury.","There was no previous history of brain surgery.","The individual was using anticoagulant medication.","There was somebody available to offer safe transport to hospital.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","To help reduce pain and swelling hold a cold flannel over the injured eye for 10-30 minutes.","OVER 12 WEEKS OLD: Unless advised not to take, paracetamol OR ibuprofen can be used to relieve pain or fever. Don''t give both together.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:47:09.168115+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (241, 9, 696, 1143, 130, 103, 4403, 1, 2, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1553, Diarrhoea and Vomiting","There had been no vomiting of blood or faeces.","There was abdominal pain with the diarrhoea and vomiting.","The pain interfered with normal activity.","There had been no previous diagnosis of aortic aneurysm or Marfan''s syndrome.","The individual was able to carry out most or all normal activities.","The individual had passed a red or maroon-coloured bowel motion.","The individual had not ingested a harmful or toxic substance.","The individual had not felt faint or dizzy.","Breathing harder or faster when doing nothing was not described.","There was no new or worsening confusion.","There had been travel within the last 4 weeks from a country affected by the current Ebola outbreak.","Private transport to hospital was available.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual, which must only be a member of the household.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","I will inform the Emergency Department that the individual will be attending.","When seen or spoken to by a health care professional make sure they are t