Don''t leave ice on while asleep.","If possible raise a swollen hand or wrist with a sling. When in bed raise it on pillows.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:47:09.593169+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (243, 9, 694, 1132, 1, 18, 4499, 4, 2, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1731, Nosebleeds after Injury","The individual had not experienced a seizure around the time of or since the injury.","There was no fluid leak from an ear.","The individual was responding normally.","There was no new skull deformity, a bruise, swelling or wound, more than 5cm across.","There was no bruising around the uninjured eye or ear.","There had not been a fall directly onto the head.","An assault had not occurred.","There was no loss of consciousness at the time of the injury.","There was no vomiting following the injury.","There was no previous history of brain surgery.","The individual was using anticoagulant medication.","There was somebody available to offer safe transport to hospital.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Make sure that they are with a responsible adult for 48 hours after having the head injury so that they can watch out for any problems.","Babies tend to sleep after a head injury. This is fine as long as they are woken every hour for the first 6 hours after the injury.","OVER 12 WEEKS OLD: Unless advised not to, or they have already been given, paracetamol can be used to relieve pain.","Don''t use any other painkillers, they can cause complications following a head injury.","Remove any jewellery or tight clothing from around the swelling.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Or, if the baby cannot be woken or has a fit - CALL 999."}', '2023-02-27 13:47:09.718786+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (244, 9, 695, 1133, 5, 22, 4498, 1, 2, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1683, Numbness or Unusual Feelings in the Skin","The main area affected was the trunk.","There had been no crushing chest, upper back or abdominal pain, or chest pain going to the arm, neck or jaw in the previous 24 hours.","There had not been a head, neck or back injury in the previous 2 weeks.","There had been no episodes of inability to raise both arms, speech difficulty or unilateral facial weakness in the last week.","There had been no episode of unilateral leg weakness in the last week.","There had been no contact with something that might be poisonous.","There was no new loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There was new blistering of the area.","The blisters appeared within the previous 7 days.","The blisters had appeared within the previous 3 days.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to contact the individual. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:47:09.836315+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (258, 11, 713, 1206, 175, 175, 4474, 1, 1, '{"Senior Clinician Module","Coronavirus concern.","The situation was not believed to be life threatening.","No one else was considered to be vulnerable and at risk","A clinical assessment service was considered appropriate.","Covid assessment service 12 hours was required","The individual needs to speak to a local service within 12 hours.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","You must self isolate. Stay indoors and avoid public places.","Try to avoid visitors to your home. Essential supplies can be dropped off.","Do not use public transport or taxis.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt CALL your local pharmacy.","If the condition gets worse or you have any other concerns while you are waiting, call us back. For further information about Coronavirus (COVID-19) go to nhs.uk."}', '2023-02-27 13:48:02.950744+00', NULL);
