back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Use a dry dressing or a clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","IN LIMBS: If possible raise the injured area and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","Use pillows or a sling to keep the injured area raised.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-02-27 13:47:09.976719+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (246, 9, 698, 1178, 1, 18, 4057, 3, 2, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1354, Vaginal Swellings","There was no abdominal pain.","A sexual assault had not occurred.","There was a retained vaginal foreign body.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Don''t try to remove the object.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:47:10.071964+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (247, 9, 699, 1024, 5, 22, 4498, 1, 2, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1771, Skin Problems","The main problem was a rash.","There was a blistering rash.","The individual was still able to carry out some normal activities.","The skin problem did not relate to an assault.","There was no rash like blood spots or bruises under the skin.","There was no new or worsening confusion.","Breathing harder or faster when doing nothing was not described.","There was no known increased susceptibilty to infection.","Lots of blisters or ulcers inside the mouth were not described.","Skin was not coming off in sheets.","There was no large area of redness like scalded skin.","Blistering did not involve an eye.","The blisters were in a painful line or group.","The blisters appeared within the previous 7 days.","The blisters had appeared within the previous 3 days.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to contact the individual. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to take, paracetamol can be used to relieve pain or fever. Follow the instructions in the pack.","Don''t use ibuprofen if chickenpox is suspected.","If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:47:10.207727+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (248, 9, 675, 1011, 1, 18, 4500, 1, 2, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 2 hours.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1512, Ankle or Foot Injury, Blunt","The individual was unable to weight-bear at the time of assessment.","The foot had not become cold, pale or blue.","There was new limb deformity.","The pain was not severe.","There was somebody available to offer safe transport to hospital.","Avoid using the injured limb. Try to keep it supported.","Do not try to straighten anything that looks out of shape.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","IN PREGNANCY: Don''t take ibuprofen, except on the advice of a healthcare professional. Use paracetamol instead.","The individual should not eat or drink anything before going to hospital (a sip of water is fine if medication needs to be taken).","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","If possible raise a swollen ankle or knee by sitting with the foot on a stool, or lying with it propped on pillows.","If possible raise a swollen hand or wrist with a sling. When in bed raise it on pillows.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:47:10.335659+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (249, 9, 689, 1111, 2, 19, 4499, 3, 1, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW694, Head, Facial or Neck Injury, Penetrating","There was no new/worsening breathlessness since the injury.","There was no new weakness or co-ordination problems of the limbs.","The individual had not experienced a seizure around the time of or since the injury.","There was no new confusion, agitation or speech difficulty.","The wound was not bleeding freely at the time of assessment.","There was no foreign body in the wound.","There was no bleeding or fluid leak from an ear and no new deafness.","There was no new continuous neck pain following the injury.","The individual was responding normally.","There was no apparent visual disturbance.","There was no new skull or facial deformity.","There had not been a fall of 1 metre or more.","There had not been a fall directly onto the head.","There was no bruising around the uninjured eye or ear.","An assault had not occurred.","The problem was not a needlestick injury.","There was no loss of consciousness at the time of the injury.","There was no previous history of brain surgery.","There had been no vomiting following the head injury.","The injury was not a complex wound.","There was no injury to the mouth, nose or ear.","There was no crackly feeling in the skin around the eye.","There was no new difficulty opening or closing the jaw.","There was no worsening pain or swelling.","The individual was using anticoagulant medication.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","A responsible adult should stay with anyone who has had a head injury to watch out for any problems.","Children tend to sleep after a head injury. This is fine as long as they are woken every hour for the first 6 hours after injury to check that they are all right.","Unless advised not to, or they have already been given, paracetamol can be used to relieve pain. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use any other painkillers, they can cause complications following a head injury.","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","However, if they cannot be woken up or they become dazed, groggy or have a fit - CALL 999.","If there are any problems understanding, speaking, balancing or walking - CALL 999.","If there is any loss of feeling in any part of the body, general weakness or new deafness - CALL 999.","If there is any vomiting, any change in vision, or a severe or worsening headache - GO STRAIGHT TO THE NEAREST EMERGENCY DEPARTMENT.","A decision about whether tetanus immunisation is needed can be made when the injury is checked.","Use a dry dressing or a clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth."}', '2023-02-27 13:47:10.515898+00', NULL);
