INSERT INTO pathwaysdos.scenarios VALUES (263, 11, 710, 1206, 172, 172, 4474, 1, 1, '{"Senior Clinician Module","Coronavirus concern.","The situation was not believed to be life threatening.","No one else was considered to be vulnerable and at risk","A clinical assessment service was considered appropriate.","Covid assessment service 2 hours was required","The individual needs to speak to a local service within 2 hours.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","You must self isolate. Stay indoors and avoid public places.","Try to avoid visitors to your home. Essential supplies can be dropped off.","Do not use public transport or taxis.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt CALL your local pharmacy.","If the condition gets worse or you have any other concerns while you are waiting, call us back. For further information about Coronavirus (COVID-19) go to nhs.uk."}', '2023-02-27 13:48:03.47649+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (265, 11, 705, 1234, 173, 173, 4474, 1, 1, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","It was not appropriate to speak to the patient.","Heavy bleeding had not occurred in the previous 2 hours.","Coronavirus concern.","Symptoms at the time of assessment.","The main reason for the contact was for assessment or advice about symptoms.","There was coronavirus contact.","There was no new or increased breathlessness.","The symptoms could not be managed at home.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Chest pain, stroke, new confusion or injury were not suspected.","The individual was so ill they had stopped doing all normal activities.","There were no new skin mark(s), like bruising or bleeding under the skin.","Inability to flex the neck or photophobia were not described.","The individual was responding normally.","There was increased breathlessness since the onset of the problem.","There was no new or worsening confusion.","The breathing had improved in the previous hour.","The individual needs to speak to a local service within 4 hours.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","You must self isolate. Stay indoors and avoid public places.","Try to avoid visitors to your home. Essential supplies can be dropped off.","Do not use public transport or taxis.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt CALL your local pharmacy.","If the condition gets worse or you have any other concerns while you are waiting, call us back. For further information about Coronavirus (COVID-19) go to nhs.uk."}', '2023-02-27 13:48:03.676546+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (266, 11, 714, 1206, 176, 176, 4474, 1, 1, '{"Senior Clinician Module","Coronavirus concern.","The situation was not believed to be life threatening.","No one else was considered to be vulnerable and at risk","A Covid Coordination service was considered appropriate.","Information on the location of a service was given.","I am going to give you the location of the service you require.","DOS call"}', '2023-02-27 13:48:03.736211+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (267, 11, 703, 1234, 171, 171, 4474, 1, 1, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","It was not appropriate to speak to the patient.","Heavy bleeding had not occurred in the previous 2 hours.","Coronavirus concern.","Symptoms at the time of assessment.","The main reason for the contact was for assessment or advice about symptoms.","There was coronavirus contact.","There was no new or increased breathlessness.","The symptoms could not be managed at home.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Chest pain, stroke, new confusion or injury were not suspected.","The individual was still able to carry out some normal activities.","There was increased breathlessness since the onset of the problem.","The breathing had worsened in the previous hour.","Breathing harder or faster when doing nothing was not described.","The individual needs to speak to a local service within 1 hour.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","You must self isolate. Stay indoors and avoid public places.","Try to avoid visitors to your home. Essential supplies can be dropped off.","Do not use public transport or taxis.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt CALL your local pharmacy.","If the condition gets worse or you have any other concerns while you are waiting, call us back. For further information about Coronavirus (COVID-19) go to nhs.uk."}', '2023-02-27 13:48:03.856083+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (268, 12, 718, 1234, 177, 177, 4474, 1, 1, '{"111 Call Handler","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1042, Cold or Flu Symptoms","There was no new or increased breathlessness.","There was a new continuous cough at the time of the assessment.","Breathing harder or faster when doing nothing was not described.","The individual was able to carry out most or all normal activities.","There was no sharp/stabbing pain in the chest/upper back on coughing or deep breathing.","There had been no episode of choking within the previous 24 hours.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","The individual had not coughed up blood.","There was no new or worsening confusion.","There was no known increased susceptibilty to infection.","The individual had not been advised by the NHS to isolate for 12 weeks.","There was no previous history of diabetes.","There was no extreme thirst or increased urine output during the previous month.","There was no fever at the time of assessment or within the previous 12 hours.","There had been a previous diagnosis of asthma or lung disease.","The individual needs to speak to a local service the next working day.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","During this pandemic these symptoms may be due to Coronavirus which is infectious. Avoid contact with others.","If you need to attend a healthcare appointment DO NOT use public transport and advise the healthcare service there may be a Coronavirus concern.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:48:27.336048+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (269, 12, 715, 1039, 172, 172, 4474, 1, 1, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","It was not appropriate to speak to the patient.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","Chest/upper back pain was the main reason for the assessment.","There was no previous diagnosis of a heart disease.","There was no pain at the time of the assessment.","There was pain in the previous 24 hours.","There had been no pain within the previous 12 hours.","There had been no previous diagnosis of aortic aneurysm or Marfan''s syndrome.","There had not been a previous diagnosis of a genetic disorder affecting major arteries.","The skin on the torso felt normal, warm or hot.","The pain had not come on suddenly.","Drug or solvent misuse had not occurred in the previous 24 hours.","There was no previous history of diabetes.","There had been no previous diagnosis of Kawasaki''s disease.","The pain was not brought on or worsened by shrugging the shoulders or turning the upper body.","The painful area was not sore to touch.","There had been no crushing or severe aching pain in the chest, upper back or upper abdomen or pain going to the neck, arm, jaw or shoulder in the last 24 hours.","There was no vomiting with the pain in the previous 24 hours.","The individual had not been clammy or sweaty with the pain in the previous 24 hours.","The individual was able to carry out most or all normal activities.","There was no sharp/stabbing pain in the chest/upper back on coughing or deep breathing.","There was no new or worsening breathlessness.","There was no abdominal pain.","There were no palpitations at the time of the assessment.","There was no new leg pain or swelling.","There was no new shoulder tip pain.","The arm had not suddenly become cold, pale or blue.","There was no sudden onset of pain and swelling of the entire arm.","The individual had not coughed up blood.","The individual did not have previously diagnosed angina.","There was new or worsening confusion.","The individual had a fever at the time of the assessment or has had one within the last two weeks.","The individual needs to speak to a local service within 2 hours.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","INSTRUCTIONS FOR CALL HANDLER: Refer to National COVID-19 Criteria for general information.","During this pandemic these symptoms may be due to Coronavirus which is infectious. Avoid contact with others.","If you need to attend a healthcare appointment DO NOT use public transport and advise the healthcare service there may be a Coronavirus concern.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:48:27.548452+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (271, 12, 717, 1234, 1, 18, 4052, 1, 1, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","It was not appropriate to speak to the patient.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1042, Cold or Flu Symptoms","There was increased breathlessness.","The individual was able to carry out most or all normal activities.","There had been no episode of choking within the previous 24 hours.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","The individual had coughed up blood.","Breathing harder or faster when doing nothing was not described.","There was no history of previous thrombosis.","There was no known increased risk of thrombosis.","There was no previous history of pneumothorax.","The individual had not experienced prolonged immobility in the previous 2 weeks.","The individual had not experienced an injury or surgery in the previous 12 weeks.","There was no history of cancer in the last year or regular use of steroids.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Sit upright.","Use prescribed inhalers, nebulisers or oxygen according to the instructions.","INSTRUCTIONS FOR CALL HANDLER: Refer to National COVID-19 Criteria for general information.","During this pandemic these symptoms may be due to Coronavirus which is infectious. Avoid contact with others.","If you need to attend a healthcare appointment DO NOT use public transport and advise the healthcare service there may be a Coronavirus concern.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:48:27.777976+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (272, 13, 719, 1235, 103, 77, 4003, 1, 1, '{"111 Clinician","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1854, Loss of Taste or Smell","There had been no head injury in the previous 7 days.","There were no cold or flu-like symptoms.","The individual was unwell.","There had been a previous assessment by a doctor for this episode.","There had been deterioration since the previous consultation.","If symptoms don''t improve, or go away and come back, get in touch with the GP practice for a non-urgent appointment.","The individual should register as a temporary resident with a GP practice if they are not already registered.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:48:49.594756+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (273, 13, 720, 1235, 8, 25, 4003, 1, 1, '{"111 Clinician","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1854, Loss of Taste or Smell","There had been no head injury in the previous 7 days.","There were no cold or flu-like symptoms.","The individual was unwell.","There had been no previous assessment by a doctor this episode.","There had been deterioration despite appropriate homecare measures.","The individual needs to contact the GP practice for a non-urgent appointment.","I will arrange for a clinician to contact the individual. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:48:49.677366+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (274, 13, 721, 1235, 105, 78, 4003, 1, 1, '{"111 Clinician","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1854, Loss of Taste or Smell","There had been no head injury in the previous 7 days.","There were no cold or flu-like symptoms.","The individual was otherwise well.","If symptoms don''t improve, or go away and come back, get in touch with the GP practice within 3 working days.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:48:49.757868+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (275, 13, 722, 1235, 116, 79, 4003, 1, 1, '{"111 Call Handler","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1854, Loss of Taste or Smell","There had been no head injury in the previous 7 days.","There were no cold or flu-like symptoms.","The individual was otherwise well.","Repeat Caller: The individual needs to speak to the GP practice within 1 hour. If the practice is not open within this period they need to speak to the out of hours service.","Because you have called several times, I am going to arrange for a clinician to call you back.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:48:49.848364+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (276, 14, 728, 1143, 39, 55, 4512, 1, 1, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","It was not appropriate to speak to the patient.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW846, Rectal Bleeding","There was no abdominal pain.","The individual had not passed a black, tarry bowel motion.","The rectal bleeding was not constant.","The individual had not passed red blood in a bowel motion.","There were no splashes of blood in the toilet after defaecation.","There were no streaks of blood on the toilet paper after defaecation.","A sexual assault had not occurred.","There was no retained rectal foreign body.","There was no new spontaneous bruising or abnormal bleeding within the previous 2 weeks.","There was no new painful anal or perianal lump.","There was no anal/rectal pain on defaecation.","There had not been an assessment of the problem within the previous 6 months.","DOS call","The individual MUST contact a local service within 3 working days.","Before you go, I will just check whether I need to give you any further instructions or advice.","Drink plenty of fluids.","Have at least 5 portions of fruit and vegetables every day.","Speak to a pharmacist for advice for suitable treatments.","It''s not always serious, but should be checked.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:49:06.736756+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (277, 14, 729, 1144, 39, 55, 4512, 1, 1, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","It was not appropriate to speak to the patient.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1091, Rectal Pain, Swelling, Lump or Itch","There was no large piece of tissue prolapsing from the rectum.","A sexual assault had not occurred.","There was no retained rectal foreign body.","The individual had no anal/rectal pain.","There was no new lump, swelling or open sore inside or near the anus.","There was a change in bowel habit for more than 6 weeks.","DOS call","The individual MUST contact a local service within 3 working days.","Before you go, I will just check whether I need to give you any further instructions or advice.","Speak to a pharmacist for advice on suitable treatments.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:49:06.836349+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (278, 14, 723, 1038, 1, 18, 4513, 4, 1, '{"111 Call Handler","Birth had not occurred within the last hour.","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW925, Burn, Thermal","The individual did not have a major burn.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","The burn involved an eye or eyelid.","Before doing anything else wash the eye under cold running water for at least 20 minutes.","Make sure that the water drains away from the face.","If another body area has been burned also try and cool it under cold running water at the same time.","Don''t use ice or very cold water. DON''T LET THEM GET COLD.","Close the eye, cover it with a soft pad or dressing and fasten it gently with some tape.","Gently remove any jewellery or tight clothing from the area of the burn, but don''t try to remove any clothing that is stuck to it.","The individual needs to attend a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Before doing anything else, cool the burn with cold (preferably running) water for at least 20 but no more than 30 minutes.","Loosely cover the burn with clingfilm or a clean plastic bag.","A decision about whether tetanus immunisation is needed can be made when the injury is checked.","Before doing anything else, cool the burn with cold (preferably running) water for at least 20 but no more than 30 minutes.","Close the eye, cover it with a soft pad or dressing and fasten it gently with some tape.","Don''t rub the eye.","OVER 12 WEEKS OLD: Unless advised not to take, paracetamol OR ibuprofen can be used to relieve pain or fever. Don''t give both together.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:49:06.976533+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (279, 14, 730, 1156, 39, 55, 4512, 1, 1, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","It was not appropriate to speak to the patient.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW854, Sore Throat or Hoarse Voice","The problem involved a sore throat and a hoarse voice.","There was no new or worsening breathlessness.","The individual was able to carry out most or all normal activities.","There was no history of recent general anaesthetic or tonsillectomy.","There was no new or worsening confusion.","There was no fever at the time of assessment or within the previous 12 hours.","There was no difficulty opening the mouth or speaking as if the mouth was full.","There was no known increased susceptibilty to infection.","There were no blisters involving only one side of the throat or palate.","The duration of the sore throat was less than a week.","There had been a loss of appetite over the previous 4 weeks.","DOS call","The individual MUST contact a local service within 3 working days.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol OR ibuprofen can be used to relieve pain or fever.","Follow the instructions in the pack. If in doubt ask a pharmacist.","Warm or cold drinks, ice lollies and ice cream can all help to soothe a sore throat.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:49:07.107982+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (280, 14, 724, 1045, 39, 55, 4512, 1, 1, '{"111 Clinician","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","It was not appropriate to speak to the patient.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1159, Constipation","The individual had not vomited.","There was no rectal bleeding.","There was no new loss of bladder control or leg movement and no saddle or lower limb paraesthesia.","There was no large piece of tissue prolapsing from the rectum.","There was no new or worsening confusion.","There was no severe abdominal pain or absolute constipation.","The individual had no anal/rectal pain.","There was no new lump, swelling or open sore inside or near the anus.","There was no fever at the time of assessment or within the previous 12 hours.","There was no leakage of liquid faeces or absence of bowel movements for at least 5 days.","There was no reduction in fluid intake over the previous few days.","There was no sensation of anal/rectal lump in association with passing a stool.","The individual had felt generally unwell over the previous 4 weeks.","Medication type or dosage had not changed within the previous 2 weeks.","The individual MUST contact a local service within 3 working days.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Drink plenty of fluids.","Have at least 5 portions of fruit and vegetables every day.","Speak to a pharmacist for advice for suitable treatments.","Drink frequent, small amounts of water.","Eat small, frequent meals that are high in carbohydrate and low in fat, e.g. bread, rice and pasta.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:49:07.233637+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (281, 14, 725, 1047, 39, 55, 4512, 1, 1, '{"111 Call Handler","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW976, Cough","There was no new or worsening breathlessness.","The individual was able to carry out most or all normal activities.","There was no sharp/stabbing pain in the chest/upper back on coughing or deep breathing.","There had been no episode of choking within the previous 24 hours.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","The individual had not coughed up blood.","There was no fever at the time of assessment or within the previous 12 hours.","There was no new or worsening confusion.","The individual was producing green or yellow sputum.","There had been no previous diagnosis of heart disease, asthma or lung disease.","The individual had no previous medical advice that antibiotic therapy should be sought for the condition.","There were not frequent, severe coughing episodes.","There had been unexplained weight loss over the previous 4 weeks.","DOS call","The individual MUST contact a local service within 3 working days.","Before you go, I will just check whether I need to give you any further instructions or advice.","Drinking lemon juice and honey mixed into warm water can be soothing.","Speak to a pharmacist for advice on suitable treatments.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:49:07.355749+00', NULL);
