INSERT INTO pathwaysdos.scenarios VALUES (284, 14, 726, 1054, 39, 55, 4512, 1, 1, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","It was not appropriate to speak to the patient.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW631, Diarrhoea","There was no vomiting.","There was abdominal pain with the diarrhoea.","The pain did not interfere with normal activity.","The individual was able to carry out most or all normal activities.","The individual had not ingested a harmful or toxic substance.","There had been no black and tarry or red/maroon bowel motions.","There was no new or worsening confusion.","Breathing harder or faster when doing nothing was not described.","There was no fever at the time of assessment or within the previous 12 hours.","There was no new shoulder tip pain or pain in the lower right abdomen.","The individual had not been in constant pain for 4 hours or more.","There had not been watery diarrhoea more than once an hour for 12 hours or more.","The individual was not jaundiced.","The individual had not travelled abroad in the previous 4 weeks.","There was no blood in the bowel motions.","Medication type or dosage had not changed within the previous 2 weeks.","The duration of the diarrhoea could not be confirmed.","The individual did not feel generally unwell in the week prior to the onset of more specific symptoms.","There were no occupational or public health issues related to the diarrhoea/vomiting.","The individual had experienced bleeding or another bowel problem in the last 6 weeks.","DOS call","The individual MUST contact a local service within 3 working days.","Before you go, I will just check whether I need to give you any further instructions or advice.","Drink frequent, small amounts of water.","Eat as normally as possible.","Speak to a pharmacist for advice on suitable treatments.","Wash hands after using the toilet.","Stay off work until the symptoms have gone.","Feeling faint, about to pass out or collapse - CALL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - CALL 999.","Unless advised not to, paracetamol may be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use ibuprofen or any other anti-inflammatory medication until you have spoken to a healthcare professional.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:49:07.75632+00', NULL);
