INSERT INTO pathwaysdos.scenarios VALUES (317, 19, 773, 1092, 1, 18, 4570, 1, 1, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1034, Object, Ingested or Inhaled","The ingested/inhaled object was not able to be identified.","There was no new or worsening breathlessness.","The individual had not vomited/coughed up blood.","Back blows, the Heimlich manoeuvre or chest or abdominal thrusts were not used during the recovery.","There was no new chest, back or abdominal pain.","The individual had not ingested a batter and or a magnet.","The individual had ingested a large object.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Don''t try to remove anything that feels like it''s stuck.","Don''t deliberately try to be sick.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:50:41.510336+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (318, 19, 774, 1228, 1, 18, 4570, 1, 1, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1543, Self-Harm","There had been ingestion/inhalation of a potentially harmful substance or object.","The nature of the suspected substance was identifiable.","The individual had experienced no suicidal thoughts or made plans to commit suicide.","There was no new or worsening breathlessness.","There had been no loss of consciousness.","There was no blood in vomit or bowel motions or produced by coughing","There was no severe throat, chest, back or abdominal pain.","The individual was not experiencing palpitations.","There was no new or worsening confusion.","There was no excessive sweating/salivation or repeated vomiting following a possible toxic exposure.","The individual was not taking medication.","The individual had no past or current serious medical problems.","The individual''s approximate weight could not be confirmed.","Toxbase was consulted to determine the appropriate outcome.","The recommended response was not an emergency ambulance or Treatment Centre referral.","The individual had ingested a magnet.","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Don''t try to remove anything that feels like it''s stuck.","Don''t deliberately try to be sick.","Don''t deliberately try to be sick.","Don''t try to neutralise the substance with anything else (e.g. vinegar, bicarbonate of soda), except on medical advice.","Take the container, any label, and any leftover pills or substances to the hospital.","Anyone who takes an overdose or poison on purpose needs medical attention, even if they don''t appear to have suffered any ill-effects.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:50:41.654315+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (319, 20, 779, 1034, 1, 18, 4490, 4, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1717, Breathing Problems, Breathlessness or Wheeze","There was no fever at the time of assessment or within the previous 12 hours.","There were no signs of chest or abdominal recession.","There was no rapid swelling of the lips, face, tongue, mouth or throat.","The individual was behaving normally.","The individual was responding normally.","There had not been episode(s) of cessation of breathing for more than 20 seconds that day.","There were no grunting sounds when breathing.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","The individual had no redcurrant-jelly stools or red bowel motions.","There had been no travel to the Middle East in the past 2 weeks.","There had been no episode of choking within the previous 24 hours.","There was no vomiting.","There was no bruising.","There was a new or worsening lump or swelling.","There was a new lump or swelling on the head, face or neck.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Hold the baby in a comfortable position.","Use prescribed inhalers, nebulisers or oxygen according to the instructions.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:51:02.374453+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (584, 33, 491, 1129, 2, 19, 4052, 1, 1, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW1323, Mouth Ulcers","Referral to Emergency Treatment Centre required.","Attendance at an Emergency Treatment Centre within 4 hours was considered appropriate.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:34.237828+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (320, 20, 777, 1172, 9, 26, 4405, 4, 1, '{"Birth had not occurred within the last hour.","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1805, Unwell Infant","The baby was less than 29 days old","There was no fever at the time of assessment or within the previous 12 hours.","There were breathing problems.","There were no signs of chest or abdominal recession.","There was no rapid swelling of the lips, face, tongue, mouth or throat.","The individual was behaving normally.","The individual was responding normally.","There had not been episode(s) of cessation of breathing for more than 20 seconds that day.","There were no grunting sounds when breathing.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","The individual had no redcurrant-jelly stools or red bowel motions.","There had been no travel to the Middle East in the past 2 weeks.","There was no bruising.","There was no new or worsening lump or swelling.","There had been no episode of choking within the previous 24 hours.","There was no vomiting.","The baby was jaundiced.","The baby was under 10 days old.","DOS call","The individual needs to speak to a local service within 1 hour.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","Continue to feed your baby as normal.","Jaundice is common in newborn babies. It is not always serious but should be checked .","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:51:02.716867+00', NULL);
