INSERT INTO pathwaysdos.scenarios VALUES (323, 20, 817, 1195, 2, 19, 4052, 4, 1, '{"An injury or health problem was the reason for the contact.","The individual was choking at the time of the assessment.","The infant was choking on a liquid.","The individual was coughing noisily or able to cry and breathe.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","There was no fever at the time of assessment or within the previous 12 hours.","There were no breathing problems.","The individual was behaving normally.","The individual was responding normally.","The individual had no redcurrant-jelly stools or red bowel motions.","There was no vomiting.","There was no testicular/scrotal pain, lump or swelling.","There was no bruising.","There was no new or worsening lump or swelling.","There had been no ingestion of a potentially harmful substance or object.","Back blows had been performed.","DOS call","The individual needs to be referred to a treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Keep the baby in a position where they can cough, cry or breathe.","Clear any vomit away from their face in case they inhale it.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:51:03.15229+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (324, 20, 785, 1045, 1, 18, 4489, 4, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1718, Constipation","The child was unwell.","There was no fever at the time of assessment or within the previous 12 hours.","There were no breathing problems.","The individual was behaving normally.","The individual was responding normally.","The individual had no redcurrant-jelly stools or red bowel motions.","There was no vomiting.","There was no testicular/scrotal pain, lump or swelling.","There was bruising.","The baby was not mobile.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:51:03.27661+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (325, 20, 782, 1045, 130, 103, 4403, 4, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1718, Constipation","The child was unwell.","There was a fever at the time of assessment or within the previous 12 hours.","There were no breathing problems.","The individual was behaving normally.","The individual was responding normally.","The individual had no redcurrant-jelly stools or red bowel motions.","There was no vomiting.","There was no bruising.","There was no new or worsening lump or swelling.","There had been travel within the last 4 weeks from a country affected by the current Ebola outbreak.","Private transport to hospital was available.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual, which must only be a member of the household.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","I will inform the Emergency Department that the individual will be attending.","When seen or spoken to by a health care professional make sure they are told about the recent travel to West Africa or contact with Ebola. This is very important.","Before you go, I will just check whether I need to give you any further instructions or advice.","Give them plenty to drink. If breastfeeding, continue to do so.","Dress them in light clothes e.g. a T-shirt and nappy, don''t try to cool down by cold sponging or fanning.","Check on them at least every 2-4 hours including overnight.","Becoming limp, floppy, unresponsive or having a fit - CALL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - CALL 999.","OVER 12 WEEKS OLD: Unless advised not to take, paracetamol OR ibuprofen can be used to relieve pain or fever. Don''t give both together.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:51:03.437559+00', NULL);
