INSERT INTO pathwaysdos.scenarios VALUES (341, 20, 829, 1213, 131, 104, 4402, 4, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1775, Hiccups","Other symptoms were present, as well as hiccups.","There was no fever at the time of assessment or within the previous 12 hours.","There were no breathing problems.","The individual was behaving normally.","The individual was responding normally.","The individual had no redcurrant-jelly stools or red bowel motions.","There was no vomiting.","There was no testicular/scrotal pain, lump or swelling.","There was no bruising.","There was no new or worsening lump or swelling.","There had been no ingestion of a potentially harmful substance or object.","There had been no episode of choking within the previous 24 hours.","There had been no travel within the last 4 weeks from a country affected by the current Ebola outbreak.","Exposure to Ebola virus disease in the last 4 weeks was declared.","DOS call","The individual needs to speak to a local service within 1 hour.","I will arrange for a clinician to speak to the individual.","When seen or spoken to by a health care professional make sure they are told about the recent travel to West Africa or contact with Ebola. This is very important.","Before you go, I will just check whether I need to give you any further instructions or advice.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:51:05.83394+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (342, 20, 816, 1195, 1, 18, 4052, 4, 1, '{"An injury or health problem was the reason for the contact.","The individual was choking at the time of the assessment.","The infant was choking on a liquid.","The individual was coughing noisily or able to cry and breathe.","Whether the individual was fighting for breath could not be confirmed.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt cool or cold.","The child was not a deathly colour.","There was a fever at the time of assessment or within the previous 12 hours.","There were breathing problems.","There were no signs of chest or abdominal recession.","There was no rapid swelling of the lips, face, tongue, mouth or throat.","The individual was so ill they had stopped behaving normally.","There were no new skin mark(s), like bruising or bleeding under the skin.","The individual was responding normally.","There had not been episode(s) of cessation of breathing for more than 20 seconds that day.","There were no grunting sounds when breathing.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","The individual had redcurrant-jelly stools.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Keep the baby in a position where they can cough, cry or breathe.","Clear any vomit away from their face in case they inhale it.","Give them plenty to drink. If breastfeeding, continue to do so.","Dress them in light clothes e.g. a T-shirt and nappy, don''t try to cool down by cold sponging or fanning.","Check on them at least every 2-4 hours including overnight.","Becoming limp, floppy, unresponsive or having a fit - CALL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - CALL 999.","OVER 12 WEEKS OLD: Unless advised not to take, paracetamol OR ibuprofen can be used to relieve pain or fever. Don''t give both together.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:51:06.00704+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (549, 33, 476, 1033, 2, 19, 4052, 1, 2, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW1114, Breastfeeding Problems","Referral to Emergency Treatment Centre required.","Attendance at an Emergency Treatment Centre within 4 hours was considered appropriate.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","DOS call","Carry on breastfeeding on both breasts, even if they are uncomfortable, until the problem has been more fully assessed.","It will not harm the baby and will prevent the breasts becoming swollen.","Apply a warm flannel to both breast before feeding as this may help the milk to flow.","Change breast pads at each feed.","Wear a good fitting cotton bra.","Don''t use soap, as it dries the skin.","Apply a thin layer of white soft paraffin or purified lanolin to the cracked area and not the whole nipple.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:32.176433+00', NULL);
