INSERT INTO pathwaysdos.scenarios VALUES (348, 20, 791, 1047, 1, 18, 4489, 4, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1705, Cough","The individual had not coughed or vomited blood.","There were breathing problems.","There was no fever at the time of assessment or within the previous 12 hours.","There were no signs of chest or abdominal recession.","There was no rapid swelling of the lips, face, tongue, mouth or throat.","The individual was behaving normally.","The individual was responding normally.","There had not been episode(s) of cessation of breathing for more than 20 seconds that day.","There were no grunting sounds when breathing.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","The individual had no redcurrant-jelly stools or red bowel motions.","There had been no travel to the Middle East in the past 2 weeks.","There had been no episode of choking within the previous 24 hours.","There was no vomiting.","There was bruising.","The baby was not mobile.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Speak to a pharmacist for advice on suitable treatments."