INSERT INTO pathwaysdos.scenarios VALUES (410, 24, 859, 1206, 181, 181, 4526, 2, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","The clinician had decided to override the ambulance disposition","The clinician decided to override the ambulance disposition as the patient could be safely transported by other means to a hospital or other treatment provider.","Treatment centre attendance or a referral to an SDEC service was considered appropriate.","A referral for Emergency Ambulatory Care (SDEC) was required.","Refer to Paediatric SDEC.","The individual needs to be referred to Emergency Ambulatory Care (SDEC) within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:52:37.236467+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (411, 24, 871, 1120, 1, 18, 4009, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1234, Leg Injury, Penetrating","The wound was not bleeding freely at the time of assessment.","There was no bone protruding through the skin.","The individual was able to weight-bear at the time of assessment.","There was no new limb deformity or swelling.","There had been complete amputation of a toe.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Take the body part to the hospital as it may be possible to reattach it.","Don''t wash or disinfect the body part, even if it looks very dirty.","Wrap the part loosely in clingfilm or a plastic bag. Then loosely wrap it in a cloth and put it in a container with ice or frozen peas.","Don''t let it come into direct contact with the ice. Don''t put it in a freezer.","The individual should not eat or drink anything before going to hospital (a sip of water is fine if medication needs to be taken).","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Use a dry dressing or a clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","IN LIMBS: If possible raise the injured area and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","Use pillows or a sling to keep the injured area raised.","If the bleeding cannot be controlled or is getting worse - CALL 999.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","IN LIMBS: If possible raise the injured area using pillows or a sling.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-02-27 13:52:37.377648+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (362, 20, 839, 1225, 9, 26, 4460, 4, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1774, Skin Problems","The main problem was head lice.","There was no fever at the time of assessment or within the previous 12 hours.","There were no breathing problems.","The individual was so ill they had stopped behaving normally.","There were no new skin mark(s), like bruising or bleeding under the skin.","The individual was responding normally.","The individual had no redcurrant-jelly stools or red bowel motions.","There was no vomiting.","There was no testicular/scrotal pain, lump or swelling.","There was no bruising.","There was no new or worsening lump or swelling.","There had been no ingestion of a potentially harmful substance or object.","There had been no episode of choking within the previous 24 hours.","Cold feet were described.","DOS call","The individual needs to speak to a local service within 1 hour.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:51:09.196533+00', NULL);
