INSERT INTO pathwaysdos.scenarios VALUES (457, 30, 764, 1177, 117, 90, 4010, 1, 2, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","It was not appropriate to speak to the patient.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1559, Vaginal Itch or Soreness","There was no new vaginal discharge.","A sexual assault had occurred.","DOS call","The individual needs to be referred to a treatment centre within 1 hour for Sexual Assault Assessment.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Don''t wash or change clothes until seen by a health care professional to avoid destroying important evidence.","When seen by the health care professional, inform them an assault has taken place.","Before you go, I will just check whether I need to give you any further instructions or advice.","Any cuts can be covered with a dry dressing. Dirt or anything else should not be cleaned out of the wound as this may be important evidence.","Don''t wash or change clothes until seen by a health care professional to avoid destroying important evidence.","When seen by the health care professional, inform them an assault has taken place.","If the situation appears to endanger anyone - CALL 999 FOR THE POLICE.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:34.067709+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (382, 20, 824, 1202, 1, 18, 4489, 4, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1766, Leg, Cold or Colour Change","There was new leg pain or swelling.","There was no fever at the time of assessment or within the previous 12 hours.","There were no breathing problems.","The individual was behaving normally.","The individual was responding normally.","The individual had no redcurrant-jelly stools or red bowel motions.","There was no vomiting.","There was no testicular/scrotal pain, lump or swelling.","There was bruising.","The baby was not mobile.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:51:12.296696+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (383, 20, 795, 1055, 1, 18, 4489, 4, 1, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1708, Diarrhoea and Vomiting","The individual had not coughed or vomited blood.","Whether the child was otherwise well could not be confirmed.","There was a fever at the time of assessment or within the previous 12 hours.","The individual was behaving normally.","The individual was responding normally.","The individual had no redcurrant-jelly stools or red bowel motions.","There was no vomiting.","There was bruising.","The baby was not mobile.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Continue to feed your baby as normal.","OVER 12 WEEKS: give bottle-fed babies frequent, small amounts of freshly boiled and cooled water to prevent dehydration.","Wash hands after changing nappies or dealing with vomit.","Give them plenty to drink. If breastfeeding, continue to do so.","Dress them in light clothes e.g. a T-shirt and nappy, don''t try to cool down by cold sponging or fanning.","Check on them at least every 2-4 hours including overnight.","Becoming limp, floppy, unresponsive or having a fit - CALL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - CALL 999.","OVER 12 WEEKS OLD: Unless advised not to take, paracetamol OR ibuprofen can be used to relieve pain or fever. Don''t give both together.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:51:12.456682+00', NULL);
