her instructions or advice.","Speak to a pharmacist for advice on suitable treatments.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:51:12.611482+00', NULL);
