INSERT INTO pathwaysdos.scenarios VALUES (552, 33, 503, 1177, 2, 19, 4052, 1, 2, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW1559, Vaginal Itch or Soreness","Referral to Emergency Treatment Centre required.","Attendance at an Emergency Treatment Centre within 4 hours was considered appropriate.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","DOS call","Wash the area daily with plain warm water and mild soap. Dry well. Washing too often can make things worse.","Don''t use perfumed products like soaps, bubble baths, gels or deodorants.","Loose-fitting cotton clothes and underwear are best, as they allow air to circulate.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:32.35936+00', NULL);
