 should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Sit upright.","Use prescribed inhalers, nebulisers or oxygen according to the instructions.","Drinking caffeine or alcohol, or smoking and taking decongestants can all make the problem worse.","Breathlessness or pain in the chest that is getting worse - CALL 999","Pain in the upper abdomen or upper back - CALL 999","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:52:00.273382+00', NULL);
