INSERT INTO pathwaysdos.scenarios VALUES (474, 31, 205, 1066, 2, 19, 4094, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had occurred.","A gunshot or stabbing injury or a rollover or ejection from a vehicle had not occurred.","The injury did not involve a fall of 5 metres or more, a major burn, massive blunt injury, a major wound or amputation or a suicide attempt.","The injury involved an electric shock.","The electric shock was from a domestic supply.","The individual was not in contact with the source of the shock.","The individual was not breathless, over 65, nor experienced fitting, loss of consciousness, palpitations or chest pain since the electric shock.","The individual had not fallen 5 metres or more, nor been knocked over, burned or had severe pains in the bones or muscles as a result of the electric shock.","The problem did not result from a suicide attempt.","There was no history of an implanted electronic device or previously diagnosed heart problem.","A sexual or serious non-sexual assault had not occurred.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Fitting, loss of consciousness, any breathlessness, palpitations or any chest pain - DIAL 999.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:50.477562+00', NULL);
