INSERT INTO pathwaysdos.scenarios VALUES (395, 23, 854, 1175, 1, 18, 4581, 1, 2, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW910, Vaginal Bleeding","Pregnancy or possible pregnancy was reported.","The individual was less than 20 weeks pregnant.","There was no abdominal pain.","There was vaginal bleeding.","There was heavy vaginal bleeding.","The individual was not feeling faint or dizzy.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Don''t use tampons or a menstrual cup. Use pads instead.","Keep a check of how many pads are used to determine the amount of bleeding.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:52:17.478537+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (396, 23, 852, 1121, 129, 102, 4454, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1712, Locked Jaw","There was acute locking of the jaw.","Tooth extraction had occurred within the previous seven days.","DOS call","The individual needs to be referred to a dental treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Don''t try to poke anything into the hole.","Fold a piece of clean, damp gauze or cotton cloth (e.g. a handkerchief) into a pad and put it directly across the space where the tooth was.","Bite down firmly onto the pad for at least 15 minutes or until the bleeding stops. Don''t spit blood out. Repeat if the bleeding starts again.","Don''t rinse the mouth out, this may disturb the blood clot.","For the next 24 hours: don''t have hot drinks or alcohol; don''t exercise vigorously; don''t chew on the affected area.","If it starts to bleed again apply pressure by biting onto a pad (described above).","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:52:17.578107+00', NULL);
