r upper back - CALL 999","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:52:17.696598+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (429, 26, 884, 1010, 1, 18, 4716, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","Probable allergic reaction or anaphylaxis was the main reason for the assessment.","The skin on the torso felt normal, warm or hot.","There was no new or worsening swelling of the face, tongue or throat.","There was no new or worsening breathing problems or wheeze.","The individual was feeling faint.","The individual was able to carry out most or all normal activities.","An adrenaline injection had not previously been prescribed.","The individual had a previous allergic reaction that required emergency hospital care.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","If you think the problem is due to new or changed medication, speak to a doctor, nurse or pharmacist before taking any more.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","If symptoms worsen, stop the vehicle in a safe place and call 999."}', '2023-02-27 13:53:19.326121+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (398, 23, 851, 1085, 2, 19, 4127, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1270, Finger or Thumb Injury, Blunt","There was no injury to any other part of the hand.","The individual was able to get up from the floor.","An assault had not occurred.","The individual had no difficulty with a ring that could not be removed.","The injury occurred within the last 3 days.","Movement of the affected digit was normal.","The individual had not lost all/part of a nail.","There was a purple or black area under the nail.","The injury was extremely painful at the time of the assessment.","DOS call","The individual needs to be referred to a treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If helping someone else: try to keep their blood off your skin.","If the nail is not completely torn off, don''t move it.","Don''t wash or disinfect the area, even if it looks very dirty.","Wrap the area very loosely in something soft and non-fluffy, and fasten it with sticky tape.","If possible, elevate the injured area with pillows or a sling."}', '2023-02-27 13:52:17.816828+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (399, 24, 861, 1206, 2, 19, 4528, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","The clinician had decided to override the ambulance disposition","The clinician decided to override the ambulance disposition as the patient could be safely transported by other means to a hospital or other treatment provider.","Treatment centre attendance or a referral to an SDEC service was considered appropriate.","A referral to a Treatment Centre within 4 hours for an injury was required.","The individual needs to be referred to a treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:52:35.696861+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (400, 24, 860, 1206, 2, 19, 4527, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","The clinician had decided to override the ambulance disposition","The clinician decided to override the ambulance disposition as the patient could be safely transported by other means to a hospital or other treatment provider.","Treatment centre attendance or a referral to an SDEC service was considered appropriate.","A referral to a Treatment Centre within 4 hours for an illness was required.","The individual needs to be referred to a treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:52:35.776358+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (401, 24, 862, 1012, 1, 18, 4304, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1518, Ankle or Foot Injury, Penetrating","The wound was not bleeding freely at the time of assessment.","There was no bone protruding through the skin.","The individual was unable to weight-bear at the time of assessment.","The individual was able to get up from the floor.","There was new swelling around the injured area.","The foot had not become cold, pale, blue or grey.","There was no foreign body in the wound.","Avoid using the injured limb. Try to keep it supported.","Do not try to straighten anything that looks out of shape.","If there is an object stuck in the wound don''t try to remove it and don''t press on the object itself. Cover the wound with a clean cloth.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Use a dry dressing or a clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","IN LIMBS: If possible raise the injured area and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","Use pillows or a sling to keep the injured area raised.","If the bleeding cannot be controlled or is getting worse - CALL 999.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","IN LIMBS: If possible raise the injured area using pillows or a sling.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-02-27 13:52:35.927511+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (402, 24, 863, 1012, 1, 18, 4692, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1518, Ankle or Foot Injury, Penetrating","The wound was not bleeding freely at the time of assessment.","There was no bone protruding through the skin.","The individual was able to weight-bear at the time of assessment.","There was no new limb deformity or swelling.","There had been no amputation of a toe or part of a toe.","There was no foreign body in the wound.","An assault had not occurred.","The problem was a needlestick injury.","Squeeze the wound to make it bleed.","Don''t suck the wound.","Wash the wound thoroughly with soap under plenty of running water.","Don''t scrub the wound. Don''t use antiseptic solutions or skin washes.","Dry with a disposable towel or paper.","Cover the skin wound with a waterproof dressing or plaster, if available.","If the skin, eyes or mouth have been splashed with contents of a hypodermic syringe, wash thoroughly with plenty of water.","All needlestick injuries need to be checked to see if further treatment is needed.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Use a dry dressing or a clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","IN LIMBS: If possible raise the injured area and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","Use pillows or a sling to keep the injured area raised.","If the bleeding cannot be controlled or is getting worse - CALL 999.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","IN LIMBS: If possible raise the injured area using pillows or a sling.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-02-27 13:52:36.089084+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (403, 24, 873, 1165, 2, 19, 4127, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1526, Toe Injury, Penetrating","No other part of the foot was injured.","The individual was able to get up from the floor.","There had been no amputation of a toe or part of a toe.","The wound was not bleeding freely at the time of assessment.","There was no foreign body in the wound.","An assault had not occurred.","The individual had no difficulty with a ring that could not be removed.","The wound was not large or deep at the time of assessment.","The individual was able to weight-bear at the time of assessment.","The injury occurred within the last 3 days.","There was no new deformity.","The individual had not lost all/part of a nail.","There was a purple or black area under the nail.","The injury was extremely painful at the time of the assessment.","DOS call","The individual needs to be referred to a treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If helping someone else: try to keep their blood off your skin.","If the nail is not completely torn off, don''t move it.","Wrap the area very loosely in something soft and non-fluffy, and fasten it with sticky tape.","If possible, elevate the injured area with pillows or a sling.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Use a dry dressing or a clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","IN LIMBS: If possible raise the injured area and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","Use pillows or a sling to keep the injured area raised.","If the bleeding cannot be controlled or is getting worse - CALL 999.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","IN LIMBS: If possible raise the injured area using pillows or a sling.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-02-27 13:52:36.255727+00', NULL);
