INSERT INTO pathwaysdos.scenarios VALUES (414, 24, 855, 1206, 1, 18, 4134, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","The clinician had decided to override the ambulance disposition","The clinician decided to override the ambulance disposition as the patient could be safely transported by other means to a hospital or other treatment provider.","Treatment centre attendance or a referral to an SDEC service was considered appropriate.","Referral to an eye casualty was required.","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:52:37.769162+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (415, 24, 869, 1108, 1, 18, 4500, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1260, Hand or Wrist Injury, Penetrating","The individual had no associated arm injury.","The wound was not bleeding freely at the time of assessment.","There was no bone protruding through the skin.","The individual was able to get up from the floor.","There was new limb deformity.","The hand had not become cold, pale, blue or grey.","Avoid using the injured limb. Try to keep it supported.","Do not try to straighten anything that looks out of shape.","If there is an object stuck in the wound don''t try to remove it and don''t press on the object itself. Cover the wound with a clean cloth.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Use a dry dressing or a clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","IN LIMBS: If possible raise the injured area and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","Use pillows or a sling to keep the injured area raised.","If the bleeding cannot be controlled or is getting worse - CALL 999.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","IN LIMBS: If possible raise the injured area using pillows or a sling.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-02-27 13:52:37.913516+00', NULL);
