have been splashed with contents of a hypodermic syringe, wash thoroughly with plenty of water.","All needlestick injuries need to be checked to see if further treatment is needed.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","IN PREGNANCY: Don''t take ibuprofen, except on the advice of a healthcare professional. Use paracetamol instead.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-02-27 13:53:01.208683+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (425, 25, 879, 1111, 1, 18, 4692, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW692, Head, Facial or Neck Injury, Penetrating","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","There was no new/worsening breathlessness since the injury.","The individual had not experienced a seizure before, during or after the injury.","The wound was not bleeding freely at the time of assessment.","There was no foreign body in the wound.","There was no new confusion or agitation or new difficulty speaking, reading or writing.","There was no new limb weakness, coordination problems or sensory change or loss.","There was no bleeding or fluid leak from an ear and no new deafness.","The individual was responding normally.","There was no new continuous neck pain following the injury.","There was no new visual disturbance.","There was no new skull or facial deformity.","The injury was not caused by falling onto the head from something moving or hitting the head when diving.","There had not been a fall from a height of 1 metre or more.","There was no bruising around the uninjured eye or ear.","The individual was able to get up from the floor.","An assault had not occurred.","The problem was a needlestick injury.","Squeeze the wound to make it bleed.","Don''t suck the wound.","Wash the wound thoroughly with soap under plenty of running water.","Don''t scrub the wound. Don''t use antiseptic solutions or skin washes.","Dry with a disposable towel or paper.","Cover the skin wound with a waterproof dressing or plaster, if available.","If the skin, eyes or mouth have been splashed with contents of a hypodermic syringe, wash thoroughly with plenty of water.","All needlestick injuries need to be checked to see if further treatment is needed.","There was somebody available to offer safe transport to hospital.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","A responsible adult should stay with anyone who has had a head injury to watch out for any problems.","Unless advised not to, or they have already been given, paracetamol can be used to relieve pain. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use any other painkillers, they can cause complications following a head injury.","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","However, if they cannot be woken up or they become dazed, groggy or have a fit - CALL 999.","If there are any problems understanding, speaking, balancing or walking - CALL 999.","If there is any loss of feeling in any part of the body, general weakness or new deafness - CALL 999.","A decision about whether tetanus immunisation is needed can be made when the injury is checked.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth."}', '2023-02-27 13:53:01.388943+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (426, 25, 878, 1100, 1, 18, 4692, 1, 2, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1010, Genital Injury, Penetrating","Pregnancy or possible pregnancy was reported.","The individual had been pregnant for 20 weeks or more.","There was no severe, constant abdominal pain.","There was no significant vaginal bleeding.","There was no cord prolapse, visible presenting part, passage of meconium, urge to push or contractions less than 5 minutes apart.","There had been no increased frequency of contractions or waters breaking following the injury.","The wound was not bleeding freely at the time of assessment.","There was no foreign body in the wound.","The individual was able to weight-bear at the time of assessment.","An assault had not occurred.","The problem was a needlestick injury.","Squeeze the wound to make it bleed.","Don''t suck the wound.","Wash the wound thoroughly with soap under plenty of running water.","Don''t scrub the wound. Don''t use antiseptic solutions or skin washes.","Dry with a disposable towel or paper.","Cover the skin wound with a waterproof dressing or plaster, if available.","If the skin, eyes or mouth have been splashed with contents of a hypodermic syringe, wash thoroughly with plenty of water.","All needlestick injuries need to be checked to see if further treatment is needed.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","IN PREGNANCY: Don''t take ibuprofen, except on the advice of a healthcare professional. Use paracetamol instead.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-02-27 13:53:01.537443+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (427, 26, 883, 1010, 1, 18, 4715, 2, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","Probable allergic reaction or anaphylaxis was the main reason for the assessment.","The skin on the torso felt normal, warm or hot.","There was no new or worsening swelling of the face, tongue or throat.","There was no new or worsening breathing problems or wheeze.","The individual was feeling faint.","The individual was able to carry out most or all normal activities.","An adrenaline injection had previously been prescribed.","An adrenaline injection was not available.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","If symptoms worsen, stop the vehicle in a safe place and call 999.","Give adrenaline if: worsening or rapid breathlessness, worsening or rapid tightness/swelling of the throat, tongue or lips.","Adrenaline can also be given for new or worsening feeling of dizziness or feeling that you may faint.","If an adrenaline injection is given, give it according to the manufacturer''s instructions.","Afterwards, leave them lying down or seated until help arrives.","If the there is no improvement after 5 minutes, give a second adrenaline injection if available.","Make a note of the time injections are given.","If you think the problem is due to new or changed medication, speak to a doctor, nurse or pharmacist before taking any more.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:53:19.02622+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (428, 26, 885, 1010, 1, 18, 4717, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","Probable allergic reaction or anaphylaxis was the main reason for the assessment.","The skin on the torso felt normal, warm or hot.","There was no new or worsening swelling of the face, tongue or throat.","There was new or worsening breathing problems or wheeze.","The breathing problem started in the past 6 hours.","There was no rapid onset breathing problem.","The individual was still able to carry out some normal activities.","An adrenaline injection had previously been prescribed.","An adrenaline injection was available.","The medication was administered.","There was improvement following the administration of adrenaline.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","If symptoms worsen, stop the vehicle in a safe place, call 999 and give a second injection of adrenaline if available.","Sit upright.","Use prescribed inhalers, nebulisers or oxygen according to the instructions.","If you think the problem is due to new or changed medication, speak to a doctor, nurse or pharmacist before taking any more.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:53:19.209123+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (540, 33, 529, 1226, 5, 22, 4003, 1, 2, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW1610, Dental Problems","Referral to Dental Service not required.","Referral to Emergency Treatment Centre not required.","Primary Care referral.","Contact Primary Care.","To contact a primary care service within 6 hours was considered appropriate.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to contact the individual. I need to ask some further questions in order to determine the best way to do this.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:55:31.65077+00', NULL);
