n. Don''t leave ice on while asleep.","If possible raise a swollen hand or wrist with a sling. When in bed raise it on pillows.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:53:51.651127+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (438, 29, 362, 1169, 17, 34, 4392, 2, 1, '{"Patient:  Joe Bloggs, Age Gender Selected: Child, Male","Pathway Selected: PMC3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was breathing and conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the contact was not chest/upper back pain, recent fit/seizure, suicide attempt, new confusion or suspected stroke.","The main reason for the assessment was not declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1611, Dental Problems","Toothache was the main problem.","There was no fever at the time of assessment or within the previous 12 hours.","There was no new lump or swelling on the face or under the jaw.","The tooth pain began after having braces fitted.","There was worsening pain.","Analgesics had not been taken.","The individual needs to contact a dental practice within 12 hours.","IF THE RECOMMENDED TIMEFRAME FALLS DURING PRACTICE HOURS: Contact the dental practice to arrange for the individual to be seen within 12 hours.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Do not apply gels or medication directly to the tooth or surrounding gum area. This may damage gums.","Avoid hot or cold food and drinks.","The only permanent cure for toothache is dental treatment. See a dentist.","Don''t wear a brace that is damaged or broken.","Dental braces can be uncomfortable initially. However, if pain is getting worse and the brace is a removable one, take it out.","Don''t try to remove a fixed brace. Only a dentist or orthodontist should do this.","If you were given dental wax by the dentist or orthodontist, put it on the part of the brace that is causing discomfort."}', '2023-02-27 13:54:15.037395+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (449, 29, 234, 1169, 17, 34, 4047, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1610, Dental Problems","Toothache was the main problem.","The painful area was not sore to touch.","There was a new lump or swelling on the face or under the jaw.","There was no fever at the time of assessment or within the previous 12 hours.","The lump or swelling had increased in size over the previous 24 hours.","Whether the individual was able to swallow liquids could not be confirmed.","The swelling was not causing the eye to close.","Analgesics had been taken.","The recommended dose of paracetamol or other analgesic had not been exceeded and multiple different analgesics had not been taken.","The individual needs to contact a dental practice within 12 hours.","IF THE RECOMMENDED TIMEFRAME FALLS DURING PRACTICE HOURS: Contact the dental practice to arrange for the individual to be seen within 12 hours.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist."}', '2023-02-27 13:54:16.177262+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (439, 29, 301, 1168, 16, 33, 4047, 1, 2, '{"Patient:  Joe Bloggs, Age Gender Selected: Adult, Female","Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was breathing and conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW572, Toothache After Dental Injury","An assault had not occurred.","There was damage to the teeth.","The injury was more than 24 hours old.","There was no associated head, facial or neck injury.","There was a fever at the time of assessment or within the previous 12 hours.","Analgesics had been taken.","The recommended dose of paracetamol or other analgesic had not been exceeded and multiple different analgesics had not been taken.","The individual needs to contact a dental practice within 6 hours.","IF THE RECOMMENDED TIMEFRAME FALLS DURING PRACTICE HOURS: Contact the dental practice to arrange for the individual to be seen within 6 hours.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","IN PREGNANCY: Dont take ibuprofen, except on the advice of a doctor, midwife or pharmacist. Use paracetamol instead.","It is important to have plenty of fluids, little and often is best.","Only wear light clothing. Don''t wrap up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Becoming very drowsy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999."}', '2023-02-27 13:54:15.171582+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (440, 29, 46, 1169, 16, 33, 4047, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1610, Dental Problems","Toothache was the main problem.","The painful area was not sore to touch.","There was a new lump or swelling on the face or under the jaw.","There was a fever at the time of assessment or within the previous 12 hours.","The lump or swelling had increased in size over the previous 24 hours.","The individual was able to swallow liquids.","The swelling was not causing the eye to close.","Analgesics had been taken.","The recommended dose of paracetamol or other analgesic had not been exceeded and multiple different analgesics had not been taken.","The individual needs to contact a dental practice within 6 hours.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","It is important to have plenty of fluids, little and often is best.","Only wear light clothing. Don''t wrap up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Becoming very drowsy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Do not apply gels or medication directly to the tooth or surrounding gum area. This may damage gums.","Avoid hot or cold food and drinks.","The only permanent cure for toothache is dental treatment. See a dentist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:15.296963+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (441, 29, 57, 1140, 112, 84, 4047, 1, 2, '{"Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","There was a predetermined management plan.","The predetermined plan specified that a dentist should be contacted.","The individual needs to speak to dental practice within 2 hours.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:15.366198+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (442, 29, 345, 1051, 16, 33, 4393, 2, 1, '{"Pathway Selected: PMC3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the contact was not chest/upper back pain, recent fit/seizure, suicide attempt, new confusion or suspected stroke.","The main reason for the assessment was not declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1611, Dental Problems","Dental bleeding was the main problem.","The bleeding did not follow an injury","There was bleeding at the time of the assessment.","Tooth extraction had occurred within the previous seven days.","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","The blood loss was slowing down or had stopped.","The individual needs to contact a dental practice within 6 hours.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Don''t try to poke anything into the hole.","Fold a piece of clean, damp gauze or cotton cloth (e.g. a handkerchief) into a pad and put it directly across the space where the tooth was.","Bite down firmly onto the pad for at least 15 minutes or until the bleeding stops. Don''t spit blood out. Repeat if the bleeding starts again.","Don''t rinse the mouth out, this may disturb the blood clot.","For the next 24 hours: don''t have hot drinks or alcohol; don''t exercise vigorously; don''t chew on the affected area.","If it starts to bleed again apply pressure by biting onto a pad (described above).","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:15.471665+00', NULL);
