take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:15.57707+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (444, 29, 152, 1051, 19, 61, 4047, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1610, Dental Problems","Dental bleeding was the main problem.","The bleeding did not follow an injury","There was no bleeding at the time of the assessment.","Dental surgery had not occurred within the previous seven days.","Bleeding of the gums did not only occur when cleaning the teeth.","The individual had no problem with toothache, jaw pain or swollen/painful gums.","There was no new lump or swelling on the face or under the jaw.","There was no generalised abnormal bruising or bleeding.","There was no unexplained weight loss or extreme tiredness over the previous month.","The individual needs to contact a dental practice within 5 working days.","IF THE RECOMMENDED TIMEFRAME FALLS DURING PRACTICE HOURS: Contact the dental practice to arrange for the individual to be seen during a routine appointment.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:15.67712+00', NULL);
