INSERT INTO pathwaysdos.scenarios VALUES (446, 29, 390, 1168, 14, 31, 4411, 1, 2, '{"Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW620, Dental Injury","There was no bleeding following the dental injury.","An assault had not occurred.","There was damage to the teeth.","The injury was less than 24 hours old.","A tooth or teeth had been knocked out.","There was no associated head, facial or neck injury.","The individual had kept the tooth.","Tooth loss occurred less than 2 hours previously.","There was no known increased susceptibilty to infection.","The tooth needs to be reimplanted as soon as possible.","Do not touch the root of the tooth. Only touch the part that is usually visible.","If it is dirty, rinse gently in milk or under running water. Do not scrub or clean with disinfectant.","Push the root of the tooth gently back in the socket as far as it will easily go.","Hold the tooth in place by gently biting on a piece of clean, folded cloth.","IF UNABLE OR UNWILLING TO REIMPLANT TOOTH: transport the tooth in a container of milk. The tooth does not need to be cleaned.","The individual needs to contact a dental practice within 1 hour.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:15.857341+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (447, 29, 233, 1169, 18, 35, 4047, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1610, Dental Problems","Toothache was the main problem.","The painful area was not sore to touch.","There was a new lump or swelling on the face or under the jaw.","There was no fever at the time of assessment or within the previous 12 hours.","The lump or swelling had not increased in size over the previous 24 hours.","Analgesics had been taken.","The recommended dose of paracetamol or other analgesic had not been exceeded and multiple different analgesics had not been taken.","The individual needs to contact a dental practice within 24 hours.","IF THE RECOMMENDED TIMEFRAME FALLS OUTSIDE PRACTICE HOURS: If the dental practice can''t be contacted, contact the individual''s GP practice or, if it is closed, call the GP out of hours service.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist."}', '2023-02-27 13:54:15.957147+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (448, 29, 357, 1134, 19, 61, 4392, 2, 1, '{"Pathway Selected: PMC3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the contact was not chest/upper back pain, recent fit/seizure, suicide attempt, new confusion or suspected stroke.","The main reason for the assessment was not declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1611, Dental Problems","There was a dental problem other than bleeding or toothache.","The problem was not a broken tooth or lost filling.","The problem related to braces.","The appliance was loose or damaged.","The individual had all the pieces of the dental appliance.","The pain was not worsening.","There was no pain from a rough edge or inability to eat.","The individual needs to contact a dental practice within 5 working days.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t wear a brace that is damaged or broken.","Dental braces can be uncomfortable initially. However, if pain is getting worse and the brace is a removable one, take it out.","Don''t try to remove a fixed brace. Only a dentist or orthodontist should do this.","If you were given dental wax by the dentist or orthodontist, put it on the part of the brace that is causing discomfort.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:16.069046+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (450, 30, 11, 1002, 117, 90, 4010, 1, 2, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","It was not appropriate to speak to the patient.","Heavy bleeding had not occurred in the previous 2 hours.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW508, Abdominal or Flank Injury, Penetrating","There was no possibility of pregnancy.","There was no new/worsening breathlessness since the injury.","The wound was not bleeding freely at the time of assessment.","There was no foreign body in the wound.","There was no severe pain in the chest or back.","There was no spinal pain, loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There was no very severe and constant pain or very severe pain worsened by movement","There had been no vomiting of red or altered (coffee grounds) blood.","There had been no black and tarry or red/maroon bowel motions.","The individual was able to weight-bear at the time of assessment.","There was no new shoulder tip pain.","A sexual assault had occurred.","DOS call","The individual needs to be referred to a treatment centre within 1 hour for Sexual Assault Assessment.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Don''t wash or change clothes until seen by a health care professional to avoid destroying important evidence.","When seen by the health care professional, inform them an assault has taken place.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Any cuts can be covered with a dry dressing. Dirt or anything else should not be cleaned out of the wound as this may be important evidence.","Don''t wash or change clothes until seen by a health care professional to avoid destroying important evidence.","When seen by the health care professional, inform them an assault has taken place.","If the situation appears to endanger anyone - CALL 999 FOR THE POLICE.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Use a dry dressing or a clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","Use pillows or a sling to keep the injured area raised.","If the bleeding cannot be controlled or is getting worse - CALL 999."}', '2023-02-27 13:54:33.05855+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (451, 30, 196, 1038, 117, 90, 4010, 1, 2, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","It was not appropriate to speak to the patient.","Heavy bleeding had not occurred in the previous 2 hours.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW580, Burn, Thermal","The individual did not have a major burn.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","The burn occurred within the previous 6 hours.","The burn did not involve an eye or eyelid.","Before doing anything else, cool the burn with cold (preferably running) water for at least 20 but no more than 30 minutes.","Don''t use ice or very cold water. Take care not to let the individual get too cold.","Gently remove any jewellery or tight clothing from the area of the burn.","Don''t try to remove any clothing that is stuck to the burn.","No illness or nausea since the burn.","The appearance of the burn could not be confirmed.","A sexual assault had occurred.","DOS call","The individual needs to be referred to a treatment centre within 1 hour for Sexual Assault Assessment.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Don''t wash or change clothes until seen by a health care professional to avoid destroying important evidence.","When seen by the health care professional, inform them an assault has taken place.","Before you go, I will just check whether I need to give you any further instructions or advice.","Before doing anything else, cool the burn with cold (preferably running) water for at least 20 but no more than 30 minutes.","IF NOT ON THE HEAD, FACE OR NECK: After cooling, loosely cover the burn with clingfilm or a clean plastic bag.","A decision about whether tetanus immunisation is needed can be made when the injury is checked.","Before doing anything else, cool the burn with cold (preferably running) water for at least 20 but no more than 30 minutes.","Close the eye, cover it with a soft pad or dressing and fasten it gently with some tape.","Don''t rub the eye.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Any cuts can be covered with a dry dressing. Dirt or anything else should not be cleaned out of the wound as this may be important evidence.","Don''t wash or change clothes until seen by a health care professional to avoid destroying important evidence.","When seen by the health care professional, inform them an assault has taken place.","If the situation appears to endanger anyone - CALL 999 FOR THE POLICE.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:33.216026+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (452, 30, 17, 1003, 117, 90, 4010, 1, 2, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","It was not appropriate to speak to the patient.","Heavy bleeding had not occurred in the previous 2 hours.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW508, Abdominal or Flank Injury, Penetrating","Pregnancy or possible pregnancy was reported.","The individual had been pregnant for 20 weeks or more.","There was no severe, constant abdominal pain.","There was no significant vaginal bleeding.","There was no cord prolapse, visible presenting part, passage of meconium, urge to push or contractions less than 5 minutes apart.","There had been no increased frequency of contractions or waters breaking following the injury.","There was no new/worsening breathlessness since the injury.","The wound was not bleeding freely at the time of assessment.","There was no foreign body in the wound.","There was no severe pain in the chest or back.","There was no spinal pain, loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There had been no vomiting of red or altered (coffee grounds) blood.","There had been no black and tarry or red/maroon bowel motions.","The individual was able to weight-bear at the time of assessment.","There was no new shoulder tip pain.","A sexual assault had occurred.","DOS call","The individual needs to be referred to a treatment centre within 1 hour for Sexual Assault Assessment.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Don''t wash or change clothes until seen by a health care professional to avoid destroying important evidence.","When seen by the health care professional, inform them an assault has taken place.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","IN PREGNANCY: Don''t take ibuprofen, except on the advice of a healthcare professional. Use paracetamol instead.","Any cuts can be covered with a dry dressing. Dirt or anything else should not be cleaned out of the wound as this may be important evidence.","Don''t wash or change clothes until seen by a health care professional to avoid destroying important evidence.","When seen by the health care professional, inform them an assault has taken place.","If the situation appears to endanger anyone - CALL 999 FOR THE POLICE.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Use a dry dressing or a clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","Use pillows or a sling to keep the injured area raised.","If the bleeding cannot be controlled or is getting worse - CALL 999."}', '2023-02-27 13:54:33.397604+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (453, 30, 768, 1174, 117, 90, 4010, 1, 2, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","It was not appropriate to speak to the patient.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW910, Vaginal Bleeding","There was no possibility of pregnancy.","Childbirth had not occurred within the previous 7 days.","There was no abdominal pain.","Childbirth, miscarriage or termination had not occurred within the previous 6 weeks.","A sexual assault had occurred.","DOS call","The individual needs to be referred to a treatment centre within 1 hour for Sexual Assault Assessment.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Don''t wash or change clothes until seen by a health care professional to avoid destroying important evidence.","When seen by the health care professional, inform them an assault has taken place.","Before you go, I will just check whether I need to give you any further instructions or advice.","Any cuts can be covered with a dry dressing. Dirt or anything else should not be cleaned out of the wound as this may be important evidence.","Don''t wash or change clothes until seen by a health care professional to avoid destroying important evidence.","When seen by the health care professional, inform them an assault has taken place.","If the situation appears to endanger anyone - CALL 999 FOR THE POLICE.","Don''t use tampons or a menstrual cup. Use pads instead.","Keep a check of how many pads are used to determine the amount of bleeding.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:33.517685+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (454, 30, 3, 1000, 117, 90, 4010, 1, 2, '{"111 Call Handler","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","It was not appropriate to speak to the patient.","Heavy bleeding had not occurred in the previous 2 hours.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW500, Abdominal or Flank Injury, Blunt","There was no possibility of pregnancy.","There was no new/worsening breathlessness since the injury.","There was no severe pain in the chest or back.","There was no spinal pain, loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There was no very severe and constant pain or very severe pain worsened by movement","There had been no vomiting of red or altered (coffee grounds) blood.","There had been no black and tarry or red/maroon bowel motions.","The individual was able to weight-bear at the time of assessment.","There was no new shoulder tip pain.","A sexual assault had occurred.","DOS call","The individual needs to be referred to a treatment centre within 1 hour for Sexual Assault Assessment.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Don''t wash or change clothes until seen by a health care professional to avoid destroying important evidence.","When seen by the health care professional, inform them an assault has taken place.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","The individual should not eat or drink anything before going to hospital (a sip of water is fine if medication needs to be taken).","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:33.669282+00', NULL);
