INSERT INTO pathwaysdos.scenarios VALUES (541, 33, 475, 1032, 2, 19, 4052, 1, 2, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW1603, Breast Problems","Referral to Emergency Treatment Centre required.","Attendance at an Emergency Treatment Centre within 4 hours was considered appropriate.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:31.706397+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (459, 30, 767, 1099, 117, 90, 4010, 1, 2, '{"An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","It was not appropriate to speak to the patient.","Heavy bleeding had not occurred in the previous 2 hours.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1010, Genital Injury, Penetrating","There was no possibility of pregnancy.","The wound was not bleeding freely at the time of assessment.","There was no foreign body in the wound.","There was no severe pain in the abdomen.","The individual was able to weight-bear at the time of assessment.","A sexual assault had occurred.","DOS call","The individual needs to be referred to a treatment centre within 1 hour for Sexual Assault Assessment.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Don''t wash or change clothes until seen by a health care professional to avoid destroying important evidence.","When seen by the health care professional, inform them an assault has taken place.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Any cuts can be covered with a dry dressing. Dirt or anything else should not be cleaned out of the wound as this may be important evidence.","Don''t wash or change clothes until seen by a health care professional to avoid destroying important evidence.","When seen by the health care professional, inform them an assault has taken place.","If the situation appears to endanger anyone - CALL 999 FOR THE POLICE.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","If the bleeding cannot be controlled or is getting worse - CALL 999.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-02-27 13:54:34.277791+00', NULL);
