ars to endanger anyone - CALL 999 FOR THE POLICE.","Don''t use tampons or a menstrual cup. Use pads instead.","Keep a check of how many pads are used to determine the amount of bleeding.","Keep any towels, etc. that were used to mop up the blood. They will need to be checked.","If bleeding becomes heavy, and you start passing clots, save everything passed in case it needs to be checked.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:34.791999+00', NULL);
