INSERT INTO pathwaysdos.scenarios VALUES (466, 31, 7, 1001, 117, 90, 4010, 1, 2, '{"Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW500, Abdominal or Flank Injury, Blunt","Pregnancy or possible pregnancy was reported.","The individual had been pregnant for 20 weeks or more.","There was no severe, constant abdominal pain.","There was no significant vaginal bleeding.","There was no cord prolapse, visible presenting part, passage of meconium, urge to push or contractions less than 5 minutes apart.","There had been no increased frequency of contractions or waters breaking following the injury.","There was no new/worsening breathlessness since the injury.","There was no severe pain in the chest or back.","There was no spinal pain, loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There had been no vomiting of red or altered (coffee grounds) blood.","There had been no black and tarry or red/maroon bowel motions.","The individual has been able to weight-bear since the injury.","There was no new shoulder tip pain.","A sexual assault had occurred.","The individual needs to attend an emergency treatment centre within 1 hour for Sexual Assault Assessment.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","IN PREGNANCY: Don''t take ibuprofen, except on the advice of a doctor, midwife or pharmacist. Use paracetamol instead.","IN ADULTS: if the incident is likely to be reported to the police anyone who treats the individual should be made aware of this and should avoid destroying potential evidence.","Any cuts can be covered with a dry dressing. Dirt or anything else should not be cleaned out of the wound as this may be important evidence.","If it is to be reported to the police don''t wash or change clothes until seen by a doctor or specialist nurse, to avoid destroying important evidence.","If the situation appears to endanger anyone - DIAL 999 FOR THE POLICE.","The individual should not eat or drink anything before going to hospital (a sip of water is fine if medication needs to be taken).","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","Raise a swollen ankle or knee by sitting with the foot on a stool, or lying with it propped on pillows.","Raise a swollen hand or wrist above the level of the heart with a sling. When in bed raise it on pillows.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:49.557926+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (467, 31, 204, 1114, 1, 18, 4052, 1, 1, '{"Pathway Selected: PMA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW998, Heat Exposure","There was no new or increased breathlessness.","There had been no seizure or unconsciousness following the sun/heat exposure.","The individual was not collapsed and very hot to touch.","The individual was not experiencing palpitations.","The individual was not drowsy, confused or agitated.","There were no severe muscle aches, twitching or cramps.","The individual was not feeling dizzy or nauseous.","The individual felt generally unwell and had a severe thirst.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Rest somewhere cool.","Cool the skin by sponging with lukewarm water or having a tepid (not cold) bath or shower. Don''t use ice. Take care not to get too cold.","Have plenty of non-alcoholic drinks to help cool down and to prevent dehydration.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:49.669101+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (468, 31, 210, 1139, 1, 18, 4146, 3, 2, '{"Pathway Selected: PFT, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1710, Wound Problems, Plaster Casts, Tubes and Metal Appliances","The problem involved a plaster cast.","The individual appeared to be in pain.","The plaster was on a limb.","There was blue discolouration of toes/fingers on the affected limb.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, either paracetamol OR ibuprofen can be used to relieve pain or reduce a fever.","It is not always necessary to use medication to treat a fever unless the child is particularly upset or uncomfortable.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:49.78627+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (473, 31, 211, 1139, 2, 19, 4305, 3, 2, '{"Pathway Selected: PFT, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1710, Wound Problems, Plaster Casts, Tubes and Metal Appliances","The problem involved a plaster cast.","The individual did not appear to be in pain.","The cast was not too tight.","The plaster was bloodstained or offensive-smelling.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:50.377324+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (469, 31, 359, 1146, 2, 19, 4081, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1685, Sexual Concerns","A sexual assault had not occurred.","The problem was not contraception or concerns about sexual activity or identity.","The individual had not experienced an erection persisting for more than 4 hours.","The individual did not have a genital injury.","There was no new genital pain or swelling.","There had been no foreign object inside or around the penis.","The problem did not concern a rectal foreign body.","The problem related to a piercing or jewellery.","The piercing or jewellery was embedded in the skin.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:49.896984+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (470, 31, 365, 1175, 117, 90, 4010, 1, 2, '{"Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW910, Vaginal Bleeding","Pregnancy or possible pregnancy was reported.","The individual had been pregnant for 20 weeks or more.","There was no abdominal pain.","There was no significant vaginal bleeding.","A sexual assault had occurred.","The individual needs to attend an emergency treatment centre within 1 hour for Sexual Assault Assessment.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","If it is to be reported to the police don''t wash or change clothes until seen by a doctor or specialist nurse, to avoid destroying important evidence.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","IN ADULTS: if the incident is likely to be reported to the police anyone who treats the individual should be made aware of this and should avoid destroying potential evidence.","If the situation appears to endanger anyone - DIAL 999 FOR THE POLICE.","Keep a check of how many pads are used to determine the amount of bleeding.","Don''t use tampons.","Keep any towels, etc. that were used to mop up the blood. They will need to be checked.","If bleeding becomes heavy, and you start passing clots, save everything passed in case it needs to be checked.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:50.017345+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (471, 31, 198, 1139, 2, 19, 4140, 2, 1, '{"Pathway Selected: PMC1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the contact was not chest/upper back pain, recent fit/seizure, suicide attempt, new confusion or suspected stroke.","The main reason for contact was not declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1709, Wound Problems, Plaster Casts, Tubes and Metal Appliances","The problem involved a plaster cast.","There was new or worsening pain underneath the plaster.","The plaster was on a limb.","There was no blue discolouration of toes/fingers on the affected limb.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:50.117123+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (472, 31, 12, 1002, 2, 19, 4052, 1, 2, '{"Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW508, Abdominal or Flank Injury, Penetrating","There was no possibility of pregnancy.","There was no new/worsening breathlessness since the injury.","The wound was not bleeding freely at the time of assessment.","There was no foreign body in the wound.","There was no severe pain in the chest or back.","There was no spinal pain, loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There was no very severe and constant pain or very severe pain worsened by movement","There had been no vomiting of red or altered (coffee grounds) blood.","There had been no black and tarry or red/maroon bowel motions.","The individual has been able to weight-bear since the injury.","There was no new shoulder tip pain.","An assault had not occurred.","The problem was not a needlestick injury.","The injury was not a complex wound.","There was no new vaginal bleeding.","There had been no blood in the urine since the injury.","There was worsening pain or swelling.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t leave ice on while asleep. Don''t put ice directly on the skin.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-02-27 13:54:50.270536+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (554, 33, 507, 1196, 1, 18, 4052, 1, 2, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW1748, Aura or Anticipated Fit/Seizure (Declared)","Referral to Emergency Treatment Centre required.","Immediate attendance at an Emergency Treatment Centre was considered appropriate.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:32.457943+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (475, 31, 4, 1000, 2, 19, 4052, 1, 2, '{"Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW500, Abdominal or Flank Injury, Blunt","There was no possibility of pregnancy.","There was no new/worsening breathlessness since the injury.","There was no severe pain in the chest or back.","There was no spinal pain, loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There was no very severe and constant pain or very severe pain worsened by movement","There had been no vomiting of red or altered (coffee grounds) blood.","There had been no black and tarry or red/maroon bowel motions.","The individual has been able to weight-bear since the injury.","There was no new shoulder tip pain.","An assault had not occurred.","There was no new vaginal bleeding.","There had been blood in the urine since the injury.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t leave ice on while asleep. Don''t put ice directly on the skin.","Raise a swollen ankle or knee by sitting with the foot on a stool, or lying with it propped on pillows.","Raise a swollen hand or wrist above the level of the heart with a sling. When in bed raise it on pillows.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:50.617507+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (476, 31, 213, 1037, 1, 18, 4024, 4, 2, '{"Pathway Selected: PFI, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1480, Burn, Chemical","Hydrofluoric acid, phenol, white phosphorus or wet cement were not involved.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","Don''t touch the burned skin or anything else that has come into contact with the chemical. Put on gloves if they are available.","If the chemical is in dry form brush it off the skin.","Before doing anything else, flood the skin under running water for at least 20 minutes.","Don''t let contaminated water run onto unburned skin or splash anyone else.","Gently remove any contaminated clothing while flooding the skin with water.","Don''t try to neutralise the chemical with anything else, e.g. vinegar, bicarbonate of soda.","Keep the container or any identifying label for the substance.","The individual had not been vomiting since the burn.","The burned area appeared red and blistered.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Make sure the skin has been flooded under running water for at least 20 minutes as instructed.","Loosely cover the burn with clingfilm or a clean plastic bag.","If possible the container, or any identifying label, should be taken to the hospital. Make sure the container is securely closed and not leaking.","Make sure the eye has been flooded under running water for at least 20 minutes as instructed.","Make sure that the water drains away from the face.","Close the eye, cover it with a soft pad or dressing and fasten it gently with some tape.","Don''t rub the eye.","OVER 12 WEEKS OLD: Unless advised not to, or they have already been given, either paracetamol OR  ibuprofen can be used to relieve pain or reduce a fever.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:50.757036+00', NULL);
