INSERT INTO pathwaysdos.scenarios VALUES (483, 31, 216, 1101, 1, 18, 4072, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1564, Genital Problems","There was no abdominal or low back pain.","There was no pain in the penis","There was testicular/scrotal pain.","There was pain in only one testicle.","The onset of testicular/scrotal pain was sudden.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:51.535838+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (484, 31, 202, 1108, 1, 18, 4015, 1, 2, '{"Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1260, Hand or Wrist Injury, Penetrating","The wound was not bleeding freely at the time of assessment.","The individual had no associated arm injury.","The hand had not become cold, pale or blue.","There was no bone protruding through the skin.","There was no new hand or wrist deformity.","The individual was able to get up from the floor.","There was no amputation of a finger or part of a finger.","There was no foreign body in the wound.","An assault had not occurred.","The problem was not a needlestick injury.","The injury was not a complex wound.","The wound was not caused by a hydraulic or high-pressure injection.","There was no constriction of the limb by an object that could not be removed.","There was no loss of wrist movement following the injury.","There was no new numbness or pins and needles in the hand.","There was an injury involving a single digit.","Movement of the affected digit was normal.","The individual had lost all/part of a nail.","There was worsening pain.","The individual was using anticoagulant medication.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If helping someone else: try to keep their blood off your skin.","If the nail is not completely torn off, don''t move it.","Don''t wash or disinfect the area, even if it looks very dirty.","Wrap the area very loosely in something soft and non-fluffy, and fasten it with sticky tape.","If possible, elevate the injured area with pillows or a sling.","Take the nail to the hospital as it may be possible to reattach it.","Don''t wash or disinfect the nail, even if it looks very dirty.","Wrap the torn-off nail loosely in clingfilm or a plastic bag. Then loosely wrap it in a cloth and put it in a container with ice or frozen peas.","Don''t let it come into direct contact with the ice, and don''t put it in a freezer.","The individual should not eat or drink anything before going to hospital (a sip of water is fine if medication needs to be taken).","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","Raise a swollen hand or wrist above the level of the heart with a sling. When in bed raise it on pillows.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Use a dry dressing or a clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","IN LIMBS: raise the injured area above the level of the heart and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","Use pillows or a sling to keep the injured area raised."}', '2023-02-27 13:54:51.717618+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (542, 33, 474, 1025, 2, 19, 4052, 2, 2, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW961, Blood in Urine","Referral to Emergency Treatment Centre required.","Attendance at an Emergency Treatment Centre within 4 hours was considered appropriate.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","DOS call","Don''t cut down on fluids. It is important to drink at least as much as usual.","If you need to be seen by a GP practice or OOH service collect a urine specimen in a clean jar in case it needs to be tested.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:31.757983+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (485, 31, 389, 1187, 1, 18, 4052, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","Declared diabetic hypo or hyperglycaemia was the main reason for the contact.","The concern was that the blood sugar was too high.","The skin on the torso felt normal, warm or hot.","Severe illness and a rash suggestive of septicaemia were not described.","The blood sugar level had been measured.","The testing machine reported in units of millimoles per litre.","The blood sugar level was 28mmol/L or more.","There was a diagnosis of insulin dependent diabetes.","The blood had been tested for ketones.","The blood ketone level was above 3mmol/L.","There was no new or worsening confusion.","There was no abdominal pain.","The individual did not have a deep, sighing pattern of breathing.","There was no possibility of pregnancy.","The individual had not clinically deteriorated nor felt particularly unwell in the previous 24 hours.","There was somebody available to offer safe transport to hospital.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Carry on with insulin or other diabetic medication as normal. Don''t stop or reduce the dose unless told to by a doctor or diabetes specialist nurse.","Test urine or blood for sugar at least 4 times a day.","Test urine or blood for ketones.","Have plenty of sugar-free fluids.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:51.878002+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (486, 31, 203, 1085, 1, 18, 4014, 1, 2, '{"Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1270, Finger or Thumb Injury, Blunt","There was no injury to any other part of the hand.","The individual was able to get up from the floor.","The finger or thumb had not become cold, pale or blue.","An assault had not occurred.","The individual had a ring that could not be removed.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","The individual should not eat or drink anything before going to hospital (a sip of water is fine if medication needs to be taken).","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","Raise a swollen hand or wrist above the level of the heart with a sling. When in bed raise it on pillows.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:51.997328+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (487, 31, 201, 1108, 1, 18, 4009, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1260, Hand or Wrist Injury, Penetrating","The wound was bleeding freely at the time of assessment.","The individual had no associated arm injury.","The hand had not become cold, pale or blue.","There was no bone protruding through the skin.","There was no new hand or wrist deformity.","The individual was able to get up from the floor.","There was complete amputation of a finger.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Take the body part to the hospital as it may be possible to reattach it.","Don''t wash or disinfect the body part, even if it looks very dirty.","Wrap the part loosely in clingfilm or a plastic bag. Then loosely wrap it in a cloth and put it in a container with ice or frozen peas.","Don''t let it come into direct contact with the ice. Don''t put it in a freezer.","The individual should not eat or drink anything before going to hospital (a sip of water is fine if medication needs to be taken).","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Use a dry dressing or a clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","IN LIMBS: raise the injured area above the level of the heart and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","Use pillows or a sling to keep the injured area raised."}', '2023-02-27 13:54:52.134607+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (488, 31, 215, 1183, 2, 19, 4127, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1570, Fingernail Injury","There was no injury to another part of the finger.","An assault had not occurred.","The individual had not lost all/part of a nail.","There was a purple or black area under the nail.","The purple/black area involved more than a quarter of the nail surface.","The injury was extremely painful at the time of the assessment.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t leave ice on while asleep. Don''t put ice directly on the skin.","Raise a swollen hand or wrist above the level of the heart with a sling. When in bed raise it on pillows.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:52.249164+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (489, 31, 361, 1165, 1, 18, 4014, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1526, Toe Injury, Penetrating","No other part of the foot was injured.","The individual was able to get up from the floor.","There had been no amputation of a toe or part of a toe.","The wound was not bleeding freely at the time of assessment.","There was no foreign body in the wound.","The injury was not a complex wound.","The toe was not cold, pale or blue.","There was no new deformity.","An assault had not occurred.","The individual had a ring that could not be removed.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","The individual should not eat or drink anything before going to hospital (a sip of water is fine if medication needs to be taken).","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","Raise a swollen ankle or knee by sitting with the foot on a stool, or lying with it propped on pillows.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","IN LIMBS: raise the injured area above the level of the heart using pillows or a sling.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-02-27 13:54:52.377777+00', NULL);
