with ice or frozen peas.","Don''t let it come into direct contact with the ice, and don''t put it in a freezer.","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t leave ice on while asleep. Don''t put ice directly on the skin.","Raise a swollen hand or wrist above the level of the heart with a sling. When in bed raise it on pillows.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:52.733412+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (493, 31, 17, 1003, 117, 90, 4010, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW508, Abdominal or Flank Injury, Penetrating","Pregnancy or possible pregnancy was reported.","The individual had been pregnant for 20 weeks or more.","There was no severe, constant abdominal pain.","There was no significant vaginal bleeding.","There was no cord prolapse, visible presenting part, passage of meconium, urge to push or contractions less than 5 minutes apart.","There had been no increased frequency of contractions or waters breaking following the injury.","There was no new/worsening breathlessness since the injury.","The wound was not bleeding freely at the time of assessment.","There was no foreign body in the wound.","There was no severe pain in the chest or back.","There was no spinal pain, loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There had been no vomiting of red or altered (coffee grounds) blood.","There had been no black and tarry or red/maroon bowel motions.","The individual has been able to weight-bear since the injury.","There was no new shoulder tip pain.","A sexual assault had occurred.","The individual needs to attend an emergency treatment centre within 1 hour for Sexual Assault Assessment.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","If it is to be reported to the police don''t wash or change clothes until seen by a doctor or specialist nurse, to avoid destroying important evidence.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","IN PREGNANCY: Don''t take ibuprofen, except on the advice of a doctor, midwife or pharmacist. Use paracetamol instead.","IN ADULTS: if the incident is likely to be reported to the police anyone who treats the individual should be made aware of this and should avoid destroying potential evidence.","If the situation appears to endanger anyone - DIAL 999 FOR THE POLICE.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-02-27 13:54:52.876978+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (494, 31, 3, 1000, 117, 90, 4010, 1, 1, '{"Pathway Selected: PMA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW503, Abdominal or Flank Injury, Blunt","There was no new/worsening breathlessness since the injury.","There was no severe pain in the chest or back.","There was no spinal pain, loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There was no very severe and constant pain or very severe pain worsened by movement","There had been no vomiting of red or altered (coffee grounds) blood.","There had been no black and tarry or red/maroon bowel motions.","The individual has been able to weight-bear since the injury.","There was no new shoulder tip pain.","A sexual assault had occurred.","The individual needs to attend an emergency treatment centre within 1 hour for Sexual Assault Assessment.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:52.977888+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (495, 31, 70, 1110, 2, 19, 4052, 4, 2, '{"Pathway Selected: PFI, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1401, Head, Facial or Neck Injury, Blunt","There was no new/worsening breathlessness since the injury.","The individual had not experienced a seizure around the time of or since the injury.","There was no fluid leak or bleeding from the ear or nose.","There was no new skull deformity, bruise, swelling or wound more than 5cm across.","There was no bruising around the uninjured eye or ear.","There had not been a fall directly onto the head.","An assault had not occurred.","There was no loss of consciousness at the time of the injury.","There was no vomiting following the injury.","The child had been behaving normally since the injury.","There was no previous history of brain surgery.","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","There was no injury/damage within the mouth.","There was worsening swelling.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Make sure that they are with a responsible adult for 48 hours after having the head injury so that they can watch out for any problems.","Babies tend to sleep after a head injury. This is fine as long as they are woken every hour for the first 6 hours after the injury.","OVER 12 WEEKS OLD: Unless advised not to, or they have already been given, paracetamol can be used to relieve pain.","Don''t use any other painkillers, they can cause complications following a head injury.","Remove any jewellery or tight clothing from around the swelling.","If the baby cannot be woken or has a fit - DIAL 999.","Any vomiting, behaviour changes, if they become irritable or have no interest in things around them - GO STRAIGHT TO THE NEAREST EMERGENCY DEPARTMENT.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:54:53.117133+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (543, 33, 528, 1225, 2, 19, 4052, 1, 2, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW1771, Skin Problems","Referral to Emergency Treatment Centre required.","Attendance at an Emergency Treatment Centre within 4 hours was considered appropriate.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:55:31.817204+00', NULL);
