INSERT INTO pathwaysdos.scenarios VALUES (498, 31, 110, 1035, 1, 18, 4052, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW556, Breathing Problems, Breathlessness or Wheeze","There was no rapid swelling of the lips, face, throat or tongue.","There was no chest or upper back pain at the time of the assessment.","There had been no chest or upper back pain in the previous 24 hours.","Severe illness and a rash suggestive of septicaemia were not described.","Severe illness and inability to flex the neck or photophobia were not described.","There had been no episode of choking within the previous 24 hours.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","Pregnancy or possible pregnancy was reported.","The individual had been pregnant for 20 weeks or more.","The individual had not coughed up blood.","There was no new or worsening breathlessness at rest.","There had been no travel to the Middle East or South Korea in the past 2 weeks.","The breathing had worsened in the previous hour.","There had been a previous similar episode, which required hospital admission.","The symptoms were worse than those previously requiring hospital admission.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Sit as upright as is comfortable.","If an inhaler or spacer is used for chest problems, use it according to instructions on what to do if breathing gets worse.","Never use any medication that has been prescribed for someone else.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:53.454593+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (499, 31, 65, 1181, 1, 18, 4052, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1709, Wound Problems, Plaster Casts, Tubes and Metal Appliances","The problem involved a wound or dressing.","The pain was not severe.","The wound was to the abdomen.","There was complete wound dehiscence.","Intestines were not visible.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Use a dry dressing or a clean cloth folded into a pad and press gently but firmly on the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","If you have been given dressings, take them with you when you go to get the wound redressed.","If you have a care plan take that too.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:53.576162+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (500, 31, 310, 1012, 1, 18, 4009, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1518, Ankle or Foot Injury, Penetrating","The wound was not bleeding freely at the time of assessment.","The foot had not become cold, pale or blue.","There was no bone protruding through the skin.","There was no new severe ankle or foot deformity.","The individual has been able to weight-bear since the injury.","There had been complete amputation of a toe.","The individual needs to attend an emergency treatment centre within 1 hour.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","A decision about whether tetanus immunisation is needed can be made when the wound is checked."}', '2023-02-27 13:54:53.671749+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (544, 33, 514, 1206, 128, 101, 4170, 1, 2, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","Palliative care services required.","The problem related to a syringe driver.","The individual needs to speak to a primary care service within 1 hour for palliative care.","I will arrange for a clinician to speak to the individual.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:55:31.858245+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (501, 31, 339, 1156, 1, 18, 4389, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW854, Sore Throat or Hoarse Voice","The problem involved  a sore throat without a hoarse voice.","There was no pain on swallowing at the time of the assessment.","There was no associated chest pain.","The individual had not experienced aching pain associated with exercise or emotion.","There was no new or worsening breathlessness.","Severe illness and a rash suggestive of septicaemia were not described.","Severe illness and inability to flex the neck or photophobia were not described.","There had been no travel within the last 4 weeks from a country affected by the current Ebola outbreak.","Exposure to Ebola virus disease in the last 4 weeks was not declared.","There was a history of tonsillectomy within the previous 2 weeks.","There had been new bleeding since discharge from hospital.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Paracetamol and ibuprofen are both used to relieve pain and reduce high temperature and fever.","Unless advised not to, or it 