INSERT INTO pathwaysdos.scenarios VALUES (512, 31, 120, 1047, 2, 19, 4052, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW975, Cough","There was no new or worsening breathlessness.","Severe illness and a rash suggestive of septicaemia were not described.","Severe illness and inability to flex the neck or photophobia were not described.","There had been no travel to the Middle East or South Korea in the past 2 weeks.","There was no possibility of pregnancy.","There was no sharp/stabbing pain in the chest/upper back on coughing or deep breathing.","There had been an episode of choking within the previous 24 hours.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Cough medicine may soothe a cough, but will not cure it. Talk to the pharmacist for advice. Follow the instructions in the pack.","Have plenty of fluids to loosen the phlegm.","Avoid exposure to tobacco smoke.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:55.030308+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (513, 31, 69, 1110, 1, 18, 4052, 4, 2, '{"Pathway Selected: PFI, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1401, Head, Facial or Neck Injury, Blunt","There was no new/worsening breathlessness since the injury.","The individual had not experienced a seizure around the time of or since the injury.","There was no fluid leak or bleeding from the ear or nose.","There was no new skull deformity, bruise, swelling or wound more than 5cm across.","There was no bruising around the uninjured eye or ear.","There had been a fall directly onto the head.","There was somebody available to offer safe transport to hospital.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Make sure that they are with a responsible adult for 48 hours after having the head injury so that they can watch out for any problems.","Babies tend to sleep after a head injury. This is fine as long as they are woken every hour for the first 6 hours after the injury.","OVER 12 WEEKS OLD: Unless advised not to, or they have already been given, paracetamol can be used to relieve pain.","Don''t use any other painkillers, they can cause complications following a head injury.","Remove any jewellery or tight clothing from around the swelling.","If the baby cannot be woken or has a fit - DIAL 999.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:54:55.148996+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (514, 31, 219, 1158, 2, 19, 4312, 1, 1, '{"Pathway Selected: PMA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW987, Burn, Sun","The individual did not feel generally unwell.","There was no severe blistering or swelling.","There were no features of dehydration.","There was eye pain at the time of assessment.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Wash the eyes under cold running water for several minutes.","Don''t rub the eyes.","Don''t put a pad on the eyes until they have been examined. A pad might delay healing.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t burst any blisters.","Cool the skin by sponging with lukewarm water or having a tepid (not cold) bath or shower. Don''t use ice. Take care not to get too cold.","Have plenty of non-alcoholic drinks to help cool down and to prevent dehydration.","Creams and lotions to help cool the skin and ease discomfort are available from pharmacies. Talk to the pharmacist for advice.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:55.257061+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (515, 31, 393, 1054, 130, 103, 4403, 1, 1, '{"Pathway Selected: PMA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW631, Diarrhoea","There was no vomiting.","There was no abdominal pain.","Severe illness and a rash suggestive of septicaemia were not described.","Severe illness and inability to flex the neck or photophobia were not described.","There was no new loss of bladder control or leg movement and no saddle or lower limb paraesthesia","There had been no black and tarry or red/maroon bowel motions.","The individual had not ingested a harmful or toxic substance.","There had been travel within the last 4 weeks from a country affected by the current Ebola outbreak.","There was a fever at the time of assessment or within the previous 24 hours.","Private transport to hospital was available.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual, which must only be a member of the household.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","I will inform the Emergency Department that the individual will be attending.","When seen or spoken to by a health care professional make sure they are told about the recent travel to West Africa or contact with Ebola. This is very important.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","It is important to have plenty of fluids, little and often is best.","Only wear light clothing. Don''t wrap up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Becoming very drowsy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:55.39735+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (545, 33, 500, 1162, 2, 19, 4052, 1, 1, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW1072, Tiredness (Fatigue)","Referral to Emergency Treatment Centre required.","Attendance at an Emergency Treatment Centre within 4 hours was considered appropriate.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:31.917793+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (516, 31, 218, 1177, 1, 18, 4056, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1559, Vaginal Itch or Soreness","There was no new vaginal discharge.","A sexual assault had not occurred.","There was a fever at the time of assessment or within the previous 12 hours.","There was a retained tampon or other vaginal foreign body.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","It is important to have plenty of fluids, little and often is best.","Only wear light clothing. Don''t wrap up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Becoming very drowsy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","Don''t try to remove the object.","Wash the area daily with plain warm water and mild soap. Dry well. Washing too often can make things worse.","Don''t use perfumed products like soaps, bubble baths, gels or deodorants.","Loose-fitting cotton clothes and underwear are best.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:55.514811+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (517, 31, 385, 1086, 1, 18, 4410, 1, 2, '{"Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1264, Finger or Thumb Injury, Penetrating","There was no injury to any other part of the hand.","The individual was able to get up from the floor.","There was no amputation of a finger or part of a finger.","The wound was not bleeding freely at the time of assessment.","There was no foreign body in the wound.","The injury was not a complex wound.","The finger or thumb had not become cold, pale or blue.","There was no new deformity.","An assault had not occurred.","The problem was not a needlestick injury.","The wound was caused by a hydraulic or high-pressure injection.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","IN LIMBS: raise the injured area above the level of the heart using pillows or a sling.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-02-27 13:54:55.637248+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (518, 31, 384, 1108, 1, 18, 4410, 1, 1, '{"Pathway Selected: PMA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1260, Hand or Wrist Injury, Penetrating","The wound was not bleeding freely at the time of assessment.","The individual had no associated arm injury.","The hand had not become cold, pale or blue.","There was no bone protruding through the skin.","There was no new hand or wrist deformity.","The individual was able to get up from the floor.","There was no amputation of a finger or part of a finger.","There was no foreign body in the wound.","An assault had not occurred.","The problem was not a needlestick injury.","The injury was not a complex wound.","The wound was caused by a hydraulic or high-pressure injection.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","The individual should not eat or drink anything before going to hospital (a sip of water is fine if medication needs to be taken).","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","Raise a swollen hand or wrist above the level of the heart with a sling. When in bed raise it on pillows.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","IN LIMBS: raise the injured area above the level of the heart using pillows or a sling.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-02-27 13:54:55.777704+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (519, 31, 18, 1002, 1, 18, 4052, 1, 2, '{"Patient:  Joe Bloggs, Age Gender Selected: Adult, Female","Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW508, Abdominal or Flank Injury, Penetrating","There was no possibility of pregnancy.","There was no new/worsening breathlessness since the injury.","The wound was bleeding freely at the time of assessment.","There was no foreign body in the wound.","There was no severe pain in the chest or back.","There was no spinal pain, loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There was no very severe and constant pain or very severe pain worsened by movement","There had been no vomiting of red or altered (coffee grounds) blood.","There had been no black and tarry or red/maroon bowel motions.","The individual has been able to weight-bear since the injury.","There was no new shoulder tip pain.","An assault had not occurred.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","IN LIMBS: raise the injured area above the level of the heart using pillows or a sling.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","IN PREGNANCY: Dont take ibuprofen, except on the advice of a doctor, midwife or pharmacist. Use paracetamol instead."}', '2023-02-27 13:54:55.914516+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (520, 31, 8, 1001, 2, 19, 4052, 1, 2, '{"Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW500, Abdominal or Flank Injury, Blunt","Pregnancy or possible pregnancy was reported.","The individual had been pregnant for 20 weeks or more.","There was no severe, constant abdominal pain.","There was no significant vaginal bleeding.","There was no cord prolapse, visible presenting part, passage of meconium, urge to push or contractions less than 5 minutes apart.","There had been no increased frequency of contractions or waters breaking following the injury.","There was no new/worsening breathlessness since the injury.","There was no severe pain in the chest or back.","There was no spinal pain, loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There had been no vomiting of red or altered (coffee grounds) blood.","There had been no black and tarry or red/maroon bowel motions.","The individual has been able to weight-bear since the injury.","There was no new shoulder tip pain.","An assault had not occurred.","There had been blood in the urine since the injury.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","IN PREGNANCY: Don''t take ibuprofen, except on the advice of a doctor, midwife or pharmacist. Use paracetamol instead.","The baby not moving as much as normal - CONTACT THE GP PRACTICE, OUT OF HOURS SERVICE OR MIDWIFE IMMEDIATELY.","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t leave ice on while asleep. Don''t put ice directly on the skin.","Raise a swollen ankle or knee by sitting with the foot on a stool, or lying with it propped on pillows.","Raise a swollen hand or wrist above the level of the heart with a sling. When in bed raise it on pillows.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:56.057376+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (546, 33, 516, 1206, 127, 100, 4247, 1, 2, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","Management of patient death.","Expected death.","A qualified person was not available to verify death.","The individual needs to speak to the primary care service within 6 hours for expected death.","I will arrange for a clinician to speak to you.","DOS call","NO INSTRUCTIONS GIVEN AS CALL RELATES TO AN INDIVIDUAL WHO HAS DIED."}', '2023-02-27 13:55:31.957138+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (521, 31, 20, 1004, 1, 18, 4052, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW516, Abdominal Pain","There was no vomiting, diarrhoea, rectal bleeding, groin pain or groin swelling.","There was no vaginal bleeding, discharge or swelling.","The pain did not interfere with normal activity .","There was no crushing or severe aching chest, upper back or upper abdominal pain, or pain radiating to the arm, neck, jaw or shoulder.","Severe illness and a rash suggestive of septicaemia were not described.","There was no possibility of pregnancy.","Childbirth had not occurred within the previous 6 weeks.","There had been no black and tarry or red/maroon bowel motions.","The individual had not ingested a harmful or toxic substance.","The individual had not felt faint or passed out because of the pain.","There was new shoulder tip pain.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or it has already been given, paracetamol may be used to relieve abdominal pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use ibuprofen or any other anti-inflammatory medication such as aspirin, as they can irritate the stomach.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:56.197708+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (522, 31, 196, 1038, 117, 90, 4010, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW580, Burn, Thermal","The individual did not have a major burn.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","The burn occurred within the previous 6 hours.","Before doing anything else, cool the burn with cold (preferably running) water for at least 10 but no more than 30 minutes.","Don''t use ice or very cold water. Take care not to let the individual get too cold.","Gently remove any jewellery or tight clothing from the area of the burn.","Don''t try to remove any clothing that is stuck to the burn.","No illness or nausea since the burn.","The appearance of the burn could not be confirmed.","A sexual assault had occurred.","The individual needs to attend an emergency treatment centre within 1 hour for Sexual Assault Assessment.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","If it is to be reported to the police don''t wash or change clothes until seen by a doctor or specialist nurse, to avoid destroying important evidence.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Make sure the burn has been cooled with water, as instructed, for at least 10 minutes but no more than 30 minutes.","After cooling, loosely cover the burn with clingfilm or a clean plastic bag.","A decision about whether tetanus immunisation is needed can be made when the injury is checked.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","IN ADULTS: if the incident is likely to be reported to the police anyone who treats the individual should be made aware of this and should avoid destroying potential evidence.","If the situation appears to endanger anyone - DIAL 999 FOR THE POLICE.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:56.329183+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (523, 31, 381, 1140, 115, 76, 4245, 1, 1, '{"Patient:  Joe Bloggs, Age Gender Selected: Adult, Male","Pathway Selected: PMA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was breathing and conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","There was a predetermined management plan.","Predetermined course of action menu - continued to next list.","The predetermined plan specified that a mental health service should be contacted.","The individual had not attacked, threatened or intended to harm anyone.","The individual was having suicidal thoughts.","The individual did not have a plan available for a suicide attempt.","The individual needs to attend an emergency treatment centre within 1 hour for further assessment.","Someone else should drive the individual.","Make sure you have a list of any current medications.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:56.418056+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (524, 31, 154, 1186, 115, 76, 4245, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1749, Behaviour Change","The mood or behaviour change was part of a previously diagnosed mental health problem.","The individual had not attacked, threatened or intended to harm anyone.","The individual was having suicidal thoughts.","The individual had not made a plan for a suicide attempt.","The individual needs to attend an emergency treatment centre within 1 hour for further assessment.","Someone else should drive the individual.","Make sure you have a list of any current medications.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:56.513395+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (547, 33, 502, 1170, 115, 76, 4419, 1, 1, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW881, Accidental Poisoning/Inhalation","Referral to Mental Health Service required.","Referral for emergency mental health intervention required.","The individual needs to attend an emergency treatment centre within 1 hour for further assessment.","Someone else should drive the individual.","Make sure you have a list of any current medications.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:32.017517+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (525, 31, 197, 1074, 2, 19, 4312, 1, 2, '{"Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1627, Eye or Eyelid Problems","The main problem involved a sticky or watery eye discharge.","There was no new disturbance of vision.","There was no eye pain at the time of assessment.","The individual had a problem related to contact lens use.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Don''t wear contact lenses until the problem has cleared up.","Clean the eye with cotton wool and cool tap water. Use a clean piece of cotton wool for each eye.","Wipe from the inner to the outer corner of the eye.","Wash the hands after touching the eye.","Don''t share towels or facecloths.","Don''t wear contact lenses until the problem has cleared up.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:56.626358+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (526, 31, 208, 1063, 2, 19, 4022, 3, 2, '{"Pathway Selected: PFT, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1702, Ear Discharge or Ear Wax","There was no earache.","Ear wax was not the only problem.","Severe illness and a rash suggestive of septicaemia were not described.","Severe illness and inability to flex the neck, photophobia or not responding normally were not described.","There was a foreign body in the ear.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Don''t try to remove the object.","Removing an object from the ear is not usually an emergency.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:56.736951+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (527, 31, 220, 1108, 1, 18, 4052, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1260, Hand or Wrist Injury, Penetrating","The wound was not bleeding freely at the time of assessment.","The individual had no associated arm injury.","The hand had not become cold, pale or blue.","There was no bone protruding through the skin.","There was no new hand or wrist deformity.","The individual was able to get up from the floor.","There was no amputation of a finger or part of a finger.","There was no foreign body in the wound.","An assault had not occurred.","The problem was not a needlestick injury.","The wound was more than 2.5 cm long or 1.3 cm deep.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","The individual should not eat or drink anything before going to hospital (a sip of water is fine if medication needs to be taken).","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","Raise a swollen hand or wrist above the level of the heart with a sling. When in bed raise it on pillows.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","IN LIMBS: raise the injured area above the level of the heart using pillows or a sling.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-02-27 13:54:56.873317+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (528, 31, 355, 1132, 1, 18, 4022, 2, 1, '{"Pathway Selected: PMC3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1713, Nosebleeds after Injury","The individual had not experienced a seizure around the time of or since the injury.","The individual was able to stay awake.","There was no new confusion or agitation or new difficulty speaking, reading or writing.","There was no new limb weakness, coordination problems or sensory change or loss.","There was no new skull or facial deformity.","The injury was not caused by falling onto the head from something moving or hitting the head when diving.","There had not been a fall of 1 metre or more onto the head.","There was no bruising around the uninjured eye or ear.","An assault had not occurred.","There was no loss of consciousness or amnesia.","The injury only involved the nose.","The nose was continuing to bleed.","There was a nasal foreign body.","Don''t pinch the nose if the nosebleed is caused by an object stuck up the nose.","Put an ice pack (e.g. a bag of frozen peas) wrapped in a cloth on the bridge of the nose.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Don''t try to remove the object.","A responsible adult should stay with anyone who has had a head injury to watch out for any problems.","Children tend to sleep after a head injury. This is fine as long as they are woken every hour for the first 6 hours after injury to check that they are all right.","Unless advised not to, or they have already been given, paracetamol can be used to relieve pain. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use any other painkillers, they can cause complications following a head injury.","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","Sit forward and pinch all of the fleshy part of the nose for 10 minutes without releasing the pressure.","Don''t pinch the nose if the nosebleed is caused by an object stuck up the nose.","Put an ice pack (e.g. a bag of frozen peas) wrapped in a cloth on the bridge of the nose.","Once the nosebleed has stopped, don''t pick or blow the nose and avoid heavy lifting or vigorous exercise.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:57.03643+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (529, 31, 221, 1145, 2, 19, 4138, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1590, Scratches, Grazes and Minor Wounds","The individual was able to get up from the floor.","An assault had not occurred.","The problem was not a needlestick injury or animal scratch.","There was embedded dirt, gravel or grit.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Wash your hands thoroughly.","If helping someone else: try to keep their blood off your skin.","Clean the wound under running tap water. Don''t use antiseptics, as they can irritate the wound.","Gently dry the skin around the wound.","Cover the wound with a plaster or non-stick dressing or a folded clean, non-fluffy cloth.","A decision about whether tetanus immunisation is needed can be made when the injury is checked.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:57.156362+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (556, 33, 473, 1018, 115, 76, 4419, 1, 1, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW1749, Behaviour Change","Referral to Mental Health Service required.","Referral for emergency mental health intervention required.","The individual needs to attend an emergency treatment centre within 1 hour for further assessment.","Someone else should drive the individual.","Make sure you have a list of any current medications.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:32.577335+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (530, 31, 209, 1071, 1, 18, 4306, 4, 2, '{"Pathway Selected: PFI, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1332, Eye Splash Injury or Minor Foreign Body","There had been a splash or spray involving the eye(s).","The chemical involved was phenol.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Wear protective gloves if available.","If the chemical is in dry form brush it off the skin.","Before doing anything else, wash the eye under cold running water for at least 20 minutes.","Make sure that the water drains away from the face.","Remove contact lenses if worn.","Close the eye, cover it with a soft pad or dressing and fasten it gently with some tape.","Don''t rub the eye.","The container, or any label which identifies the substance, should be taken to the hospital.","OVER 12 WEEKS OLD: Unless advised not to, or they have already been given, either paracetamol OR  ibuprofen can be used to relieve pain or reduce a fever.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:54:57.289261+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (531, 32, 305, 1191, 86, 89, 4193, 3, 1, '{"Pathway Selected: PMT, Calling About Someone Else","Reason for call menu - continued to next list.","The main reason for the contact was a request for health or medication information.","The request for information was not related to a new or worsening illness.","The request was for general health information.","The information enquiry was not urgent (within 24 hours).","A telephone response was requested.","A latest call-back time not specified.","I am going to refer you to health information within 24 hours.","Caller directed to another health information service.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:55:12.297794+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (532, 32, 303, 1160, 86, 89, 4020, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1771, Skin Problems","The main problem was not a rash, itch, jaundice, skin lumps or abnormal bruising.","The main problem was not head or pubic lice, scabies, athlete''s foot or acne.","The main problem was a tattoo, birthmark or mole.","The problem related to a tattoo.","The tattoo was more than 1 week old.","There was no new itching, discomfort or bleeding.","The individual was not enquiring about removal or concealment of a skin lesion or tattoo.","There had been a previous medical assessment of the problem.","I am going to refer you to health information within 24 hours.","Caller directed to our own health information service.","DOS call","NO INSTRUCTIONS GIVEN AS CALL RELATES TO AN INDIVIDUAL WHO HAS DIED."}', '2023-02-27 13:55:12.390639+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (533, 32, 244, 1191, 44, 60, 4192, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","Reason for call menu - continued to next list.","The main reason for the contact was a request for health or medication information.","The request for information was not related to a new or worsening illness.","The information request related to a medication enquiry.","I will pass your query on to the person who is responsible for dealing with this type of call.","I am going to pass your information on to someone who will be able to provide medication advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:55:12.449369+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (534, 32, 240, 1191, 101, 87, 4315, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","A healthcare professional needing to speak to a colleague was the reason for the contact.","The call was from a doctor.","A 30 minute call-back was required.","The individual will be called back by a healthcare professional within 30 minutes.","We will pass the details to the GP Practice to call you back.","DOS call"}', '2023-02-27 13:55:12.497141+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (535, 32, 241, 1191, 102, 88, 4315, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","A healthcare professional needing to speak to a colleague was the reason for the contact.","The call was from a doctor.","A 60 minute call-back was required.","The individual will be called back by a healthcare professional within 60 minutes.","We will pass the details to the GP Practice to call you back.","DOS call"}', '2023-02-27 13:55:12.549119+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (536, 32, 242, 1191, 40, 56, 4328, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","A report of results or tests was the reason for the contact.","I will pass the information on to one of my colleagues.","We will pass the details onto the GP Practice to call you back.","DOS call"}', '2023-02-27 13:55:12.59639+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (537, 32, 37, 1191, 126, 99, 4200, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","Reason for call menu - continued to next list.","An appointment request was the main reason for contact.","The main reason for the contact was not a new or worsening illness.","The individual needs to contact their own GP practice the next working day for an appointment","No further action needed.","DOS call"}', '2023-02-27 13:55:12.637939+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (538, 33, 501, 1170, 9, 26, 4053, 1, 1, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW881, Accidental Poisoning/Inhalation","Referral to Mental Health Service required.","Speaking to a mental health service within 1 hour was considered appropriate.","The individual needs to speak to a primary care service within 1 hour.","I will arrange for a clinician to speak to the individual.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:31.530742+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (539, 33, 515, 1206, 115, 76, 4245, 1, 2, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","There was an immediate risk of suicide or violence to self or others.","Urgent referral to Mental Health Crisis Team required.","The individual needs to attend an emergency treatment centre within 1 hour for further assessment.","Someone else should drive the individual.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:55:31.589243+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (558, 33, 499, 1161, 2, 19, 4052, 3, 1, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW1725, Teething","Referral to Emergency Treatment Centre required.","Attendance at an Emergency Treatment Centre within 4 hours was considered appropriate.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","DOS call","Unless advised not to, or they have already been given, either paracetamol OR ibuprofen can be used to relieve pain or reduce a fever.","It is not always necessary to use medication to treat a fever unless the child is particularly upset or uncomfortable.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:32.697734+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (559, 33, 506, 1196, 4, 21, 4003, 1, 2, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW1748, Aura or Anticipated Fit/Seizure (Declared)","Referral to Emergency Treatment Centre not required.","Primary Care referral.","Contact Primary Care.","To contact a primary care service within 2 hours was considered appropriate.","The individual needs to contact a Primary Care Service within 2 hours.","I will arrange for a clinician to contact the individual. I need to ask some further questions in order to determine the best way to do this.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:32.759276+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (560, 33, 512, 1203, 115, 76, 4419, 1, 2, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW1751, Mental Health Problems","Referral to Mental Health Service required.","Referral for emergency mental health intervention required.","The individual needs to attend an emergency treatment centre within 1 hour for further assessment.","Someone else should drive the individual.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:55:32.817642+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (561, 33, 504, 1192, 10, 27, 4003, 1, 2, '{"Pathway Selected: PW1808, Prescription Request","Whether the main reason for the contact was new or worsening illness could not be confirmed.","Whether the request was for a repeat prescription could not be confirmed.","The next dose was due within 2 hours.","The individual needs to speak to a primary care service within 2 hours.","I will arrange for a clinician to speak to the individual.","IF THE RECOMMENDED TIMEFRAME FALLS DURING PRACTICE HOURS: Contact the practice to arrange for the individual to be spoken to within 2 hours.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:32.873531+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (562, 33, 510, 1202, 2, 19, 4052, 1, 2, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW1733, Arm, Cold or Colour Change","Referral to Emergency Treatment Centre required.","Attendance at an Emergency Treatment Centre within 4 hours was considered appropriate.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:55:32.917217+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (563, 33, 470, 1009, 9, 26, 4053, 1, 2, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW1551, Alcohol Intoxication","Referral to Mental Health Service required.","Speaking to a mental health service within 1 hour was considered appropriate.","The individual needs to speak to a primary care service within 1 hour.","I will arrange for a clinician to speak to the individual.","DOS call","A responsible adult must stay with them until they have sobered up.","Check on them at least every 15 minutes. Make sure they wake up when spoken to or when their shoulder is shaken.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:55:32.977575+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (564, 33, 471, 1009, 115, 76, 4419, 1, 2, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW1551, Alcohol Intoxication","Referral to Mental Health Service required.","Referral for emergency mental health intervention required.","The individual needs to attend an emergency treatment centre within 1 hour for further assessment.","Someone else should drive the individual.","DOS call","A responsible adult must stay with them until they have sobered up.","Check on them at least every 15 minutes. Make sure they wake up when spoken to or when their shoulder is shaken.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:33.037371+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (565, 33, 511, 1203, 1, 18, 4052, 1, 2, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW1751, Mental Health Problems","Referral to Mental Health Service not required.","Referral to Emergency Treatment Centre required.","Immediate attendance at an Emergency Treatment Centre was considered appropriate.","The individual needs to attend an emergency treatment centre within 1 hour.","Someone else should drive the individual.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:55:33.097968+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (566, 33, 520, 1213, 2, 19, 4052, 1, 2, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW1775, Hiccups","Referral to Emergency Treatment Centre required.","Attendance at an Emergency Treatment Centre within 4 hours was considered appropriate.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:55:33.154871+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (572, 33, 482, 1052, 14, 31, 4411, 1, 1, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An injury or symptom relating to an injury was the main problem.","Pathway Selected: PW620, Dental Injury","Referral to Dental Service required.","A tooth or teeth had been knocked out.","The individual had kept the tooth.","Tooth loss occurred less than 2 hours previously.","There was no known increased susceptibilty to infection.","The tooth needs to be reimplanted as soon as possible.","Do not touch the root of the tooth. Only touch the part that is usually visible.","If it is dirty, rinse gently in milk or under running water. Do not scrub or clean with disinfectant.","Push the root of the tooth gently back in the socket as far as it will easily go.","Hold the tooth in place by gently biting on a piece of clean, folded cloth.","The individual needs to contact a dental practice within 1 hour.","IF THE RECOMMENDED TIMEFRAME FALLS DURING PRACTICE HOURS: Contact the individual''s dental practice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:33.538181+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (573, 33, 496, 1159, 2, 19, 4052, 2, 1, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW1349, Other Symptoms","Referral to Mental Health Service not required.","Referral to Emergency Treatment Centre required.","Attendance at an Emergency Treatment Centre within 4 hours was considered appropriate.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:33.598115+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (574, 33, 509, 1201, 2, 19, 4052, 1, 2, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW1763, Reduced Fetal Movements","Referral to Emergency Treatment Centre required.","Attendance at an Emergency Treatment Centre within 4 hours was considered appropriate.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:55:33.657375+00', NULL);
