INSERT INTO pathwaysdos.scenarios VALUES (592, 33, 492, 1135, 2, 19, 4052, 1, 1, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW647, Passing Urine, Associated Pain, Frequency or Smell","Referral to Emergency Treatment Centre required.","Attendance at an Emergency Treatment Centre within 4 hours was considered appropriate.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:34.707885+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (593, 33, 486, 1063, 2, 19, 4052, 1, 2, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW1702, Ear Discharge or Ear Wax","Referral to Emergency Treatment Centre required.","Attendance at an Emergency Treatment Centre within 4 hours was considered appropriate.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:34.769314+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (596, 33, 487, 1069, 4, 21, 4003, 1, 1, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An injury or symptom relating to an injury was the main problem.","Pathway Selected: PW668, Eye Injury, Penetrating","Referral to Emergency Treatment Centre not required.","Primary Care referral.","Contact Primary Care.","To contact a primary care service within 2 hours was considered appropriate.","The individual needs to contact a Primary Care Service within 2 hours.","IF THE RECOMMENDED TIMEFRAME FALLS DURING PRACTICE HOURS: Contact the practice to arrange for the individual to be seen within 2 hours.","DOS call","If there is an object stuck in or near the eye don''t try to remove it.","Don''t try to look in the eye if it is swollen shut.","Close both eyes, cover them with a soft pad or dressing and fasten it gently with some tape. Don''t put any pressure on the eyeball.","Don''t rub the eye.","Cover the wound with a clean cloth folded into a pad, but don''t put any pressure on the eye.","If the blood soaks through the pad don''t take it off, put another pad on top of it.","If helping someone else: try to keep their blood off your skin.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:35.009278+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (597, 33, 493, 1136, 2, 19, 4052, 3, 1, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW646, Passing Urine, Associated Pain, Frequency or Smell","Referral to Emergency Treatment Centre required.","Attendance at an Emergency Treatment Centre within 4 hours was considered appropriate.","The individual needs to attend an emergency treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records to the hospital.","DOS call","Unless advised not to, or they have already been given, either paracetamol OR ibuprofen can be used to relieve pain or reduce a fever.","It is not always necessary to use medication to treat a fever unless the child is particularly upset or uncomfortable.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:35.077937+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (598, 33, 530, 1226, 112, 84, 4047, 1, 2, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","An illness or other health problem was the main problem.","Pathway Selected: PW1610, Dental Problems","Referral to Dental Service required.","Speak to a dental service within 2 hours was considered appropriate.","The individual needs to speak to dental practice within 2 hours.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:55:35.138035+00', NULL);
