INSERT INTO pathwaysdos.scenarios VALUES (600, 33, 518, 1206, 122, 95, 4323, 1, 2, '{"Pathway Selected: PW1812, Senior Clinician Module Entry","Ambulance response not required.","Community nurse required.","The information enquiry was not urgent (within 24 hours).","I will pass the information on to the community nurse.","I will pass your information on to them.","DOS call"}', '2023-02-27 13:55:35.237896+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (601, 34, 154, 1186, 115, 76, 4245, 1, 1, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1749, Behaviour Change","A known mental health problem had worsened.","The individual had not attacked, threatened or intended to harm anyone.","The individual was having suicidal thoughts.","The individual had not made a plan for a suicide attempt.","DOS call","The individual needs to be referred to a mental health/crisis service within 4 hours.","Someone else should drive the individual.","Make sure you have a list of any current medications.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:56.178778+00', NULL);
