INSERT INTO pathwaysdos.scenarios VALUES (605, 34, 158, 1186, 115, 76, 4205, 1, 1, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","New confusion was the main reason for the contact.","The skin on the torso felt normal, warm or hot.","There was no previous history of diabetes.","Pathway Selected: PW1749, Behaviour Change","A known mental health problem had worsened.","The individual had not attacked, threatened or intended to harm anyone.","The individual denied suicidal thoughts.","The individual had not considered harming themselves or anyone else.","The individual had not been told to follow a particular care plan when this happens.","The problem was so bad that normal life was impossible.","There was a previous diagnosis of schizophrenia.","DOS call","The individual needs to be referred to a mental health/crisis service within 4 hours.","Someone else should drive the individual.","Make sure you have a list of any current medications.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:56.495354+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (606, 34, 159, 1186, 115, 76, 4208, 1, 1, '{"An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 2 hours.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","New confusion was the main reason for the contact.","The skin on the torso felt normal, warm or hot.","There was no previous history of diabetes.","Pathway Selected: PW1749, Behaviour Change","A known mental health problem had worsened.","The individual had not attacked, threatened or intended to harm anyone.","The individual denied suicidal thoughts.","The individual had not considered harming themselves or anyone else.","The individual had not been told to follow a particular care plan when this happens.","The problem was so bad that normal life was impossible.","There was a previous diagnosis of mania/hypomania.","DOS call","The individual needs to be referred to a mental health/crisis service within 4 hours.","Someone else should drive the individual.","Make sure you have a list of any current medications.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:55:56.613614+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (607, 35, 371, 1201, 26, 42, 4112, 1, 2, '{"Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1763, Reduced Fetal Movements","The individual had been pregnant for 20 weeks or more.","Severe illness and a rash suggestive of septicaemia were not described.","There was no severe, constant abdominal pain.","Severe illness and inability to flex the neck or photophobia were not described.","The individual was not in labour.","There was no significant vaginal bleeding.","A sexual assault had not occurred.","The individual needs to Speak to Midwife or Labour Suite immediately.","You need to contact your midwife or labour suite immediately","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:56:31.938819+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (628, 37, 229, 1155, 39, 55, 4054, 2, 2, '{"Pathway Selected: PFC1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","A social or domestic emergency was the main problem.","There was no immediate risk of violence.","An assault had not occurred.","The individual denied suicidal thoughts.","There was no child or vulnerable adult at risk.","There was no risk of self-harm.","The individual had not been hearing voices, seeing things or behaving abnormally.","The problem was not related to care provision.","The problem related to drug, solvent or alcohol misuse.","The individual had no ongoing professional help arranged.","The individual had not considered harming themselves or anyone else.","No one else was considered to be vulnerable and at risk","The individual MUST contact their own GP Practice within 3 working days.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Most GP surgeries and specialist teams won''t see the individual if they are under the influence of drugs or alcohol when they come for their appointment."}', '2023-02-27 13:57:07.959248+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (608, 35, 314, 1081, 22, 38, 4112, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW700, Falls, Faints or Blackouts without Injury","There had been no crushing chest, upper back or abdominal pain, or chest pain radiating to the arm, neck or jaw in the previous 24 hours.","There had been no episodes of inability to raise both arms, speech difficulty or unilateral facial weakness.","There had been no episode of unilateral leg weakness.","There was no severe headache of sudden onset.","The individual had not  fallen.","The faint/blackout had happened in the previous 24 hours.","There had not been more than one faint or blackout in the last 24 hours.","The faint or blackout did not occur during exercise.","The individual had not been seen by a doctor for episodes of fainting or loss of consciousness in the past.","The individual had not also banged their head.","There was no abdominal pain just before the faint or blackout.","Pregnancy or possible pregnancy was reported.","The individual had been pregnant for 20 weeks or more.","There was no new or worsening confusion.","The individual was able to get up from the floor.","There was no feeling of palpitations at the time of the faint or blackout.","There was no use of street drugs or solvents before the faint or blackout.","There was no severe headache or sudden increase in swelling/fluid retention.","There was no vomiting.","There was no dizziness present at the time of assessment.","There was no fever at the time of assessment or within the previous 12 hours.","The individual needs to speak to a midwife within 1 hour.","You need to contact the individual''s midwife within 1 hour.","DOS call","After a faint people usually recover fairly quickly."}', '2023-02-27 13:56:32.095562+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (609, 35, 250, 1113, 22, 38, 4112, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW752, Headache","Pregnancy or possible pregnancy was reported.","There had been no head injury in the previous 7 days.","The individual had been pregnant for 20 weeks or more.","There was no fainting or loss of consciousness in the previous 24 hours.","Severe illness and a rash suggestive of septicaemia were not described.","There had been no episodes of inability to raise both arms, speech difficulty or unilateral facial weakness.","There had been no episode of unilateral leg weakness.","Severe illness and inability to flex the neck or photophobia were not described.","There was no severe headache of sudden onset.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","There had been no travel within the last 4 weeks from a country affected by the current Ebola outbreak.","Exposure to Ebola virus disease in the last 4 weeks was not declared.","There was no new severe swelling/fluid retention.","There was no new loss or disturbance of vision.","There was no new or worsening confusion.","There was no fever at the time of assessment or within the previous 12 hours.","The individual needs to speak to a midwife within 1 hour.","You need to contact the individual''s midwife within 1 hour.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:56:32.218061+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (610, 35, 335, 1112, 22, 38, 4112, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW752, Headache","There was no possibility of pregnancy.","Childbirth had occurred within the previous 7 days.","There had been no head injury in the previous 7 days.","There was no fainting or loss of consciousness in the previous 24 hours.","Severe illness and a rash suggestive of septicaemia were not described.","There had been no episodes of inability to raise both arms, speech difficulty or unilateral facial weakness.","There had been no episode of unilateral leg weakness.","Severe illness and inability to flex the neck or photophobia were not described.","There was no severe headache of sudden onset.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","There had been no travel within the last 4 weeks from a country affected by the current Ebola outbreak.","Exposure to Ebola virus disease in the last 4 weeks was not declared.","There was no new severe swelling/fluid retention.","There was no new loss or disturbance of vision.","There was no new or worsening confusion.","The individual needs to speak to a midwife within 1 hour.","You need to contact the individual''s midwife within 1 hour.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Put a heat pad or covered hot water bottle on the back of the neck, this may help ease the pain.","Becoming very drowsy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:56:32.374352+00', NULL);
