INSERT INTO pathwaysdos.scenarios VALUES (646, 37, 168, 1135, 39, 55, 4003, 1, 2, '{"Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW644, Passing Urine, Associated Pain, Frequency or Smell","There was no stinging sensation when passing urine.","There was no spinal pain.","There was no fever at the time of assessment or within the previous 12 hours.","There was no flank pain.","There was no extreme thirst or increased urine output during the previous month.","There was no possibility of pregnancy.","There was genital ulceration/blistering.","There was no worsening pain or swelling.","There was no blood in the urine.","The individual had not clinically deteriorated nor felt particularly unwell in the previous 24 hours.","There had been no recent sexual contact with a person known to have a sexually transmitted infection.","The individual MUST contact their own GP Practice within 3 working days.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:10.119507+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (647, 37, 157, 1186, 39, 55, 4003, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1749, Behaviour Change","The mood or behaviour change was part of a previously diagnosed mental health problem.","The individual had not attacked, threatened or intended to harm anyone.","The individual denied suicidal thoughts.","The individual had not considered harming themselves or anyone else.","The individual had not been told to follow a particular care plan when this happens.","The problem was not so severe that normal life was impossible.","Whether the problem had worsened over the last week or month could not be confirmed.","There was no previous diagnosis of schizophrenia, bipolar disorder, depression or mania/hypomania.","There had not been a previous diagnosis of a mental health problem.","The individual had not considered harming themselves or anyone else.","No one else was considered to be vulnerable and at risk","The individual MUST contact their own GP Practice within 3 working days.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:10.254728+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (648, 38, 13, 1002, 9, 26, 4003, 4, 2, '{"Pathway Selected: PFI, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1383, Abdominal or Flank Injury, Penetrating","There was no new/worsening breathlessness since the injury.","There was no unusual quietness or weakness/coordination problems following the injury.","The wound was not bleeding freely at the time of assessment.","There was no foreign body in the wound.","The pain was not severe.","There was no new vaginal bleeding.","There had been no vomiting of red or altered (coffee grounds) blood.","There had been no black and tarry or red/maroon bowel motions.","An assault had not occurred.","The problem was not a needlestick injury.","The injury was not a complex wound.","There had been no blood in the urine since the injury.","There was no worsening swelling.","The individual needs to speak to a primary care service within 1 hour.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","OVER 12 WEEKS OLD: Unless advised not to, or they have already been given, either paracetamol OR  ibuprofen can be used to relieve pain or reduce a fever.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-02-27 13:57:27.091031+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (649, 38, 10, 1000, 9, 26, 4003, 4, 1, '{"Pathway Selected: PMI, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1382, Abdominal or Flank Injury, Blunt","There was no new/worsening breathlessness since the injury.","There was no unusual quietness or weakness/coordination problems following the injury.","The pain was not severe.","There had been no vomiting of red or altered (coffee grounds) blood.","There had been no black and tarry or red/maroon bowel motions.","An assault had not occurred.","There had been no blood in the urine since the injury.","There was no worsening swelling.","The individual needs to speak to a primary care service within 1 hour.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","OVER 12 WEEKS OLD: Unless advised not to, or they have already been given, either paracetamol OR  ibuprofen can be used to relieve pain or reduce a fever.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","Remove any jewellery or tight clothing from around the swelling.","IN LIMBS: if possible raise the area above the level of the heart and support it.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:27.209505+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (663, 38, 200, 1171, 5, 22, 4125, 2, 1, '{"Pathway Selected: PMC1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the contact was not chest/upper back pain, recent fit/seizure, suicide attempt, new confusion or suspected stroke.","The main reason for contact was not declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1709, Wound Problems, Plaster Casts, Tubes and Metal Appliances","The problem involved a tube or drain.","The type of tube or drain could not be confirmed.","The tube had come out or come apart.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:28.889374+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (681, 38, 116, 1173, 5, 22, 4070, 3, 1, '{"Pathway Selected: PMT, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1568, Catheter Problems","The individual had a blocked catheter.","There was no apparent worsening pain.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:31.193431+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (650, 38, 165, 1126, 5, 22, 4003, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW785, Lower Back Pain","The pain did not interfere with normal activity .","Severe illness and a rash suggestive of septicaemia were not described.","Neither pain nor swelling was present since symptom onset","There was no new loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There was no abdominal pain.","The pain did not begin suddenly during physical activity.","There was no testicular/scrotal pain.","There was no fever at the time of assessment or within the previous 12 hours.","There was no new shoulder tip pain.","There was no new or worsening confusion.","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","The pain was severe.","The pain was constant.","The individual had not clinically deteriorated nor felt particularly unwell in the previous 24 hours.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Don''t cut down on fluids. It is important to drink at least as much as usual.","If you need to be seen by a GP practice or OOH service collect a urine specimen in a clean jar in case it needs to be tested.","Paracetamol and ibuprofen are both used to relieve pain and reduce high temperature and fever.","Unless advised not to, or it has already been given, paracetamol is best for relieving back pain. Take it regularly, not just when the pain is bad.","However, ibuprofen can be used instead of paracetamol. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:27.346841+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (651, 38, 164, 1126, 4, 21, 4003, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW785, Lower Back Pain","The pain did not interfere with normal activity .","Severe illness and a rash suggestive of septicaemia were not described.","Neither pain nor swelling was present since symptom onset","There was no new loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There was no abdominal pain.","The pain began suddenly during physical activity.","The individual was using anticoagulant medication.","The individual needs to contact a Primary Care Service within 2 hours.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Paracetamol and ibuprofen are both used to relieve pain and reduce high temperature and fever.","Unless advised not to, or it has already been given, paracetamol is best for relieving back pain. Take it regularly, not just when the pain is bad.","However, ibuprofen can be used instead of paracetamol. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:27.446804+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (652, 38, 5, 1000, 5, 22, 4003, 3, 2, '{"Pathway Selected: PFT, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW502, Abdominal or Flank Injury, Blunt","There was no new/worsening breathlessness since the injury.","There was no new quietness or limb weakness/coordination problems.","The pain was not severe.","There was no new vaginal bleeding.","There had been no vomiting of red or altered (coffee grounds) blood.","There had been no black and tarry or red/maroon bowel motions.","An assault had not occurred.","There had been no blood in the urine since the injury.","There was no worsening pain or swelling.","The injury was less than 24 hours old.","The individual had been hit by a heavy or fast-moving object.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, either paracetamol OR ibuprofen can be used to relieve pain or reduce a fever.","It is not always necessary to use medication to treat a fever unless the child is particularly upset or uncomfortable.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t leave ice on while asleep. Don''t put ice directly on the skin.","Raise a swollen ankle or knee by sitting with the foot on a stool, or lying with it propped on pillows.","Raise a swollen hand or wrist above the level of the heart with a sling. When in bed raise it on pillows."}', '2023-02-27 13:57:27.57494+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (653, 38, 1, 1004, 4, 21, 4003, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW516, Abdominal Pain","There was no vomiting, diarrhoea, rectal bleeding, groin pain or groin swelling.","There was no vaginal bleeding, discharge or swelling.","The pain did not interfere with normal activity .","There was no crushing or severe aching chest, upper back or upper abdominal pain, or pain radiating to the arm, neck, jaw or shoulder.","Severe illness and a rash suggestive of septicaemia were not described.","There was no possibility of pregnancy.","Childbirth had not occurred within the previous 6 weeks.","There had been no black and tarry or red/maroon bowel motions.","The individual had not ingested a harmful or toxic substance.","The individual had not felt faint or passed out because of the pain.","There was one-sided lower abdominal pain.","The individual needs to contact a Primary Care Service within 2 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Try putting a heat pad or covered hot water bottle on the painful area.","Unless advised not to, or it has already been given, paracetamol may be used to relieve abdominal pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use ibuprofen or any other anti-inflammatory medication such as aspirin, as they can irritate the stomach.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:27.715638+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (814, 41, 330, 1204, 23, 39, 4031, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","A possible contraceptive failure was the reason for the contact.","A sexual assault had not occurred.","Contraception had been used.","Oral contraception appeared to have failed.","Intercourse took place more than 5 days previously.","There had been recent sexual contact with a person known to have a sexually transmitted infection.","The individual needs to contact a genito-urinary medicine clinic or other local service.","I can provide information about the nearest Genito-Urinary Medicine clinic.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:58:33.578092+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (654, 38, 29, 1187, 5, 22, 4003, 1, 2, '{"Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","Declared diabetic hypo or hyperglycaemia was the main reason for the assessment.","Whether the concern was blood sugar that was too high or too low could not be confirmed.","The blood sugar level had not been measured.","The individual was unwilling and/or unable to measure the blood sugar.","The skin on the torso felt normal, warm or hot.","Severe illness and a rash suggestive of septicaemia were not described.","There was no diagnosis of insulin dependent diabetes.","The individual had clinically deteriorated or felt particularly unwell in the previous 24 hours.","There was no new or worsening confusion.","Blood sugar control had not been adversely affected by the vomiting.","The individual needs to contact a primary care service within 6 hours.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:57:27.81754+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (655, 38, 148, 1055, 5, 22, 4155, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1555, Diarrhoea and Vomiting","There had been no vomiting of red or altered (coffee grounds) blood.","There was no abdominal pain.","Severe illness and a rash suggestive of septicaemia were not described.","Severe illness and inability to flex the neck or photophobia were not described.","There had been no black and tarry or red/maroon bowel motions.","The individual had not ingested a harmful or toxic substance.","There had been no travel within the last 4 weeks from a country affected by the current Ebola outbreak.","Exposure to Ebola virus disease in the last 4 weeks was not declared.","There was no new or worsening confusion.","There was no previous history of diabetes.","Vomiting or watery diarrhoea occurring more than once an hour for over 12 hours had not been experienced.","There was no extreme thirst or increased urine output during the previous month.","There was a fever at the time of assessment or within the previous 12 hours.","There was blood in the bowel motions.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Some anti-diarrhoea medicines can ease diarrhoea and speed recovery. They can be bought from pharmacies. Follow the instructions in the pack.","Drink frequent, small amounts of water. Also have some fruit juice or thin soups.","Rehydration drinks can be bought from pharmacies. Follow the instructions in the pack.","Diarrhoea and vomiting can be caused by gastro-enteritis (a tummy bug). Good hygiene will help to prevent spreading it to others.","Wash hands after using the toilet or dealing with the vomit. Don''t share towels with others.","Stay off work until the symptoms have gone. Food handlers and health workers should check with their employer before returning to work.","Becoming very drowsy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","It is important to have plenty of fluids, little and often is best.","Only wear light clothing. Don''t wrap up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Becoming very drowsy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:27.972734+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (656, 38, 388, 1187, 4, 21, 4399, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","Declared diabetic hypo or hyperglycaemia was the main reason for the contact.","The concern was that the blood sugar was too low.","The blood sugar level had been measured.","The testing machine reported in units of millimoles per litre.","The blood sugar level was less than 4mmol/L.","A high-sugar drink was available.","EITHER: have a sweet drink (e.g. cola). Don''t use diet drinks.","OR: have a dessert spoon of sugar, jam, honey syrup or treacle.","The sugar starts to work within a few minutes, complete recovery may take up to half an hour.","Sugary drink, food or glucose gel had been administered.","Administration of the medication produced an improvement in the individual''s condition.","The individual had not clinically deteriorated nor felt particularly unwell in the previous 24 hours.","There were similar episodes that week.","There was a diagnosis of insulin dependent diabetes.","Insulin was delivered via an insulin pump.","The individual needs to contact a Primary Care Service within 2 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Eat something now. If a meal is not due have a sandwich, some biscuits, a bowl of cereal or some fruit.","Carry on with insulin or other diabetic medication as normal. Don''t stop or reduce the dose unless told to by a doctor.","Test blood sugar at least 4 times a day.","If not able to manage full meals have smaller, frequent starchy snacks such as biscuits or cereals, or drinks such as milk and cola. Don''t have diet drinks.","The individual should always have something sugary with them to have if a hypo is coming on.","Collapse or unconsciousness - DIAL 999. If they are unconscious don''t put food or drink in their mouth as they could choke.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:28.098565+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (657, 38, 28, 1187, 4, 21, 4003, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","Declared diabetic hypo or hyperglycaemia was the main reason for the contact.","The concern was that the blood sugar was too high.","The skin on the torso felt normal, warm or hot.","Severe illness and a rash suggestive of septicaemia were not described.","The blood sugar level had been measured.","The testing machine reported in units of millimoles per litre.","The blood sugar level was between 9.1 and 27.9mmol/L.","There was a diagnosis of insulin dependent diabetes.","The urine had been tested for ketones.","There was 3+ ketonuria.","There was no new or worsening confusion.","There was no abdominal pain.","The individual did not have a deep, sighing pattern of breathing.","The individual had not clinically deteriorated nor felt particularly unwell in the previous 24 hours.","The individual needs to contact a Primary Care Service within 2 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","DOS call","Carry on with insulin or other diabetic medication as normal. Don''t stop or reduce the dose unless told to by a doctor or diabetes specialist nurse."}', '2023-02-27 13:57:28.233558+00', NULL);
