INSERT INTO pathwaysdos.scenarios VALUES (664, 38, 111, 1035, 4, 21, 4003, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW556, Breathing Problems, Breathlessness or Wheeze","There was no rapid swelling of the lips, face, throat or tongue.","There was no chest or upper back pain at the time of the assessment.","There had been no chest or upper back pain in the previous 24 hours.","Severe illness and a rash suggestive of septicaemia were not described.","Severe illness and inability to flex the neck or photophobia were not described.","There had been no episode of choking within the previous 24 hours.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","Pregnancy or possible pregnancy was reported.","The individual had been pregnant for 20 weeks or more.","The individual had not coughed up blood.","There was no new or worsening breathlessness at rest.","There had been no travel to the Middle East or South Korea in the past 2 weeks.","The breathing had stayed the same in the previous hour.","The individual was not experiencing palpitations.","There was no new or worsening confusion.","There was a history of previous thrombosis.","The individual needs to contact a Primary Care Service within 2 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Sit as upright as is comfortable.","If an inhaler or spacer is used for chest problems, use it according to instructions on what to do if breathing gets worse.","Never use any medication that has been prescribed for someone else.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:29.028144+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (665, 38, 139, 1059, 5, 22, 4003, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW639, Dizziness or Vertigo","Severe illness and a rash suggestive of septicaemia were not described.","There were no palpitations with the onset of dizziness.","There had been no crushing chest, upper back or abdominal pain, or chest pain radiating to the arm, neck or jaw in the previous 24 hours.","There had been no head injury in the previous 7 days.","There had been no episodes of inability to raise both arms, speech difficulty or unilateral facial weakness.","There had been no episode of unilateral leg weakness.","Severe illness and inability to flex the neck or photophobia were not described.","There had been no vomiting of red or altered (coffee grounds) blood.","There had been no black and tarry or red/maroon bowel motions.","There was no severe headache of sudden onset.","There was no heat exposure or overexertion prior to symptom onset.","There was no gradually worsening breathlessness in the previous few hours.","The individual did not have an implanted defibrillator or pacemaker.","There was no drug or solvent misuse prior to the onset of dizziness.","There was no new or worsening confusion.","There was no fainting or loss of consciousness in the previous 24 hours.","There was no feeling of vertigo.","There was no vomiting.","The individual had undergone ear surgery in the previous 2 weeks.","There was a fever at the time of assessment or within the previous 12 hours.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Sleep with two or more pillows. Sit on the edge of the bed for a minute before standing.","Avoid alcohol, it can make dizziness worse.","Avoid heights and don''t drive or operate machinery unless advised by a doctor that it is safe to do so.","It is important to have plenty of fluids, little and often is best.","Only wear light clothing. Don''t wrap up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Becoming very drowsy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:29.177465+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (666, 38, 306, 1043, 7, 79, 4003, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1042, Cold or Flu (Declared)","Severe illness and a rash suggestive of septicaemia were not described.","Severe illness and inability to flex the neck or photophobia were not described.","There had been no travel within the last 4 weeks from a country affected by the current Ebola outbreak.","Exposure to Ebola virus disease in the last 4 weeks was not declared.","There had been no travel to the Middle East or South Korea in the past 2 weeks.","The individual had not started to feel breathless or wheezy","There was no new or worsening confusion.","There was a fever at the time of assessment or within the previous 12 hours.","Facial pain, cough, nasal congestion, headaches or muscle aches and pains were not the main problem.","There had been no foreign travel in the previous 4 weeks or possible exposure to malaria in the previous 12 months","There was no previous history of diabetes.","The individual had a fever that had re-emerged after 3 days.","Repeat Caller: The individual needs to speak to the GP practice within 1 hour. If the practice is not open within this period they need to speak to the out of hours service.","Because you have called several times, I am going to arrange for a clinician to call you back.","DOS call","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:29.297726+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (667, 38, 138, 1057, 4, 21, 4003, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW886, Difficulty Passing Urine","There was no new loss of bowel control or leg movement and no saddle or lower limb paraesthesia.","There was spinal pain.","The individual needs to contact a Primary Care Service within 2 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:29.377661+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (668, 38, 104, 1025, 9, 26, 4003, 3, 1, '{"Pathway Selected: PMT, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW967, Blood in Urine","Severe illness and a rash suggestive of septicaemia were not described.","There was no fever at the time of assessment or within the previous 12 hours.","The individual did not appear to be confused.","The urine contained clots of blood.","The individual needs to speak to a primary care service within 1 hour.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Don''t cut down on fluids. It is important to drink at least as much as usual.","If you need to be seen by a GP practice or OOH service collect a urine specimen in a clean jar in case it needs to be tested.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:29.489496+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2120, 1059, 1047, 1192, 11, 28, 4803, 1, 1, '{"Reason for call menu - continued to next list.","A prescription request was the main reason for the contact.","The main reason for the contact was not a new or worsening illness.","The patient did not have enough medication to last until the surgery next opened.","The request was not for a repeat prescription.","A prescription for a controlled or restricted medicine was requested.","The next dose was due within 6 hours.","DOS call","The individual needs to speak to a local service within 6 hours.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2025-04-28 17:12:23.914175+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (669, 38, 71, 1110, 11, 28, 4003, 4, 2, '{"Pathway Selected: PFI, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1401, Head, Facial or Neck Injury, Blunt","There was no new/worsening breathlessness since the injury.","The individual had not experienced a seizure around the time of or since the injury.","There was no fluid leak or bleeding from the ear or nose.","There was no new skull deformity, bruise, swelling or wound more than 5cm across.","There was no bruising around the uninjured eye or ear.","There had not been a fall directly onto the head.","An assault had not occurred.","There was no loss of consciousness at the time of the injury.","There was no vomiting following the injury.","The child had been behaving normally since the injury.","There was no previous history of brain surgery.","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","There was no injury/damage within the mouth.","There was no worsening swelling.","The individual needs to speak to a primary care service within 6 hours.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Make sure that they are with a responsible adult for 48 hours after having the head injury so that they can watch out for any problems.","Babies tend to sleep after a head injury. This is fine as long as they are woken every hour for the first 6 hours after the injury.","OVER 12 WEEKS OLD: Unless advised not to, or they have already been given, paracetamol can be used to relieve pain.","Don''t use any other painkillers, they can cause complications following a head injury.","Remove any jewellery or tight clothing from around the swelling.","If the baby cannot be woken or has a fit - DIAL 999.","Any vomiting, behaviour changes, if they become irritable or have no interest in things around them - GO STRAIGHT TO THE NEAREST EMERGENCY DEPARTMENT.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:57:29.626788+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (670, 38, 73, 1181, 5, 22, 4114, 4, 1, '{"Pathway Selected: PMI, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1710, Wound Problems, Plaster Casts, Tubes and Metal Appliances","The problem involved a wound or dressing.","The wound was to the abdomen.","There was no complete wound dehiscence.","The wound was not bleeding freely.","There had been no continuous crying lasting over an hour.","There was no fever at the time of assessment or within the previous 12 hours.","Redressing was required.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Use a dry dressing or a clean cloth folded into a pad and press gently but firmly on the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","IN LIMBS: raise the area above the level of the heart and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","If you have been given dressings, take them with you when you go to get the wound redressed.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:29.75135+00', NULL);
