 for chest problems, use it according to instructions on what to do if breathing gets worse.","Never use any medication that has been prescribed for someone else.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:29.878052+00', NULL);
