INSERT INTO pathwaysdos.scenarios VALUES (674, 38, 107, 1034, 5, 22, 4003, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW556, Breathing Problems, Breathlessness or Wheeze","There was no rapid swelling of the lips, face, throat or tongue.","There was no chest or upper back pain at the time of the assessment.","There had been no chest or upper back pain in the previous 24 hours.","Severe illness and a rash suggestive of septicaemia were not described.","Severe illness and inability to flex the neck or photophobia were not described.","There had been no episode of choking within the previous 24 hours.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","There was no possibility of pregnancy.","The individual had not coughed up blood.","There was no new or worsening breathlessness at rest.","There had been no travel to the Middle East or South Korea in the past 2 weeks.","The breathing had stayed the same in the previous hour.","The individual was not experiencing palpitations.","There was no history of previous thrombosis.","There was no known increased risk of thrombosis.","There was no previous history of pneumothorax.","The individual had not experienced prolonged immobility in the previous 2 weeks.","The individual had not experienced an injury or surgery in the previous 12 weeks.","The individual had not been pregnant or given birth within the previous 6 weeks.","There was no history of cancer treatment in the last year or hormone replacement therapy, oral contraceptives or regular steroid use.","There was no new or worsening confusion.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Sit as upright as is comfortable.","If an inhaler or spacer is used for chest problems, use it according to instructions on what to do if breathing gets worse.","Never use any medication that has been prescribed for someone else.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:30.309527+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (675, 38, 72, 1110, 4, 21, 4003, 4, 2, '{"Pathway Selected: PFI, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1401, Head, Facial or Neck Injury, Blunt","There was no new/worsening breathlessness since the injury.","The individual had not experienced a seizure around the time of or since the injury.","There was no fluid leak or bleeding from the ear or nose.","There was no new skull deformity, bruise, swelling or wound more than 5cm across.","There was no bruising around the uninjured eye or ear.","There had not been a fall directly onto the head.","An assault had not occurred.","There was no loss of consciousness at the time of the injury.","There was no vomiting following the injury.","The child had been behaving normally since the injury.","There was no previous history of brain surgery.","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","There was no injury/damage within the mouth.","There was no worsening swelling.","The individual needs to contact a Primary Care Service within 2 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Make sure that they are with a responsible adult for 48 hours after having the head injury so that they can watch out for any problems.","Babies tend to sleep after a head injury. This is fine as long as they are woken every hour for the first 6 hours after the injury.","UNDER 12 WEEKS OLD: A baby under 12 weeks should not be given any medicine unless it has been prescribed or advised by a doctor, nurse, health visitor or pharmacist.","Don''t use any other painkillers, they can cause complications following a head injury.","Remove any jewellery or tight clothing from around the swelling.","If the baby cannot be woken or has a fit - DIAL 999.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:57:30.446839+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (676, 38, 66, 1181, 5, 22, 4003, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1709, Wound Problems, Plaster Casts, Tubes and Metal Appliances","The problem involved a wound or dressing.","The pain was severe.","The wound was to an arm.","The arm had not suddenly become cold, pale or blue.","There was no complete wound dehiscence.","The wound was not bleeding freely.","The individual needs to contact a primary care service within 6 hours.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Use a dry dressing or a clean cloth folded into a pad and press gently but firmly on the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","IN LIMBS: raise the area above the level of the heart and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","If you have been given dressings, take them with you when you go to get the wound redressed.","If you have a care plan take that too.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:30.569546+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (677, 38, 89, 1018, 5, 22, 4185, 2, 2, '{"Pathway Selected: PFC1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the contact was not chest/upper back pain, recent fit/seizure, suicide attempt, new confusion or suspected stroke.","The main reason for contact was not declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1749, Behaviour Change","The mood or behaviour change was not part of a previously diagnosed mental health problem.","The individual had not attacked, threatened or intended to harm anyone.","There was no ingestion/inhalation of something harmful in the last 72 hours.","The duration of the problem was less than 2 weeks.","Severe illness and a rash suggestive of septicaemia were not described.","There had been no episodes of inability to raise both arms, speech difficulty or unilateral facial weakness.","There was no fainting or loss of consciousness in the previous 24 hours.","Severe illness and inability to flex the neck, photophobia or not responding normally were not described.","There had been no exposure to extremes of temperature in the previous 24 hours.","There had been no head injury in the previous 7 days.","The individual was able to stay awake.","The individual denied suicidal thoughts.","The individual did not use insulin or other medication for diabetes.","There was no new or worsening confusion.","The individual had been hearing voices or seeing things.","There had been no previous medical assessment of the problem.","The individual had not considered harming themselves or anyone else.","No one else was considered to be vulnerable and at risk","The individual needs to contact a primary care service within 6 hours.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:30.716358+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (678, 38, 76, 1181, 9, 26, 4003, 4, 1, '{"Pathway Selected: PMI, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1710, Wound Problems, Plaster Casts, Tubes and Metal Appliances","The problem involved a wound or dressing.","The wound was not to the abdomen or a limb.","There was no complete wound dehiscence.","The wound was not bleeding freely.","There had been continuous crying for over an hour.","The individual needs to speak to a primary care service within 1 hour.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Use a dry dressing or a clean cloth folded into a pad and press gently but firmly on the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","IN LIMBS: raise the area above the level of the heart and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","If you have been given dressings, take them with you when you go to get the wound redressed.","If you have a care plan take that too.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:30.836364+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (679, 38, 117, 1173, 5, 22, 4073, 3, 1, '{"Pathway Selected: PMT, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1568, Catheter Problems","There had not been a failed attempt to pass a urinary catheter, traumatic removal or catheter blockage/bypass.","There was no apparent worsening pain.","There was a fever at the time of assessment or within the previous 12 hours.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","It is important to have plenty of fluids, little and often is best.","Dress them in light clothes e.g. a T-shirt and shorts or a nappy. Don''t wrap them up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Becoming limp, floppy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","Unless advised not to, or they have already been given, either paracetamol OR ibuprofen can be used to relieve pain or reduce a fever.","It is not always necessary to use medication to treat a fever unless the child is particularly upset or uncomfortable.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:30.956317+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (680, 38, 300, 1117, 5, 22, 4156, 1, 1, '{"Pathway Selected: PMA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW777, Lower Limb Pain or Swelling","The problem affected the lower leg only.","The problem affected the knee or lower leg.","The problem did not relate to a previously diagnosed leg ulcer.","There was no swelling in the groin.","There was no pain in the groin.","There was no new loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There was no sudden onset of pain and swelling of an entire leg.","A leg had not suddenly become cold, pale or blue.","The individual had not suddenly become breathless.","There was no sharp/stabbing pain in the chest/upper back on coughing or deep breathing.","The individual had not coughed up blood.","The problem only involved one leg.","The individual was able to weight-bear.","There was no constriction of the limb by an object that could not be removed.","A knee had not suddenly become locked.","There was no heel pain when standing on the toes.","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","There was no fever at the time of assessment or within the previous 12 hours.","There was no very severe, deep pain.","The leg was more swollen than the other side.","There was a history of previous thrombosis.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Remove any jewellery or tight clothing from around the swelling.","Raise a swollen ankle or knee by sitting with the foot on a stool, or lying with it propped on pillows.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:31.097663+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (682, 38, 102, 1025, 5, 22, 4003, 3, 2, '{"Pathway Selected: PFT, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW967, Blood in Urine","Severe illness and a rash suggestive of septicaemia were not described.","There was no fever at the time of assessment or within the previous 12 hours.","The individual did not appear to be confused.","The individual had not passed blood clots in the urine or urine the colour of cola.","There was no new spontaneous bruising or abnormal bleeding within the last 2 weeks.","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","There appeared to be flank or abdominal pain.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Don''t cut down on fluids. It is important to drink at least as much as usual.","If you need to be seen by a GP practice or OOH service collect a urine specimen in a clean jar in case it needs to be tested.","Unless advised not to, or they have already been given, either paracetamol OR ibuprofen can be used to relieve pain or reduce a fever.","It is not always necessary to use medication to treat a fever unless the child is particularly upset or uncomfortable.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:31.313812+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (683, 38, 63, 1043, 5, 22, 4003, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1042, Cold or Flu (Declared)","Severe illness and a rash suggestive of septicaemia were not described.","Severe illness and inability to flex the neck or photophobia were not described.","There had been no travel within the last 4 weeks from a country affected by the current Ebola outbreak.","Exposure to Ebola virus disease in the last 4 weeks was not declared.","There had been no travel to the Middle East or South Korea in the past 2 weeks.","The individual had not started to feel breathless or wheezy","There was no new or worsening confusion.","There was no fever at the time of assessment or within the previous 12 hours.","Pain in the face was the worst symptom associated with the problem.","The problem did not involve the area around an eye.","There was new blistering of the painful area.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Rest until you start to feel better. Make sure someone checks on you regularly.","Drink plenty of fluids. If vomiting is a problem have small sips every few minutes.","Always cover the mouth with a tissue when coughing or sneezing. Put used tissues into a bin immediately and wash the hands.","Washing hands and cleaning household surfaces regularly reduces the spread of infection.","Becoming very drowsy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Both antihistamine and decongestant drops or sprays may relieve congestion. They can be bought from pharmacies. Talk to the pharmacist for advice. Follow the instructions in the pack.","Avoid exposure to tobacco smoke.","It is important to have plenty of fluids, little and often is best.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:31.457979+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (684, 38, 128, 1054, 5, 22, 4003, 3, 2, '{"Pathway Selected: PFT, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW630, Diarrhoea","There was no vomiting.","Severe illness and a rash suggestive of septicaemia were not described.","Severe illness and inability to flex the neck, photophobia or not responding normally were not described.","The individual had no redcurrant jelly stools, tarry, black stools or red bowel motions.","There was no apparent abdominal pain.","The individual had not ingested a harmful or toxic substance.","There had been no travel within the last 4 weeks from a country affected by the current Ebola outbreak.","Exposure to Ebola virus disease in the last 4 weeks was not declared.","There had been no continuous crying lasting over an hour.","The individual did not appear to be confused.","There was no fever at the time of assessment or within the previous 12 hours.","There had been watery diarrhoea more than once an hour for 6 hours or more.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Medicine to stop diarrhoea should not be given to younger children, except on the advice of a doctor.","Drink frequent, small amounts of water.","Eat as normally as possible, especially soups and starchy foods like bread and pasta. Avoid fatty foods.","Diarrhoea can be caused by gastro-enteritis (a tummy bug). Good hygiene will help to prevent spreading it to others.","Wash hands after using the toilet or changing nappies. Don''t share towels with others.","Keep them off school or nursery until the symptoms have gone.","Becoming limp, floppy or unresponsive, or pale, cold and clammy - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:31.609678+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (685, 38, 100, 1025, 10, 27, 4003, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW962, Blood in Urine","Severe illness and a rash suggestive of septicaemia were not described.","There was no stinging sensation when passing urine.","There was no fever at the time of assessment or within the previous 12 hours.","There was no new or worsening confusion.","The urine was the colour of cola.","The individual needs to speak to a primary care service within 2 hours.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Don''t cut down on fluids. It is important to drink at least as much as usual.","If you need to be seen by a GP practice or OOH service collect a urine specimen in a clean jar in case it needs to be tested.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:31.709504+00', NULL);
