INSERT INTO pathwaysdos.scenarios VALUES (689, 38, 74, 1181, 4, 21, 4003, 4, 2, '{"Pathway Selected: PFI, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1710, Wound Problems, Plaster Casts, Tubes and Metal Appliances","The problem involved a wound or dressing.","The wound was not to the abdomen or a limb.","There was no complete wound dehiscence.","The wound was not bleeding freely.","There had been no continuous crying lasting over an hour.","There was a fever at the time of assessment or within the previous 12 hours.","The individual needs to contact a Primary Care Service within 2 hours.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Give them plenty to drink, little and often is best. If breastfeeding, breast milk is best.","Dress them in light clothes e.g. a T-shirt and nappy. Don''t wrap them up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Becoming limp, floppy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","OVER 12 WEEKS OLD: Unless advised not to, or they have already been given, either paracetamol OR  ibuprofen can be used to relieve pain or reduce a fever.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","Use a dry dressing or a clean cloth folded into a pad and press gently but firmly on the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","IN LIMBS: raise the area above the level of the heart and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","If you have been given dressings, take them with you when you go to get the wound redressed.","If you have a care plan take that too.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:32.212623+00', NULL);
