INSERT INTO pathwaysdos.scenarios VALUES (713, 38, 153, 1117, 5, 22, 4003, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW777, Lower Limb Pain or Swelling","The problem affected the lower leg only.","The problem affected the knee or lower leg.","The problem did not relate to a previously diagnosed leg ulcer.","There was no swelling in the groin.","There was no pain in the groin.","There was no new loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There was no sudden onset of pain and swelling of an entire leg.","A leg had not suddenly become cold, pale or blue.","The individual had not suddenly become breathless.","There was no sharp/stabbing pain in the chest/upper back on coughing or deep breathing.","The individual had not coughed up blood.","The problem involved both legs.","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","There was no fever at the time of assessment or within the previous 12 hours.","There was no very severe, deep pain.","There was a new ulcerated or blackened area(s) of skin.","There was inflammation of the affected area.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Remove any jewellery or tight clothing from around the swelling.","Raise a swollen ankle or knee by sitting with the foot on a stool, or lying with it propped on pillows.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:34.869907+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (714, 38, 392, 1156, 131, 104, 4402, 1, 2, '{"Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW854, Sore Throat or Hoarse Voice","The problem involved  a sore throat without a hoarse voice.","There was no pain on swallowing at the time of the assessment.","There was no associated chest pain.","The individual had not experienced aching pain associated with exercise or emotion.","There was no new or worsening breathlessness.","Severe illness and a rash suggestive of septicaemia were not described.","Severe illness and inability to flex the neck or photophobia were not described.","There had been no travel within the last 4 weeks from a country affected by the current Ebola outbreak.","Exposure to Ebola virus disease in the last 4 weeks was declared.","There was no fever at the time of assessment or within the previous 24 hours.","The individual needs to speak to a primary care service within 1 hour.","I will arrange for a clinician to speak to the individual.","When seen or spoken to by a health care professional make sure they are told about the recent travel to West Africa or contact with Ebola. This is very important.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Paracetamol and ibuprofen are both used to relieve pain and reduce high temperature and fever.","Unless advised not to, or it has already been given, paracetamol is best for relieving a sore throat.","However, ibuprofen can be used instead of paracetamol. Follow the instructions in the pack. If in doubt ask a pharmacist.","Even though swallowing is painful, warm or cold drinks, ice lollies and ice cream can all soothe a sore throat.","Avoid exposure to tobacco smoke.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:35.009476+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (715, 38, 350, 1101, 5, 22, 4073, 2, 1, '{"Pathway Selected: PMC3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the contact was not chest/upper back pain, recent fit/seizure, suicide attempt, new confusion or suspected stroke.","The main reason for the assessment was not declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1565, Genital Problems","There was no abdominal or low back pain.","There was no pain in the penis","There was no testicular/scrotal pain.","There was a problem with a urinary catheter.","There was a fever at the time of assessment or within the previous 12 hours.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","It is important to have plenty of fluids, little and often is best.","Only wear light clothing. Don''t wrap up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Becoming very drowsy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:35.117633+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (716, 38, 146, 1089, 4, 21, 4003, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW719, Flank or Side Pain","The pain did not interfere with normal activity .","Severe illness and a rash suggestive of septicaemia were not described.","There was no blood in the urine.","Neither pain nor swelling was present since symptom onset","The individual was not very breathless at the time of the assessment.","The individual had not coughed up blood.","There was no abdominal pain.","The pain did not begin suddenly during physical activity.","There was no testicular/scrotal pain.","There was a fever at the time of assessment or within the previous 12 hours.","There was no new shoulder tip pain.","There was new or worsening confusion.","The individual needs to contact a Primary Care Service within 2 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","It is important to have plenty of fluids, little and often is best.","Only wear light clothing. Don''t wrap up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Becoming very drowsy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","Don''t cut down on fluids. It is important to drink at least as much as usual.","If you need to be seen by a GP practice or OOH service collect a urine specimen in a clean jar in case it needs to be tested.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:35.249777+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (799, 40, 238, 1192, 42, 58, 4413, 1, 2, '{"Patient:  Joe Bloggs, Age Gender Selected: Adult, Female","Pathway Selected: PFA1, Calling About Self","Reason for call menu - continued to next list.","A prescription request was the main reason for the contact.","The main reason for the contact was not a new or worsening illness.","The individual did not have enough medication to last until the surgery next opened.","The individual has some of the medication available.","The medication runs out within 6 hours.","The individual needs a repeat prescription.","I will arrange for a clinician to speak to the individual.","DOS call"}', '2023-02-27 13:58:17.88993+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (717, 38, 185, 1172, 4, 21, 4003, 4, 1, '{"Pathway Selected: PMI, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1804, Unwell Infant","There was no fever at the time of assessment or within the previous 12 hours.","There were no breathing problems.","Severe illness and a rash suggestive of septicaemia were not described.","The individual was responding normally.","The individual had no redcurrant jelly stools, tarry, black stools or red bowel motions.","There was no vomiting.","There had been no ingestion of a potentially harmful substance or object.","There had been no episode of choking within the previous 24 hours.","There had been no travel within the last 4 weeks from a country affected by the current Ebola outbreak.","Exposure to Ebola virus disease in the last 4 weeks was not declared.","There was no bruising.","There was no new or worsening lump or swelling.","The individual appeared to be in pain.","There had been continuous crying for over an hour.","The individual needs to contact a Primary Care Service within 2 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","OVER 12 WEEKS OLD: Unless advised not to, or they have already been given, either paracetamol OR  ibuprofen can be used to relieve pain or reduce a fever.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:35.397874+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (718, 38, 191, 1175, 4, 21, 4003, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW910, Vaginal Bleeding","Pregnancy or possible pregnancy was reported.","The individual was less than 20 weeks pregnant.","There was abdominal pain as well as vaginal bleeding.","The pain did not interfere with normal activity .","There was no significant vaginal bleeding.","The individual had not felt faint or passed out because of the pain.","A sexual assault had not occurred.","There was no new shoulder tip or one-sided lower abdominal pain","The individual needs to contact a Primary Care Service within 2 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Try putting a heat pad or covered hot water bottle on the painful area.","Keep a check of how many pads are used to determine the amount of bleeding.","Don''t use tampons.","Keep any towels, etc. that were used to mop up the blood. They will need to be checked.","If bleeding becomes heavy, and you start passing clots, save everything passed in case it needs to be checked.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:35.511057+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (719, 38, 27, 1187, 10, 27, 4003, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","Declared diabetic hypo or hyperglycaemia was the main reason for the contact.","Whether the concern was blood sugar that was too high or too low could not be confirmed.","The blood sugar level had been measured.","The testing machine reported in units of millimoles per litre.","The blood sugar level was less than 4mmol/L.","High-sugar drinks or foodstuffs were not available.","Glucose gel was available for emergency use.","EITHER: the glucose gel can be swallowed.","Sugary drink, food or glucose gel had been administered.","Administration of the medication produced an improvement in the individual''s condition.","The individual had not clinically deteriorated nor felt particularly unwell in the previous 24 hours.","There were similar episodes that day.","There was no diagnosis of insulin dependent diabetes.","The individual needs to speak to a primary care service within 2 hours.","I will arrange for a clinician to speak to the individual.","DOS call","Eat something now. If a meal is not due have a sandwich, some biscuits, a bowl of cereal or some fruit."}', '2023-02-27 13:57:35.613405+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (720, 38, 230, 1171, 4, 21, 4120, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1709, Wound Problems, Plaster Casts, Tubes and Metal Appliances","The problem involved a tube or drain.","The tube was from a syringe driver.","The tube had come out or come apart.","The individual needs to contact a Primary Care Service within 2 hours.","IF THE RECOMMENDED TIMEFRAME FALLS OUTSIDE PRACTICE HOURS: I will arrange for the out of hours service to contact you to arrange this.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:57:35.697861+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (721, 38, 19, 1003, 9, 26, 4003, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW508, Abdominal or Flank Injury, Penetrating","Pregnancy or possible pregnancy was reported.","The individual had been pregnant for 20 weeks or more.","There was no severe, constant abdominal pain.","There was no significant vaginal bleeding.","There was no cord prolapse, visible presenting part, passage of meconium, urge to push or contractions less than 5 minutes apart.","There had been no increased frequency of contractions or waters breaking following the injury.","There was no new/worsening breathlessness since the injury.","The wound was not bleeding freely at the time of assessment.","There was no foreign body in the wound.","There was no severe pain in the chest or back.","There was no spinal pain, loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There had been no vomiting of red or altered (coffee grounds) blood.","There had been no black and tarry or red/maroon bowel motions.","The individual has been able to weight-bear since the injury.","There was no new shoulder tip pain.","An assault had not occurred.","The problem was not a needlestick injury.","The injury was not a complex wound.","There had been no blood in the urine since the injury.","There was no worsening pain or swelling.","The individual needs to speak to a primary care service within 1 hour.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","IN PREGNANCY: Don''t take ibuprofen, except on the advice of a doctor, midwife or pharmacist. Use paracetamol instead.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-02-27 13:57:35.838933+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (722, 38, 226, 1145, 5, 22, 4130, 2, 2, '{"Pathway Selected: PFC1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1590, Scratches, Grazes and Minor Wounds","The individual was able to get up from the floor.","An assault had not occurred.","The problem was an animal scratch.","The bite/scratch occurred outside the UK.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Wash the entire area thoroughly with soap and water. Don''t use antiseptics, as they can irritate the wound.","A decision about whether tetanus immunisation is needed can be made when the injury is checked.","Use a dry dressing or a clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","IN LIMBS: raise the injured area above the level of the heart and continue to apply pressure.","Never use a tourniquet; they can cause permanent damage to the circulation. If a tourniquet is already in place, do not remove it.","Use pillows or a sling to keep the injured area raised.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","IN LIMBS: raise the injured area above the level of the heart using pillows or a sling.","If it starts to bleed again, fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Wash your hands thoroughly.","If helping someone else: try to keep their blood off your skin.","Clean the wound under running tap water. Don''t use antiseptics, as they can irritate the wound.","Gently dry the skin around the wound.","Cover the wound with a plaster or non-stick dressing or a folded clean, non-fluffy cloth.","A decision about whether tetanus immunisation is needed can be made when the injury is checked.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:35.989486+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (723, 38, 31, 1187, 11, 28, 4003, 1, 2, '{"Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","Declared diabetic hypo or hyperglycaemia was the main reason for the assessment.","Whether the concern was blood sugar that was too high or too low could not be confirmed.","The blood sugar level had not been measured.","The individual was unwilling and/or unable to measure the blood sugar.","The skin on the torso felt normal, warm or hot.","Severe illness and a rash suggestive of septicaemia were not described.","There was a diagnosis of insulin dependent diabetes.","The individual was able to stay awake.","There was no new or worsening confusion.","The individual had not clinically deteriorated nor felt particularly unwell in the previous 24 hours.","The enquiry related to the next dose of medication.","The method of insulin delivery could not be confirmed.","The next dose was due within 6 hours.","The individual needs to speak to a primary care service within 6 hours.","IF THE RECOMMENDED TIMEFRAME FALLS DURING PRACTICE HOURS: Contact the practice to arrange for the individual to be spoken to within 6 hours.","DOS call","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:36.097999+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (724, 38, 193, 1179, 5, 22, 4003, 2, 2, '{"Pathway Selected: PFC1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the contact was not chest/upper back pain, recent fit/seizure, suicide attempt, new confusion or suspected stroke.","The main reason for contact was not declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW937, Vomiting and/or Nausea","The individual had vomited.","The individual did not also have diarrhoea.","There had been no vomiting of blood or faeces.","The symptoms did not follow drinking alcohol.","There had been no head injury in the previous 7 days.","Severe illness and a rash suggestive of septicaemia were not described.","There was no abdominal pain.","There was no new inability to raise both arms, new difficulty speaking or new unilateral facial weakness.","Severe illness and inability to flex the neck, photophobia or not responding normally were not described.","There had been no black and tarry or red/maroon bowel motions.","There was no severe headache of sudden onset.","The individual had not ingested a harmful or toxic substance.","There was no heat exposure or overexertion prior to symptom onset.","There was no new loss or disturbance of vision.","There had been no travel within the last 4 weeks from a country affected by the current Ebola outbreak.","Exposure to Ebola virus disease in the last 4 weeks was not declared.","There was no feeling of vertigo.","There was no new or worsening confusion.","There was no possibility of pregnancy.","Childbirth had not occurred within the previous 6 weeks.","There was flank pain.","There was a fever at the time of assessment or within the previous 12 hours.","There was no new, widespread, red rash.","There was no previous history of diabetes.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","It is important to have plenty of fluids, little and often is best.","Only wear light clothing. Don''t wrap up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Becoming very drowsy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Drink frequent, small amounts of water. Also have some dilute fruit juice, squash or thin soups.","Rehydration drinks can be bought from pharmacies. Follow the instructions in the pack.","Vomiting can be caused by gastro-enteritis (a tummy bug). Good hygiene will help to prevent spreading it to others.","Wash hands after dealing with the vomit. Don''t share towels with others.","Clean any vomit bowls with disinfectant.","Stay off school or work until the symptoms have gone. Food handlers and health workers should check with their employer before returning to work.","Becoming very drowsy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:36.277647+00', NULL);
