e the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","It is important to have plenty of fluids, little and often is best.","Only wear light clothing. Don''t wrap up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Becoming very drowsy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:36.431242+00', NULL);
