lieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:36.553845+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (727, 38, 391, 1020, 5, 22, 4398, 1, 2, '{"Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1575, Bites and Stings","The bite or sting was caused by an insect or spider.","The sting/bite had occurred within the previous 6 hours.","There was no rapid facial/oral swelling, wheezing or breathlessness following the bite/sting.","There was no rapidly spreading rash or widespread tingling sensation.","There was no visual disturbance, faintness or dizziness following the bite/sting.","The individual had been stung less than 10 times","The individual had not experienced nausea or vomiting since the sting.","The sting did not involve the eyes or mouth.","An insect/insect part remained attached to the skin.","The bite was from a tick.","The whole tick was still attached.","There was a red rash around the tick bite.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Remove any jewellery or tight clothing from the area near the bite.","Wash the area with soap and water.","Don''t scratch the area. This can introduce infection.","Antihistamine medication and creams help reduce swelling and itching. They can be bought from pharmacies. Talk to the pharmacist for advice. Follow the instructions in the pack.","Remove any jewellery or tight clothing from the area.","If the sting is visible in the skin, brush or scrape it out with your fingernail or the edge of a credit card. Don''t try to pull it out with tweezers.","Wash the area with soap and water.","To help reduce pain and swelling, put a cold flannel on the area and raise above the level of the heart if possible. Don''t put ice on the skin.","Don''t scratch the area.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:36.695097+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (800, 40, 237, 1192, 111, 83, 4413, 1, 2, '{"Patient:  Joe Bloggs, Age Gender Selected: Adult, Female","Pathway Selected: PFA1, Calling About Self","Reason for call menu - continued to next list.","A prescription request was the main reason for the contact.","The main reason for the contact was not a new or worsening illness.","The individual did not have enough medication to last until the surgery next opened.","The individual has some of the medication available.","The medication runs out in over 12 hours time.","The individual needs a repeat prescription within 24 hours.","I will arrange for a clinician to speak to the individual.","DOS call"}', '2023-02-27 13:58:17.955639+00', NULL);
