 will just check whether I need to give you any further instructions or advice.","DOS call","Avoid anything that makes dizziness worse, e.g. moving the head quickly, getting up quickly or bending forwards or stretching the neck back.","Don''t drive.","Don''t let them have anything to eat or drink (a sip of water is fine if medication needs to be taken).","Vomiting can be caused by gastro-enteritis (a tummy bug). Good hygiene will help to prevent spreading it to others.","Wash hands after dealing with the vomit. Don''t share towels with others.","Clean any vomit bowls with disinfectant.","Becoming very drowsy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:36.951049+00', NULL);
