INSERT INTO pathwaysdos.scenarios VALUES (736, 38, 141, 1064, 5, 22, 4003, 3, 1, '{"Pathway Selected: PMT, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW654, Earache","Severe illness and a rash suggestive of septicaemia were not described.","Severe illness and inability to flex the neck, photophobia or not responding normally were not described.","There was no foreign body in the ear.","Earache did not begin following an explosion or exposure to major pressure change.","The individual did not appear to be confused.","There was a fever at the time of assessment or within the previous 12 hours.","The ear was red, shiny and sore.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","A flannel soaked in warm water and held against the ear may help.","Don''t clean inside the ear, use ear drops or put anything else into the ear unless it has been prescribed.","Keep water out of the ears.","It is important to have plenty of fluids, little and often is best.","Dress them in light clothes e.g. a T-shirt and shorts or a nappy. Don''t wrap them up to try to sweat out the fever.","Don''t try to cool down by cold sponging or 