INSERT INTO pathwaysdos.scenarios VALUES (747, 39, 166, 1126, 7, 24, 4003, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW785, Lower Back Pain","The pain did not interfere with normal activity .","Severe illness and a rash suggestive of septicaemia were not described.","Neither pain nor swelling was present since symptom onset","There was no new loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","There was no abdominal pain.","The pain did not begin suddenly during physical activity.","There was no testicular/scrotal pain.","There was no fever at the time of assessment or within the previous 12 hours.","There was no new shoulder tip pain.","There was no new or worsening confusion.","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","The pain was not severe.","Medication type or dosage had not changed within the previous 2 weeks.","The individual had not clinically deteriorated nor felt particularly unwell in the previous 24 hours.","There was blood in the urine.","The individual needs to contact a primary care service within 24 hours.","I will arrange for the individual to be seen. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Don''t cut down on fluids. It is important to drink at least as much as usual.","If you need to be seen by a GP practice or OOH service collect a urine specimen in a clean jar in case it needs to be tested.","Don''t cut down on fluids. It is important to drink at least as much as usual.","If you need to be seen by a GP practice or OOH service collect a urine specimen in a clean jar in case it needs to be tested.","Paracetamol and ibuprofen are both used to relieve pain and reduce high temperature and fever.","Unless advised not to, or it has already been given, paracetamol is best for relieving back pain. Take it regularly, not just when the pain is bad.","However, ibuprofen can be used instead of paracetamol. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:56.577897+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (748, 39, 6, 1000, 7, 24, 4003, 3, 2, '{"Pathway Selected: PFT, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW502, Abdominal or Flank Injury, Blunt","There was no new/worsening breathlessness since the injury.","There was no new quietness or limb weakness/coordination problems.","The pain was not severe.","There was no new vaginal bleeding.","There had been no vomiting of red or altered (coffee grounds) blood.","There had been no black and tarry or red/maroon bowel motions.","An assault had not occurred.","There had been no blood in the urine since the injury.","There was no worsening pain or swelling.","The injury was more than 24 hours old.","The individual had not been hit by a heavy or fast moving object.","There were not two or more separate injuries.","There was a new lump/swelling in the area of injury.","The individual needs to contact a primary care service within 24 hours.","I will arrange for the individual to be seen. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, either paracetamol OR ibuprofen can be used to relieve pain or reduce a fever.","It is not always necessary to use medication to treat a fever unless the child is particularly upset or uncomfortable.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t leave ice on while asleep. Don''t put ice directly on the skin.","Raise a swollen ankle or knee by sitting with the foot on a stool, or lying with it propped on pillows.","Raise a swollen hand or wrist above the level of the heart with a sling. When in bed raise it on pillows.","The individual should not eat or drink anything before going to hospital (a sip of water is fine if medication needs to be taken).","Breathlessness or unusual quietness - DIAL 999.","Bleeding from the vagina - DIAL 999.","Blood in vomit or motions - DIAL 999.","Blood in urine - GO STRAIGHT TO THE NEAREST EMERGENCY DEPARTMENT.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:56.731131+00', NULL);
