INSERT INTO pathwaysdos.scenarios VALUES (756, 39, 64, 1043, 7, 24, 4003, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1040, Cold or Flu (Declared)","Severe illness and a rash suggestive of septicaemia were not described.","Severe illness and inability to flex the neck or photophobia were not described.","There had been no travel to the Middle East or South Korea in the past 2 weeks.","There was no possibility of pregnancy.","There had been no travel within the last 4 weeks from a country affected by the current Ebola outbreak.","Exposure to Ebola virus disease in the last 4 weeks was not declared.","The individual had not started to feel breathless or wheezy","There was no new or worsening confusion.","A fever at the time of assessment or within the previous 12 hours could not be confirmed.","A cough was the worst symptom associated with the problem.","There was no previous history of diabetes.","There was no sharp/stabbing pain in the chest/upper back on coughing or deep breathing.","The individual had not coughed up blood.","The individual was producing green or yellow sputum.","The individual had previous medical advice that antibiotic therapy should be sought for the condition.","The individual needs to contact a primary care service within 24 hours.","I will arrange for the individual to be seen. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Rest until you start to feel better. Make sure someone checks on you regularly.","Drink plenty of fluids. If vomiting is a problem have small sips every few minutes.","Always cover the mouth with a tissue when coughing or sneezing. Put used tissues into a bin immediately and wash the hands.","Washing hands and cleaning household surfaces regularly reduces the spread of infection.","Becoming very drowsy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","Cough medicine may soothe a cough, but will not cure it. Talk to the pharmacist for advice. Follow the instructions in the pack.","Have plenty of fluids to loosen the phlegm.","Avoid exposure to tobacco smoke.","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:57.877069+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (803, 41, 38, 1191, 24, 40, 4194, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","Reason for call menu - continued to next list.","The main reason for the contact was a request for health or medication information.","The request for information was not related to a new or worsening illness.","The information request related to the location of health services.","The request related to locating a pharmacist.","Information on the location of a service was given.","I am going to give you the location of the service you require.","DOS call"}', '2023-02-27 13:58:32.669889+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (757, 39, 98, 1018, 7, 24, 4003, 3, 1, '{"Pathway Selected: PMT, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW542, Behaviour Change","Severe illness and a rash suggestive of septicaemia were not described.","The duration of the problem was more than 2 weeks.","Whether the problem had become worse that day could not be confirmed.","There had been no continuous crying lasting over an hour.","There was no new limb weakness, co-ordination problems or staggering gait.","Medication type or dosage had not changed within the previous 2 weeks.","The individual did not appear to be confused.","The individual was not repeatedly falling asleep.","There was a fever at the time of assessment or within the previous 12 hours.","The individual needs to contact a primary care service within 24 hours.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","It is important to have plenty of fluids, little and often is best.","Dress them in light clothes e.g. a T-shirt and shorts or a nappy. Don''t wrap them up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Check on them overnight every 2-4 hours.","Becoming limp, floppy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","Unless advised not to, or they have already been given, either paracetamol OR ibuprofen can be used to relieve pain or reduce a fever.","It is not always necessary to use medication to treat a fever unless the child is particularly upset or uncomfortable.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:58.006878+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (758, 39, 67, 1181, 6, 23, 4114, 2, 1, '{"Pathway Selected: PMC1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the contact was not chest/upper back pain, recent fit/seizure, suicide attempt, new confusion or suspected stroke.","The main reason for contact was not declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1709, Wound Problems, Plaster Casts, Tubes and Metal Appliances","The problem involved a wound or dressing.","The pain was not severe.","The wound was to an arm.","The arm had not suddenly become cold, pale or blue.","There was no complete wound dehiscence.","The wound was not bleeding freely.","There was no fever at the time of assessment or within the previous 12 hours.","There was no increasing pain or swelling in the area.","Redressing was required.","The individual needs to contact a primary care service within 12 hours.","The individual should register as a temporary resident with a GP practice if they are not already registered.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Use a dry dressing or a clean cloth folded into a pad and press gently but firmly on the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","IN LIMBS: raise the area above the level of the heart and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","If you have been given dressings, take them with you when you go to get the wound redressed.","If you have a care plan take that too.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:58.135799+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (759, 39, 338, 1212, 13, 30, 4387, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","Recovery from an ICD shock was the main reason for the contact.","ICD activation had not happened within the previous 24 hours.","There was no chest, upper back or abdominal pain or pain in the arm, neck or jaw around or since the time of the shock.","There was no vomiting or nausea.","The individual was not clammy or sweating.","There was no new or worsening breathlessness.","The individual was not experiencing palpitations.","There was no new or worsening confusion.","The individual was otherwise well.","The individual needs to speak to a primary care service within 24 hours.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:58.229685+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (760, 39, 99, 1025, 7, 24, 4003, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW962, Blood in Urine","Severe illness and a rash suggestive of septicaemia were not described.","There was no stinging sensation when passing urine.","There was no fever at the time of assessment or within the previous 12 hours.","There was no new or worsening confusion.","The individual had not passed blood clots in the urine or urine the colour of cola.","There was no new spontaneous bruising or abnormal bleeding within the last 2 weeks.","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","There was no flank pain.","There was no extreme thirst or increased urine output during the previous month.","The individual did not have a urinary catheter.","The individual needs to contact a primary care service within 24 hours.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Don''t cut down on fluids. It is important to drink at least as much as usual.","If you need to be seen by a GP practice or OOH service collect a urine specimen in a clean jar in case it needs to be tested.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2