INSERT INTO pathwaysdos.scenarios VALUES (762, 39, 49, 1039, 13, 30, 4003, 1, 2, '{"Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","Chest/upper back pain was the main reason for the assessment.","The individual had not experienced a previous heart attack.","There was pain at the time of the assessment.","There had been no previous diagnosis of aortic aneurysm or Marfan''s syndrome.","The skin on the torso felt normal, warm or hot.","There was no sudden onset of ripping or tearing pain.","There was no crushing or severe aching chest, upper back or upper abdominal pain, or pain radiating to the arm, neck, jaw or shoulder.","There had been no crushing or aching pain in the chest, upper back or upper abdomen or pain radiating to the neck, arm, jaw or shoulder in the last 24 hours.","There was no vomiting or nausea with the pain in the previous 24 hours.","The individual had not been clammy or sweaty with the pain in the previous 24 hours.","Drug or solvent misuse had not occurred in the previous 24 hours.","The individual did not have an implanted cardioverter defibrillator.","Severe illness and a rash suggestive of septicaemia were not described.","Severe illness and inability to flex the neck or photophobia were not described.","There was no sharp/stabbing pain in the chest/upper back on coughing or deep breathing.","There was no new or worsening breathlessness.","The arm had not suddenly become cold, pale or blue.","There was no sudden onset of pain and swelling of the entire arm.","There was no new leg pain or swelling.","There was no new shoulder tip pain.","There was no abdominal pain.","There were no palpitations at the time of the assessment.","The individual had not coughed up