INSERT INTO pathwaysdos.scenarios VALUES (763, 39, 129, 1054, 6, 23, 4003, 3, 2, '{"Pathway Selected: PFT, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW630, Diarrhoea","There was no vomiting.","Severe illness and a rash suggestive of septicaemia were not described.","Severe illness and inability to flex the neck, photophobia or not responding normally were not described.","The individual had no redcurrant jelly stools, tarry, black stools or red bowel motions.","There was no apparent abdominal pain.","The individual had not ingested a harmful or toxic substance.","There had been no travel within the last 4 weeks from a country affected by the current Ebola outbreak.","Exposure to Ebola virus disease in the last 4 weeks was not declared.","There had been no continuous crying lasting over an hour.","The individual did not appear to be confused.","There was a fever at the time of assessment or within the previous 12 hours.","There had not been watery diarrhoea more than once an hour for 6 hours or more.","The individual was not jaundiced.","The individual had travelled abroad in the previous 4 weeks.","The individual needs to contact a primary care service within 12 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Medicine to stop diarrhoea should not be given to younger children, except on the advice of a doctor.","Drink frequent, small amounts of water.","Eat as normally as possible, especially soups and starchy foods like bread and pasta. Avoid fatty foods.","Diarrhoea can be caused by gastro-enteritis (a tummy bug). Good hygiene will help to prevent spreading it to others.","Wash hands after using the toilet or changing nappies. Don''t share towels with others.","Keep them off school or nursery until the symptoms have gone.","Becoming limp, floppy or unresponsive, or pale, cold and clammy - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","It is important to have plenty of fluids, little and often is best.","Dress them in light clothes e.g. a T-shirt and shorts or a nappy. Don''t wrap them up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Check on them overnight every 2-4 hours.","Becoming limp, floppy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","Unless advised not to, or they have already been given, either paracetamol OR ibuprofen can be used to relieve pain or reduce a fever.","It is not always necessary to use medication to treat a fever unless the child is particularly upset or uncomfortable.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:57:58.8779+00', NULL);
