INSERT INTO pathwaysdos.scenarios VALUES (774, 39, 80, 1018, 7, 24, 4173, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1749, Behaviour Change","The mood or behaviour change was not part of a previously diagnosed mental health problem.","The individual had not attacked, threatened or intended to harm anyone.","There was no ingestion/inhalation of something harmful in the last 72 hours.","The duration of the problem was less than 2 weeks.","Severe illness and a rash suggestive of septicaemia were not described.","There had been no episodes of inability to raise both arms, speech difficulty or unilateral facial weakness.","There had been no episode of unilateral leg weakness.","There was no fainting or loss of consciousness in the previous 24 hours.","Severe illness and inability to flex the neck or photophobia were not described.","There had been no exposure to extremes of temperature in the previous 24 hours.","There had been no head injury in the previous 7 days.","The individual was able to stay awake.","The individual denied suicidal thoughts.","The individual did not use insulin or other medication for diabetes.","There was no new or worsening confusion.","The individual had been behaving abnormally.","Medication type or dosage had not changed within the previous 2 weeks.","There was no fever at the time of assessment or within the previous 12 hours.","There was no recent history of severe headaches.","There was no unexplained weight loss or gain or intolerance of extreme temperatures.","There was a bereavement in the last 6 months.","The problem was so severe that normal life was impossible.","The individual had not considered harming themselves or anyone else.","No one else was considered to be vulnerable and at risk","The individual needs to contact a primary care service within 24 hours.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Feelings of low mood, anxiety, anger, guilt and relief are all common after a bereavement.","Keep in contact with friends and family.","Eat regular meals.","Get enough rest.","Plan what to do on difficult anniversaries such as birthdays, Christmas or the anniversary of the death.","Alcohol and smoking may seem to relieve stress, anxiety or depression, but it can make these problems worse.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:58:00.694892+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (775, 39, 94, 1018, 7, 24, 4003, 3, 1, '{"Pathway Selected: PMT, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW542, Behaviour Change","Severe illness and a rash suggestive of septicaemia were not described.","The duration of the problem was more than 2 weeks.","Whether the problem had become worse that day could not be confirmed.","There had been no continuous crying lasting over an hour.","There was no new limb weakness, co-ordination problems or staggering gait.","Medication type or dosage had not changed within the previous 2 weeks.","The individual did not appear to be confused.","The individual was not repeatedly falling asleep.","There was a fever at the time of assessment or within the previous 12 hours.","The individual needs to contact a primary care service within 24 hours.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","It is important to have plenty of fluids, little and often is best.","Dress them in light clothes e.g. a T-shirt and shorts or a nappy. Don''t wrap them up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Check on them overnight every 2-4 hours.","Becoming limp, floppy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","Unless advised not to, or they have already been given, either paracetamol OR ibuprofen can be used to relieve pain or reduce a fever.","It is not always necessary to use medication to treat a fever unless the child is particularly upset or uncomfortable.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:58:00.817779+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (776, 39, 137, 1055, 5, 22, 4003, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1553, Diarrhoea and Vomiting","There had been no vomiting of red or altered (coffee grounds) blood.","There was no abdominal pain.","Severe illness and a rash suggestive of septicaemia were not described.","Severe illness and inability to flex the neck or photophobia were not described.","There had been no black and tarry or red/maroon bowel motions.","The individual had not ingested a harmful or toxic substance.","There had been no travel within the last 4 weeks from a country affected by the current Ebola outbreak.","Exposure to Ebola virus disease in the last 4 weeks was not declared.","There was no new or worsening confusion.","There was no previous history of diabetes.","There had been vomiting or watery diarrhoea more than once an hour for at least 12 hours.","The individual needs to contact a primary care service within 6 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Some anti-diarrhoea medicines can ease diarrhoea and speed recovery. They can be bought from pharmacies. Follow the instructions in the pack.","Drink frequent, small amounts of water. Also have some fruit juice or thin soups.","Rehydration drinks can be bought from pharmacies. Follow the instructions in the pack.","Diarrhoea and vomiting can be caused by gastro-enteritis (a tummy bug). Good hygiene will help to prevent spreading it to others.","Wash hands after using the toilet or dealing with the vomit. Don''t share towels with others.","Stay off work until the symptoms have gone. Food handlers and health workers should check with their employer before returning to work.","Becoming very drowsy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:58:00.953629+00', NULL);
