INSERT INTO pathwaysdos.scenarios VALUES (783, 39, 82, 1018, 7, 24, 4175, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1749, Behaviour Change","The mood or behaviour change was not part of a previously diagnosed mental health problem.","The individual had not attacked, threatened or intended to harm anyone.","There was no ingestion/inhalation of something harmful in the last 72 hours.","The duration of the problem was less than 2 weeks.","Severe illness and a rash suggestive of septicaemia were not described.","There had been no episodes of inability to raise both arms, speech difficulty or unilateral facial weakness.","There had been no episode of unilateral leg weakness.","There was no fainting or loss of consciousness in the previous 24 hours.","Severe illness and inability to flex the neck or photophobia were not described.","There had been no exposure to extremes of temperature in the previous 24 hours.","There had been no head injury in the previous 7 days.","The individual was able to stay awake.","The individual denied suicidal thoughts.","The individual did not use insulin or other medication for diabetes.","There was no new or worsening confusion.","The individual had not been hearing voices, seeing things or behaving abnormally.","Medication type or dosage had not changed within the previous 2 weeks.","There was no fever at the time of assessment or within the previous 12 hours.","There was no recent history of severe headaches.","There was no unexplained weight loss or gain or intolerance of extreme temperatures.","A new baby had become part of the individual''s life in the last 6 months.","The problem was so severe that normal life was impossible.","The individual had not considered harming themselves or anyone else.","No one else was considered to be vulnerable and at risk","The individual needs to contact a primary care service within 24 hours.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:58:01.858051+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (784, 39, 184, 1156, 7, 24, 4003, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW854, Sore Throat or Hoarse Voice","The problem involved  a sore throat without a hoarse voice.","There was no pain on swallowing at the time of the assessment.","There was no associated chest pain.","The individual had not experienced aching pain associated with exercise or emotion.","There was no new or worsening breathlessness.","Severe illness and a rash suggestive of septicaemia were not described.","Severe illness and inability to flex the neck or photophobia were not described.","There had been no travel within the last 4 weeks from a country affected by the current Ebola outbreak.","Exposure to Ebola virus disease in the last 4 weeks was not declared.","There was no history of recent general anaesthetic or tonsillectomy.","There was no new or worsening confusion.","There was no fever at the time of assessment or within the previous 12 hours.","There was no difficulty opening the mouth or speaking as if the mouth was full.","The individual had a known increased susceptibility to infection.","The individual needs to contact a primary care service within 24 hours.","I will arrange for the individual to be seen. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Paracetamol and ibuprofen are both used to relieve pain and reduce high temperature and fever.","Unless advised not to, or it has already been given, paracetamol is best for relieving a sore throat.","However, ibuprofen can be used instead of paracetamol. Follow the instructions in the pack. If in doubt ask a pharmacist.","Even though swallowing is painful, warm or cold drinks, ice lollies and ice cream can all soothe a sore throat.","Avoid exposure to tobacco smoke.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:58:02.009677+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (785, 39, 33, 1187, 13, 30, 4003, 1, 2, '{"Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","Declared diabetic hypo or hyperglycaemia was the main reason for the assessment.","The concern was that the blood sugar was too low.","The blood sugar level had been measured.","The testing machine reported in units of millimoles per litre.","The blood sugar level was less than 4mmol/L.","The individual was able to swallow.","A high-sugar drink was available.","EITHER: give a sweet drink (e.g. cola). Don''t give diet drinks.","Sugary drink, food or glucose gel had been administered.","Administration of the medication produced an improvement in the individual''s condition.","The individual had not clinically deteriorated nor felt particularly unwell in the previous 24 hours.","There were similar episodes that week.","A diagnosis of insulin dependent diabetes could not be confirmed.","The method of insulin delivery could not be confirmed.","The individual needs to speak to a primary care service within 24 hours.","I will arrange for a clinician to speak to the individual.","DOS call","Eat something now. If a meal is not due have a sandwich, some biscuits, a bowl of cereal or some fruit."}', '2023-02-27 13:58:02.119316+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (786, 39, 224, 1183, 6, 23, 4128, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An injury or symptom relating to an injury was the main problem.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW1570, Fingernail Injury","There was no injury to another part of the finger.","An assault had not occurred.","The individual had not lost all/part of a nail.","There was no purple or black area under the nail.","There was no worsening pain.","The problem occurred 6 hours or more before the assessment.","There was no fever at the time of assessment or within the previous 12 hours.","There was an area of rapidly spreading redness near the injury.","The individual needs to contact a primary care service within 12 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t leave ice on while asleep. Don''t put ice directly on the skin.","Raise a swollen hand or wrist above the level of the heart with a sling. When in bed raise it on pillows.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:58:02.231163+00', NULL);
