INSERT INTO pathwaysdos.scenarios VALUES (792, 39, 23, 1004, 12, 29, 4003, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW516, Abdominal Pain","There was no vomiting, diarrhoea, rectal bleeding, groin pain or groin swelling.","There was no vaginal bleeding, discharge or swelling.","The pain did not interfere with normal activity .","There was no crushing or severe aching chest, upper back or upper abdominal pain, or pain radiating to the arm, neck, jaw or shoulder.","Severe illness and a rash suggestive of septicaemia were not described.","There had been no black and tarry or red/maroon bowel motions.","The individual had not ingested a harmful or toxic substance.","There was no new shoulder tip pain or pain in the lower right abdomen.","There was no new eye pain.","There was no new or worsening confusion.","The individual had not been in constant pain for 4 hours or more.","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","The individual was not jaundiced.","There was no extreme thirst or increased urine output during the previous month.","There had been no foreign travel in the previous 4 weeks or possible exposure to malaria in the previous 12 months","There was no flank pain.","Medication had been stopped within the previous 2 weeks.","The individual needs to speak to a primary care service within 12 hours.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Try putting a heat pad or covered hot water bottle on the painful area.","Regular exercise can help.","Unless advised not to, or it has already been given, paracetamol may be used to relieve abdominal pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use ibuprofen or any other anti-inflammatory medication such as aspirin, as they can irritate the stomach.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:58:03.017836+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (793, 39, 181, 1152, 6, 23, 4003, 4, 2, '{"Pathway Selected: PFI, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","A probable allergic reaction, a fit within the previous 12 hours, successful resuscitation or ICD shock were not the main reason for the assessment.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1774, Skin Problems","The main problem was a rash.","Severe illness was not described.","There was no rapid swelling of the lips, mouth, throat or tongue, wheezing or breathlessness.","There had been no previous serious allergic reaction requiring emergency hospital care.","The individual did not have a petechial/purpuric rash.","The problem was not nappy rash.","The problem was not milk spots or a teething rash.","The problem was not a greasy scalp or cradle cap.","The skin problem did not relate to an assault.","There was no blistering rash.","There was no large area of redness like scalded skin.","There was no known increased susceptibilty to infection.","The rash was confined to one patch or area.","The problem did not involve just one spot or blemish.","There was no inflammation of the skin in the affected area.","There was a fever at the time of assessment or within the previous 12 hours.","The individual had a persisting fever for more than 3 days.","The individual needs to contact a primary care service within 12 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Give them plenty to drink, little and often is best. If breastfeeding, breast milk is best.","Dress them in light clothes e.g. a T-shirt and nappy. Don''t wrap them up to try to sweat out the fever.","Don''t try to cool down by cold sponging or fanning. Cooling down too quickly can cause shivering, which makes the temperature go up again.","Check on them overnight every 2-4 hours.","Becoming limp, floppy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","OVER 12 WEEKS OLD: Unless advised not to, or they have already been given, either paracetamol OR  ibuprofen can be used to relieve pain or reduce a fever.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:58:03.194853+00', NULL);
