INSERT INTO pathwaysdos.scenarios VALUES (795, 39, 142, 1064, 7, 24, 4003, 3, 1, '{"Pathway Selected: PMT, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW654, Earache","Severe illness and a rash suggestive of septicaemia were not described.","Severe illness and inability to flex the neck, photophobia or not responding normally were not described.","There was no foreign body in the ear.","Earache did not begin following an explosion or exposure to major pressure change.","The individual did not appear to be confused.","There was no fever at the time of assessment or within the previous 12 hours.","There was an ear discharge.","The individual needs to contact a primary care service within 24 hours.","I will arrange for the individual to be seen. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","A flannel soaked in warm water and held against the ear may help.","Don''t clean inside the ear, use ear drops or put anything else into the ear unless it has been prescribed.","Keep water out of the ears.","Unless advised not to, or they have already been given, either paracetamol OR ibuprofen can be used to relieve pain or reduce a fever.","It is not always necessary to use medication to treat a fever unless the child is particularly upset or uncomfortable.","Don''t give both together unless recommended to do so by a health care professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:58:03.438226+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (796, 39, 382, 1213, 6, 23, 4003, 1, 1, '{"Patient:  Joe Bloggs, Age Gender Selected: Adult, Male","Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1775, Hiccups","A palliative care plan was not in place.","There was no new or increased breathlessness.","There was no chest or upper back pain at the time of the assessment.","There was no abdominal pain.","There was no fever at the time of assessment or within the previous 12 hours.","The problem did not begin after starting new medication.","Hiccups had persisted for 48 hours or more.","The individual needs to contact a primary care service within 12 hours.","I will arrange for a clinician to see the individual. I need to ask some further questions in order to determine the best way to access this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","Most cases of hiccups are not serious. They usually stop on their own after a short period of time.","Sipping ice-cold water may help the hiccups.","Tasting vinegar or biting on a lemon may also help.","Breath-holding for short periods also works for some people."}', '2023-02-27 13:58:03.556395+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (797, 39, 194, 1179, 7, 24, 4003, 2, 2, '{"Pathway Selected: PFC1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the contact was not chest/upper back pain, recent fit/seizure, suicide attempt, new confusion or suspected stroke.","The main reason for contact was not declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW937, Vomiting and/or Nausea","The individual had vomited.","The individual did not also have diarrhoea.","There had been no vomiting of blood or faeces.","The symptoms did not follow drinking alcohol.","There had been no head injury in the previous 7 days.","Severe illness and a rash suggestive of septicaemia were not described.","There was no abdominal pain.","There was no new inability to raise both arms, new difficulty speaking or new unilateral facial weakness.","Severe illness and inability to flex the neck, photophobia or not responding normally were not described.","There had been no black and tarry or red/maroon bowel motions.","There was no severe headache of sudden onset.","The individual had not ingested a harmful or toxic substance.","There was no heat exposure or overexertion prior to symptom onset.","There was no new loss or disturbance of vision.","There had been no travel within the last 4 weeks from a country affected by the current Ebola outbreak.","Exposure to Ebola virus disease in the last 4 weeks was not declared.","There was no feeling of vertigo.","There was no new or worsening confusion.","There was no possibility of pregnancy.","Childbirth had not occurred within the previous 6 weeks.","There was no flank pain.","There was no fever at the time of assessment or within the previous 12 hours.","There was no previous history of diabetes.","There was no vomiting more than once an hour for 8 hours or more.","There was no extreme thirst or increased urine output during the previous month.","The individual was not using an oral contraceptive.","Medication type or dosage had not changed within the previous 2 weeks.","The individual was not taking prescribed oral medication.","The individual had not undergone surgery within the previous 7 days.","The individual felt generally unwell in the week prior to the onset of more specific symptoms.","The individual needs to contact a primary care service within 24 hours.","I will arrange for the individual to be seen. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Drink frequent, small amounts of water. Also have some dilute fruit juice, squash or thin soups.","Rehydration drinks can be bought from pharmacies. Follow the instructions in the pack.","Vomiting can be caused by gastro-enteritis (a tummy bug). Good hygiene will help to prevent spreading it to others.","Wash hands after dealing with the vomit. Don''t share towels with others.","Clean any vomit bowls with disinfectant.","Stay off school or work until the symptoms have gone. Food handlers and health workers should check with their employer before returning to work.","Becoming very drowsy, unresponsive or having a fit - DIAL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - DIAL 999.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:58:03.737831+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (798, 39, 22, 1004, 7, 24, 4003, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW516, Abdominal Pain","There was no vomiting, diarrhoea, rectal bleeding, groin pain or groin swelling.","There was no vaginal bleeding, discharge or swelling.","The pain did not interfere with normal activity .","There was no crushing or severe aching chest, upper back or upper abdominal pain, or pain radiating to the arm, neck, jaw or shoulder.","Severe illness and a rash suggestive of septicaemia were not described.","There was no possibility of pregnancy.","Childbirth had not occurred within the previous 6 weeks.","There had been no black and tarry or red/maroon bowel motions.","The individual had not ingested a harmful or toxic substance.","The individual had not felt faint or passed out because of the pain.","There was no new shoulder tip or one-sided lower abdominal pain","There was no new eye pain.","There was no new or worsening confusion.","The individual had not been in constant pain for 4 hours or more.","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","The individual was not jaundiced.","There was no extreme thirst or increased urine output during the previous month.","There had been no foreign travel in the previous 4 weeks or possible exposure to malaria in the previous 12 months","There was flank pain.","There was no blood in the urine or painful urination.","The individual needs to contact a primary care service within 24 hours.","I will arrange for the individual to be seen. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Try putting a heat pad or covered hot water bottle on the painful area.","Regular exercise can help.","Unless advised not to, or it has already been given, paracetamol may be used to relieve abdominal pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use ibuprofen or any other anti-inflammatory medication such as aspirin, as they can irritate the stomach.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:58:03.910015+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (804, 41, 372, 1208, 23, 39, 4031, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1771, Skin Problems","The main problem was not a rash, itch, jaundice, skin lumps or abnormal bruising.","The main problem was pubic lice.","Contact with someone with pubic lice had occurred.","The individual needs to contact a genito-urinary medicine clinic or other local service.","I can provide information about the nearest Genito-Urinary Medicine clinic.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Treatment to kill lice can be bought from pharmacies. Follow the instructions in the pack.","They are spread by close contact. They are not spread in clothing or bedding.","Avoid close bodily contact with anyone until after the second application of the treatment.","It is not necessary to shave the affected area.","All family members should be treated at the same time to prevent re-infection.","Sexual contacts should be treated at the same time to prevent re-infection.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:58:32.778085+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (805, 41, 39, 1191, 24, 40, 4195, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","Reason for call menu - continued to next list.","The main reason for the contact was a request for health or medication information.","The request for information was not related to a new or worsening illness.","The information request related to the location of health services.","The request related to locating a GP practice.","Information on the location of a service was given.","I am going to give you the location of the service you require.","DOS call"}', '2023-02-27 13:58:32.836625+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (806, 41, 175, 1135, 23, 39, 4031, 1, 2, '{"Pathway Selected: PFA3, Calling About Someone Else","An injury or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for assessment was not new confusion, declared diabetic hypo/hyperglycaemia, probable allergic reaction, successful resuscitation or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW644, Passing Urine, Associated Pain, Frequency or Smell","There was no stinging sensation when passing urine.","There was no spinal pain.","There was no fever at the time of assessment or within the previous 12 hours.","There was no flank pain.","There was no extreme thirst or increased urine output during the previous month.","Pregnancy or possible pregnancy was reported.","The individual was less than 20 weeks pregnant.","There were no clinically relevant sores or blisters in the genital area.","There was no blood in the urine.","The individual had not clinically deteriorated nor felt particularly unwell in the previous 24 hours.","There had been recent sexual contact with a person known to have a sexually transmitted infection.","The individual needs to contact a genito-urinary medicine clinic or other local service.","I can provide information about the nearest Genito-Urinary Medicine clinic.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","Unless advised not to, or they have already been given, paracetamol or ibuprofen can be used to relieve pain or reduce a fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","IN PREGNANCY: Don''t take ibuprofen, except on the advice of a doctor, midwife or pharmacist. Use paracetamol instead.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:58:32.958035+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (807, 41, 329, 1204, 119, 92, 4198, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","A possible contraceptive failure was the reason for the contact.","A sexual assault had not occurred.","Contraception had not been used","Intercourse took place between 48 hours and 72 hours ago previously.","Intercourse was not with somebody known to have HIV or hepatitis.","Emergency Contraception required within 2 hours.","Before you go, I will just check whether I need to give you any further instructions or advice.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:58:33.018054+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (808, 41, 317, 1140, 124, 97, 4317, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","Access to another healthcare provider was the reason for the contact.","The request related to contacting a community healthcare professional.","The request for contact with a health professional related to management of a known problem.","A health visitor was required.","I will pass the information on to the health visitor.","I will pass your information on to them.","DOS call"}', '2023-02-27 13:58:33.078038+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (809, 41, 252, 1155, 37, 53, 4095, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","A social or domestic emergency was the main problem.","There was no immediate risk of violence.","An assault had not occurred.","The individual denied suicidal thoughts.","There was no child or vulnerable adult at risk.","There was no risk of self-harm.","The individual had not been hearing voices, seeing things or behaving abnormally.","There was a problem relating to care provision.","The individual had a carer.","The carer was present and able to cope.","The problem did not relate to drug, solvent or alcohol misuse.","Contacting social services was considered appropriate.","Immediate referral was considered appropriate.","From what you have told me I need to refer to Social Services immediately.","Follow your operational policy for this situation.","DOS call"}', '2023-02-27 13:58:33.171115+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (810, 41, 253, 1155, 38, 54, 4095, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","A social or domestic emergency was the main problem.","There was no immediate risk of violence.","An assault had not occurred.","The individual denied suicidal thoughts.","There was no child or vulnerable adult at risk.","There was no risk of self-harm.","The individual had not been hearing voices, seeing things or behaving abnormally.","There was a problem relating to care provision.","The individual had a carer.","The carer was present and able to cope.","The problem did not relate to drug, solvent or alcohol misuse.","Contacting social services was considered appropriate.","Referral the next working day was considered appropriate.","From what you have told me I need to refer to Social Services routinely.","Follow your operational policy for this situation.","DOS call"}', '2023-02-27 13:58:33.257706+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (811, 41, 251, 1076, 29, 45, 4020, 1, 1, '{"Pathway Selected: PMA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1629, Eye or Eyelid Problems","The main problem was not visual disturbance, an eyelid problem, yellow eye(s), eye pain, inflammation or discharge.","Severe illness and a rash suggestive of septicaemia were not described.","There had been no episodes of inability to raise both arms, speech difficulty or unilateral facial weakness.","There had been no episode of unilateral leg weakness.","Severe illness and inability to flex the neck or photophobia were not described.","There had been no head injury in the previous 7 days.","There was no previous diagnosis of migraine.","There was complete or partial visual loss in one eye.","There had been a gradual deterioration of vision in recent weeks or months.","There was no eye pain at the time of assessment.","There was no contact lens stuck or lost in the eye.","There was no feeling of a curtain or shutter coming across the field of vision.","The individual was not seeing bright flashing lights.","The individual was not seeing floating spots.","Medication type or dosage had not changed within the previous 2 weeks.","There was no previous diagnosis of diabetes or hypertension.","There was no new double vision.","There was no new sticky discharge from the eye(s).","The individual had recently renewed spectacles or contact lenses.","The individual needs to contact their optician within the next 72 hours (3 days from now).","You need to make an appointment with an optician.","DOS call","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back."}', '2023-02-27 13:58:33.392656+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (812, 41, 319, 1140, 122, 95, 4323, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","Access to another healthcare provider was the reason for the contact.","The request related to contacting a community healthcare professional.","The request for contact with a health professional related to management of a known problem.","A community nurse was required.","The information enquiry was not urgent (within 24 hours).","I will pass the information on to the community nurse.","I will pass your information on to them.","DOS call"}', '2023-02-27 13:58:33.455056+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (813, 41, 318, 1140, 121, 94, 4323, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","Access to another healthcare provider was the reason for the contact.","The request related to contacting a community healthcare professional.","The request for contact with a health professional related to management of a known problem.","A community nurse was required.","The information enquiry was urgent (within 4 hours).","I will pass the information on to the community nurse urgently.","I will pass your information on to them.","DOS call"}', '2023-02-27 13:58:33.515097+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (819, 41, 340, 1208, 23, 39, 4031, 1, 2, '{"Pathway Selected: PFA1, Calling About Self","An injury or health problem was the reason for the contact.","Heavy bleeding had not occurred in the previous 30 minutes.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not a heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, a probable allergic reaction or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1771, Skin Problems","The main problem was not a rash, itch, jaundice, skin lumps or abnormal bruising.","The main problem was pubic lice.","There had not been contact with someone with pubic lice.","Pubic lice had been seen.","The individual needs to contact a genito-urinary medicine clinic or other local service.","I can provide information about the nearest Genito-Urinary Medicine clinic.","DOS call","Antihistamine tablets or medicine may help. They can be bought from pharmacies. Follow the instructions in the pack.","Hydrocortisone cream may help if the itchy area is small. It can be bought from pharmacies. Follow the instructions in the pack.","A moisturising cream or calamine lotion or cream may help. They can be bought from pharmacies.","When having a bath add a little baking soda (bicarbonate of soda) to the water, or put 2 cups of rolled oats into a sock and put it in the water.","Wash with a moisturising cream or lotion, not soap. Soap can dry the skin and increase irritation.","Don''t scratch.","Treatment to kill lice can be bought from pharmacies. Follow the instructions in the pack.","They are spread by close contact. They are not spread in clothing or bedding.","Avoid close bodily contact with anyone until after the second application of the treatment.","It is not necessary to shave the affected area.","All family members should be treated at the same time to prevent re-infection.","Sexual contacts should be treated at the same time to prevent re-infection.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-02-27 13:58:33.935356+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (820, 42, 898, 1069, 1, 18, 4489, 4, 1, '{"An injury, illness or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1399, Eye Injury, Penetrating","There was no associated head, facial or neck injury.","There was no foreign body penetrating the eye or eye socket.","The wound was not bleeding freely at the time of assessment.","There had been no penetration of the eye by a small, fast-moving object.","The wound was not large or deep at the time of assessment.","An assault had not occurred.","There was bruising.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","If there is an object stuck in or near the eye don''t try to remove it.","Don''t try to look in the eye if it is swollen shut.","Close both eyes, cover them with a soft pad or dressing and fasten it gently with some tape. Don''t put any pressure on the eyeball.","Don''t let them rub the eye.","Cover the wound with a clean cloth folded into a pad, but don''t put any pressure on the eye.","If the blood soaks through the pad don''t take it off, put another pad on top of it.","If helping someone else: try to keep their blood off your skin.","If the bleeding cannot be controlled or is getting worse - CALL 999.","BETWEEN 8 AND 12 WEEKS OLD: Unless told not to or it has already been given, some paracetamol products can be taken. Check the leaflet and follow the instructions. If in doubt speak to a pharmacist","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","ALWAYS FOLLOW CHILD SAFEGUARDING GUIDELINES.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-03-06 15:39:37.381529+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (821, 42, 899, 1069, 1, 18, 4750, 4, 1, '{"An injury, illness or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1399, Eye Injury, Penetrating","There was an associated head, facial or neck injury.","There was no new/worsening breathlessness since the injury.","The individual had not experienced a seizure before, during or after the injury.","The wound was not bleeding freely at the time of assessment.","There was no foreign body penetrating the eye or eye socket.","There was no fluid leak or bleeding from the ear or nose.","The individual was responding normally.","There was no new skull deformity, a bruise, swelling or wound, more than 5cm across.","There was no bruising around the uninjured eye or ear.","There had not been a fall of 1 metre or more.","There had not been a fall directly onto the head.","An assault had not occurred.","There was no loss of consciousness at the time of the injury.","There was no vomiting following the injury.","There was no previous history of brain surgery.","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","If there is an object stuck in or near the eye don''t try to remove it.","Don''t try to look in the eye if it is swollen shut.","Close both eyes, cover them with a soft pad or dressing and fasten it gently with some tape. Don''t put any pressure on the eyeball.","Don''t let them rub the eye.","Cover the wound with a clean cloth folded into a pad, but don''t put any pressure on the eye.","If the blood soaks through the pad don''t take it off, put another pad on top of it.","If helping someone else: try to keep their blood off your skin.","If the bleeding cannot be controlled or is getting worse - CALL 999.","Make sure that they are with a responsible adult for 48 hours after having the head injury so that they can watch out for any problems.","Babies tend to sleep after a head injury. This is fine as long as they are woken every hour for the first 6 hours after the injury.","BETWEEN 8 AND 12 WEEKS OLD: Unless told not to, or they have already been given, some paracetamol products can be used to relieve pain. You MUST check the leaflet and follow the instructions.","Don''t use any other painkillers, they can cause complications following a head injury.","FOR ANY SWELLING: Remove any jewellery or tight clothing from around the swelling.","ALWAYS FOLLOW CHILD SAFEGUARDING GUIDELINES.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Or, if the baby cannot be woken or has a fit - CALL 999."}', '2023-03-06 15:39:37.561262+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (822, 42, 902, 1110, 1, 18, 4750, 4, 1, '{"An injury, illness or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1401, Head, Facial or Neck Injury, Blunt","There was no new/worsening breathlessness since the injury.","The individual had not experienced a seizure before, during or after the injury.","There was no fluid leak or bleeding from the ear or nose.","The individual was responding normally.","There was a new bruise, swelling or wound more than 5cm across.","There was somebody available to offer safe transport to hospital.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Make sure that they are with a responsible adult for 48 hours after having the head injury so that they can watch out for any problems.","Babies tend to sleep after a head injury. This is fine as long as they are woken every hour for the first 6 hours after the injury.","OVER 12 WEEKS OLD: Unless advised not to take, or they have already been given, paracetamol can be used to relieve pain. You MUST check the leaflet and follow the instructions.","Don''t use any other painkillers, they can cause complications following a head injury.","FOR ANY SWELLING: Remove any jewellery or tight clothing from around the swelling.","ALWAYS FOLLOW CHILD SAFEGUARDING GUIDELINES.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Or, if the baby cannot be woken or has a fit - CALL 999."}', '2023-03-06 15:39:37.699445+00', NULL);
