INSERT INTO pathwaysdos.scenarios VALUES (833, 42, 894, 1024, 21, 37, 4020, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1771, Skin Problems","The main problem was a rash.","There was a blistering rash.","They were able to carry out most or all everyday activities.","The skin problem did not relate to an assault.","There was no rash like blood spots or bruises under the skin.","There was no new or worsening confusion.","Breathing harder or faster when doing nothing was not described.","There was no known increased susceptibility to infection.","Lots of blisters or ulcers inside the mouth were not described.","Skin was not peeling off in sections.","There was no large area of redness like burnt or scalded skin.","Blistering did not involve an eye.","The blisters were not in a painful line or group.","There had not been a recent vaccination at the site of the problem.","The problem was not said to be chickenpox.","There had been no contact with chickenpox in the previous 3 weeks.","The blisters were small.","The individual did not have blistering caused by friction.","There was no fever at the time of assessment or within the previous 12 hours.","Blistering was not restricted to the genital area.","There were no spots or patches with honey-coloured crusting.","DOS call","The individual needs to contact a pharmacist within 24 hours.","I can provide information about the nearest pharmacist.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol can be used to relieve pain or fever. Follow the instructions in the pack.","Don''t use ibuprofen if chickenpox is suspected.","If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-03-06 15:39:39.601159+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (834, 42, 895, 1068, 1, 18, 4489, 4, 1, '{"An injury, illness or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1397, Eye Injury, Blunt","There was no new/worsening breathlessness since the injury.","The individual had not experienced a seizure before, during or after the injury.","There was no fluid leak or bleeding from the ear or nose.","The individual was responding normally.","There was no new skull deformity, bruise, swelling or wound more than 5cm across.","There was no bruising around the uninjured eye or ear.","There had not been a fall of 1 metre or more.","There had not been a fall directly onto the head.","An assault had not occurred.","There was no loss of consciousness at the time of the injury.","There was no vomiting following the injury.","There was no previous history of brain surgery.","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","There was bruising.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","To help reduce pain and swelling hold a cold flannel over the injured eye for 10-30 minutes.","BETWEEN 8 AND 12 WEEKS OLD: Unless told not to or it has already been given, some paracetamol products can be taken. Check the leaflet and follow the instructions. If in doubt speak to a pharmacist","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","ALWAYS FOLLOW CHILD SAFEGUARDING GUIDELINES.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-03-06 15:39:39.743558+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (835, 42, 896, 1068, 4, 21, 4749, 4, 1, '{"An injury, illness or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1397, Eye Injury, Blunt","There was no new/worsening breathlessness since the injury.","The individual had not experienced a seizure before, during or after the injury.","There was no fluid leak or bleeding from the ear or nose.","The individual was responding normally.","There was no new skull deformity, bruise, swelling or wound more than 5cm across.","There was no bruising around the uninjured eye or ear.","There had not been a fall of 1 metre or more.","There had not been a fall directly onto the head.","An assault had not occurred.","There was no loss of consciousness at the time of the injury.","There was no vomiting following the injury.","There was no previous history of brain surgery.","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","There was no bruising.","There was no worsening swelling.","There had been no unprotected exposure welding flashes, very bright light or other UV source","DOS call","The individual needs to contact a local service within 2 hours.","I will arrange for a clinician to contact the individual. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","To help reduce pain and swelling hold a cold flannel over the injured eye for 10-30 minutes.","BETWEEN 8 AND 12 WEEKS OLD: Unless told not to or it has already been given, some paracetamol products can be taken. Check the leaflet and follow the instructions. If in doubt speak to a pharmacist","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","ALWAYS FOLLOW CHILD SAFEGUARDING GUIDELINES.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-03-06 15:39:39.883658+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (836, 42, 897, 1068, 1, 18, 4750, 4, 1, '{"An injury, illness or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1397, Eye Injury, Blunt","There was no new/worsening breathlessness since the injury.","The individual had not experienced a seizure before, during or after the injury.","There was no fluid leak or bleeding from the ear or nose.","The individual was responding normally.","There was a new bruise, swelling or wound more than 5cm across.","There was somebody available to offer safe transport to hospital.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","To help reduce pain and swelling hold a cold flannel over the injured eye for 10-30 minutes.","BETWEEN 8 AND 12 WEEKS OLD: Unless told not to or it has already been given, some paracetamol products can be taken. Check the leaflet and follow the instructions. If in doubt speak to a pharmacist","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","ALWAYS FOLLOW CHILD SAFEGUARDING GUIDELINES.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-03-06 15:39:40.022113+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (982, 46, 967, 1120, 2, 19, 4750, 4, 1, '{"An injury, illness or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1224, Leg Injury, Penetrating","The wound was not bleeding freely at the time of assessment.","There was no bone protruding through the skin.","The limb had not become cold, pale, blue or grey.","There was no new limb deformity or swelling.","There was no foreign body in the wound.","An assault had not occurred.","The wound was not large or deep at the time of assessment.","There was no constriction of the limb by an object that could not be removed.","There was no injury within 7.5 cm of the ankle or knee.","There was no bruising.","There was ability to move the leg following the injury.","The pain was severe.","DOS call","The individual needs to be referred to a treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","SAFEGUARDING: From what I have heard there may be safeguarding concerns.","Before you go, I will just check whether I need to give you any further instructions or advice.","OVER 12 WEEKS OLD: Unless advised not to take, or they have already been given, paracetamol OR ibuprofen can be used to relieve pain or fever. Don''t give both together.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","ALWAYS FOLLOW CHILD SAFEGUARDING GUIDELINES.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-07-17 11:08:46.117596+00', NULL);
