INSERT INTO pathwaysdos.scenarios VALUES (995, 46, 949, 1099, 9, 26, 4749, 4, 1, '{"An injury, illness or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1408, Genital Injury, Penetrating","The wound was not bleeding freely at the time of assessment.","There was no foreign body in the wound.","There was no apparent abdominal pain.","An assault had not occurred.","The problem was not a needlestick injury.","The wound was not large or deep at the time of assessment.","The individual was able to pass urine following the injury.","There had been no blood in the urine since the injury.","There was no rectal bleeding.","There was no new swelling.","There was no bruising.","The individual did not have a foreign object inside or around the penis.","DOS call","The individual needs to speak to a local service within 1 hour.","I will arrange for a clinician to speak to the individual.","SAFEGUARDING: From what I have heard there may be safeguarding concerns.","Before you go, I will just check whether I need to give you any further instructions or advice.","OVER 12 WEEKS OLD: Unless advised not to take, or they have already been given, paracetamol OR ibuprofen can be used to relieve pain or fever. Don''t give both together.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","ALWAYS FOLLOW CHILD SAFEGUARDING GUIDELINES.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Use a dry dressing or a small clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","If the bleeding cannot be controlled or is getting worse - CALL 999.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-07-17 11:08:48.163221+00', NULL);
