INSERT INTO pathwaysdos.scenarios VALUES (1000, 46, 976, 1145, 4, 21, 4749, 4, 1, '{"An injury, illness or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","There was a minor injury (a scratch, graze, minor wound or blisters).","Pathway Selected: PW1590, Scratches, Grazes and Minor Wounds","An assault had not occurred.","There was no bruising.","The problem was not a needlestick injury or animal scratch.","There was no embedded dirt, gravel or grit.","The problem occurred less than 6 hours before the assessment.","There was no pre-tibial injury.","DOS call","The individual needs to contact a local service within 2 hours.","I will arrange for a clinician to contact the individual. I need to ask some further questions in order to determine the best way to do this.","SAFEGUARDING: From what I have heard there may be safeguarding concerns.","Before you go, I will just check whether I need to give you any further instructions or advice.","OVER 12 WEEKS OLD: Unless advised not to take, or they have already been given, paracetamol OR ibuprofen can be used to relieve pain or fever. Don''t give both together.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","Wash your hands thoroughly.","If helping someone else: try to keep their blood off your skin.","Clean the wound under running tap water. Don''t use antiseptics, as they can irritate the wound.","Gently dry the skin around the wound.","Cover the wound with a plaster or non-stick dressing or a folded clean, non-fluffy cloth.","A decision about whether tetanus immunisation is needed can be made when the injury is checked.","ALWAYS FOLLOW CHILD SAFEGUARDING GUIDELINES.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-07-17 11:08:48.983268+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (1001, 46, 977, 1145, 9, 26, 4749, 4, 1, '{"An injury, illness or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","There was a minor injury (a scratch, graze, minor wound or blisters).","Pathway Selected: PW1590, Scratches, Grazes and Minor Wounds","An assault had not occurred.","There was no bruising.","The problem was not a needlestick injury or animal scratch.","There was no embedded dirt, gravel or grit.","The problem occurred 6 hours or more before the assessment.","There was a purulent discharge.","There was a fever at the time of assessment or within the previous 12 hours.","DOS call","The individual needs to speak to a local service within 1 hour.","I will arrange for a clinician to speak to the individual.","SAFEGUARDING: From what I have heard there may be safeguarding concerns.","Before you go, I will just check whether I need to give you any further instructions or advice.","Give them plenty to drink. If breastfeeding, continue to do so.","Dress them in light clothes e.g. a T-shirt and nappy, don''t try to cool down by cold sponging or fanning.","Check on them at least every 2-4 hours including overnight.","Becoming limp, floppy, unresponsive or having a fit - CALL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - CALL 999.","OVER 12 WEEKS OLD: Unless advised not to take, or they have already been given, paracetamol OR ibuprofen can be used to relieve pain or fever. Don''t give both together.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","Wash your hands thoroughly.","If helping someone else: try to keep their blood off your skin.","Clean the wound under running tap water. Don''t use antiseptics, as they can irritate the wound.","Gently dry the skin around the wound.","Cover the wound with a plaster or non-stick dressing or a folded clean, non-fluffy cloth.","A decision about whether tetanus immunisation is needed can be made when the injury is checked.","ALWAYS FOLLOW CHILD SAFEGUARDING GUIDELINES.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-07-17 11:08:49.187244+00', NULL);
