IDELINES.","Remove any jewellery or tight clothing from around the swelling.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-07-17 11:08:49.643341+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (1005, 46, 939, 1041, 1, 18, 4750, 4, 1, '{"An injury, illness or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1393, Chest or Upper Back Injury, Penetrating","The baby could not crawl or walk.","There was no new/worsening breathlessness since the injury.","There was no new quietness or limb weakness/coordination problems.","The wound was not bleeding freely at the time of assessment.","There was no foreign body in the wound.","The pain was not severe.","There had been no blood in the urine since the injury.","There had been no vomiting of red or altered (coffee grounds) blood.","There had been no black and tarry or red/maroon bowel motions.","A major assault was disclosed.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","SAFEGUARDING: From what I have heard there may be safeguarding concerns.","Before you go, I will just check whether I need to give you any further instructions or advice.","Any cuts can be covered with a dry dressing. Dirt or anything else should not be cleaned out of the wound as this may be important evidence.","Don''t wash or change clothes until seen by a healthcare professional to avoid destroying important evidence.","When seen by the healthcare professional, inform them an assault has taken place.","If the situation appears to endanger anyone - CALL 999 FOR THE POLICE.","OVER 12 WEEKS OLD: Unless advised not to take, or they have already been given, paracetamol OR ibuprofen can be used to relieve pain or fever. Don''t give both together.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","ALWAYS FOLLOW CHILD SAFEGUARDING GUIDELINES.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-07-17 11:08:49.814829+00', NULL);
