INSERT INTO pathwaysdos.scenarios VALUES (1048, 46, 957, 1108, 9, 26, 4749, 4, 1, '{"An injury, illness or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1510, Hand or Wrist Injury, Penetrating","The wound was not bleeding freely at the time of assessment.","The individual had no associated arm injury.","There was no bone protruding through the skin.","The hand had not become cold, pale, blue or grey.","There was no new limb deformity or swelling.","There was no amputation of a finger or part of a finger.","There was no foreign body in the wound.","An assault had not occurred.","The problem was not a needlestick injury.","The wound was not large or deep at the time of assessment.","There was no constriction of the limb by an object that could not be removed.","There was no loss of wrist movement following the injury.","There was no finger/thumb injury.","There was no bruising.","The pain was not severe.","There were not two or more separate injuries.","DOS call","The individual needs to speak to a local service within 1 hour.","I will arrange for a clinician to speak to the individual.","SAFEGUARDING: From what I have heard there may be safeguarding concerns.","Before you go, I will just check whether I need to give you any further instructions or advice.","OVER 12 WEEKS OLD: Unless advised not to take, or they have already been given, paracetamol OR ibuprofen can be used to relieve pain or fever. Don''t give both together.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","ALWAYS FOLLOW CHILD SAFEGUARDING GUIDELINES.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Use a dry dressing or a small clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","IN LIMBS: If possible raise the injured area and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","If the bleeding cannot be controlled or is getting worse - CALL 999.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-07-17 11:08:56.920952+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (1049, 46, 956, 1108, 1, 18, 4489, 4, 1, '{"An injury, illness or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1510, Hand or Wrist Injury, Penetrating","The wound was not bleeding freely at the time of assessment.","The individual had no associated arm injury.","There was no bone protruding through the skin.","The hand had not become cold, pale, blue or grey.","There was no new limb deformity or swelling.","There was no amputation of a finger or part of a finger.","There was no foreign body in the wound.","An assault had not occurred.","The problem was not a needlestick injury.","The wound was not large or deep at the time of assessment.","There was no constriction of the limb by an object that could not be removed.","There was no loss of wrist movement following the injury.","There was no finger/thumb injury.","There was bruising.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","SAFEGUARDING: From what I have heard there may be safeguarding concerns.","Before you go, I will just check whether I need to give you any further instructions or advice.","OVER 12 WEEKS OLD: Unless advised not to take, or they have already been given, paracetamol OR ibuprofen can be used to relieve pain or fever. Don''t give both together.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","ALWAYS FOLLOW CHILD SAFEGUARDING GUIDELINES.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Use a dry dressing or a small clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","IN LIMBS: If possible raise the injured area and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","If the bleeding cannot be controlled or is getting worse - CALL 999.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-07-17 11:08:57.103353+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (1014, 46, 919, 1011, 1, 18, 4750, 4, 1, '{"An injury, illness or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1516, Ankle or Foot Injury, Blunt","The foot had not become cold, pale, blue or grey.","There was new swelling around the injured area.","A major assault was disclosed.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","SAFEGUARDING: From what I have heard there may be safeguarding concerns.","Before you go, I will just check whether I need to give you any further instructions or advice.","Any cuts can be covered with a dry dressing. Dirt or anything else should not be cleaned out of the wound as this may be important evidence.","Don''t wash or change clothes until seen by a healthcare professional to avoid destroying important evidence.","When seen by the healthcare professional, inform them an assault has taken place.","If the situation appears to endanger anyone - CALL 999 FOR THE POLICE.","OVER 12 WEEKS OLD: Unless advised not to take, or they have already been given, paracetamol OR ibuprofen can be used to relieve pain or fever. Don''t give both together.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","ALWAYS FOLLOW CHILD SAFEGUARDING GUIDELINES.","Remove any jewellery or tight clothing from around the swelling.","IN LIMBS: if possible raise the area and support it.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-07-17 11:08:51.349819+00', NULL);
