INSERT INTO pathwaysdos.scenarios VALUES (1028, 46, 922, 1012, 9, 26, 4749, 4, 1, '{"An injury, illness or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1522, Ankle or Foot Injury, Penetrating","The wound was not bleeding freely at the time of assessment.","There was no bone protruding through the skin.","The foot had not become cold, pale, blue or grey.","There was no new limb deformity or swelling.","There had been no amputation of a toe or part of a toe.","There was no foreign body in the wound.","An assault had not occurred.","The problem was not a needlestick injury.","The wound was not large or deep at the time of assessment.","There was no constriction of the limb by an object that could not be removed.","There was ability to move the ankle following the injury.","There was no bruising.","There was no toe injury.","The pain was not severe.","There was no injury to the sole of a foot.","DOS call","The individual needs to speak to a local service within 1 hour.","I will arrange for a clinician to speak to the individual.","SAFEGUARDING: From what I have heard there may be safeguarding concerns.","Before you go, I will just check whether I need to give you any further instructions or advice.","OVER 12 WEEKS OLD: Unless advised not to take, or they have already been given, paracetamol OR ibuprofen can be used to relieve pain or fever. Don''t give both together.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","ALWAYS FOLLOW CHILD SAFEGUARDING GUIDELINES.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-07-17 11:08:53.585349+00', NULL);
