se, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-07-17 11:08:55.106797+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (1038, 46, 951, 1099, 2, 19, 4750, 4, 1, '{"An injury, illness or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1408, Genital Injury, Penetrating","The wound was not bleeding freely at the time of assessment.","There was no foreign body in the wound.","There was no apparent abdominal pain.","An assault had not occurred.","The problem was not a needlestick injury.","The wound was not large or deep at the time of assessment.","The individual was able to pass urine following the injury.","There had been no blood in the urine since the injury.","There was no rectal bleeding.","There was no new swelling.","There was no bruising.","There was a foreign object inside or around the penis.","DOS call","The individual needs to be referred to a treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","SAFEGUARDING: From what I have heard there may be safeguarding concerns.","Before you go, I will just check whether I need to give you any further instructions or advice.","Don''t try to remove the object.","OVER 12 WEEKS OLD: Unless advised not to take, or they have already been given, paracetamol OR ibuprofen can be used to relieve pain or fever. Don''t give both together.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","ALWAYS FOLLOW CHILD SAFEGUARDING GUIDELINES.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Use a dry dressing or a small clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","If the bleeding cannot be controlled or is getting worse - CALL 999.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth.","If it starts to bleed again fold a cloth into a pad and press firmly, directly onto the wound to stop the bleeding."}', '2023-07-17 11:08:55.287581+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2081, 1054, 1014, 1013, 1, 18, 4782, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW777, Lower Limb Pain or Swelling","The problem affected the lower leg only.","The problem affected the ankle or foot.","The problem was not caused by twisting or the ankle giving way.","The problem did not relate to a previously diagnosed leg ulcer.","There was no groin pain or swelling.","There was no new loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","A leg had not suddenly become cold, pale, blue or grey.","The individual had not suddenly become breathless.","There was no sharp/stabbing pain in the chest/upper back on deep breathing.","The individual had not coughed up blood.","There was sudden onset of pain and swelling of an entire leg.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Remove any jewellery or tight clothing from around the swelling.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2024-03-26 12:00:26.155554+00', NULL);
