INSERT INTO pathwaysdos.scenarios VALUES (973, 45, 987, 1140, 171, 171, 4757, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","There was a predetermined management plan.","The predetermined plan specified that a doctor should be contacted.","The individual had been advised to monitor their oxygen levels.","The oxygen level was 95 or more.","Request for COVID-19 treatment was identified.","DOS call","The individual needs to speak to a local service within 1 hour.","I will arrange for a clinician to speak to the individual.","SAFEGUARDING: From what I have heard there may be safeguarding concerns.","Before you go, I will just check whether I need to give you any further instructions or advice.","Some people are suitable to receive treatment if their symptoms are due to COVID-19.","Speak to the service that you are being referred to about this.","Further advice can be found at nhs.uk.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-07-04 09:50:58.672251+00', NULL);
