INSERT INTO pathwaysdos.scenarios VALUES (2062, 1051, 996, 1073, 21, 37, 4020, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1629, Eye or Eyelid Problems","The main problem was eye redness or irritation.","There was no new disturbance of vision.","There was no eye pain at the time of assessment.","The problem affected both eyes.","There was no eye scratch or foreign body.","The individual had no problem related to contact lens use.","There was no sensitivity to bright light.","There were cold or flu-like symptoms.","DOS call","The individual needs to contact a pharmacist within 24 hours.","I can provide information about the nearest pharmacist.","IF THE RECOMMENDED TIMEFRAME FALLS OUTSIDE OPENING HOURS: If they can''t be contacted, contact the individual''s GP practice or, if it is closed, call us back.","Before you go, I will just check whether I need to give you any further instructions or advice.","Rest and drink plenty of fluids.","Make sure someone checks on you regularly.","Always cover the mouth with a tissue when coughing or sneezing. Put used tissues into a bin immediately and wash the hands.","Feeling faint, about to pass out or collapse - CALL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - CALL 999.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-09-06 10:25:59.135972+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (979, 45, 988, 1145, 1, 18, 4692, 4, 1, '{"An injury, illness or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1590, Scratches, Grazes and Minor Wounds","An assault had not occurred.","There was no bruising.","The problem was a needlestick injury.","Squeeze the wound to make it bleed.","Don''t suck the wound.","Wash the wound thoroughly with soap under plenty of running water.","Don''t scrub the wound. Don''t use antiseptic solutions or skin washes.","Dry with a disposable towel or paper.","Cover the skin wound with a waterproof dressing or plaster, if available.","If the skin, eyes or mouth have been splashed with contents of a hypodermic syringe, wash thoroughly with plenty of water.","All needlestick injuries need to be checked to see if further treatment is needed.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","SAFEGUARDING: From what I have heard there may be safeguarding concerns.","Before you go, I will just check whether I need to give you any further instructions or advice.","OVER 12 WEEKS OLD: Unless advised not to take, or they have already been given, paracetamol OR ibuprofen can be used to relieve pain or fever. Don''t give both together.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","ALWAYS FOLLOW CHILD SAFEGUARDING GUIDELINES.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-07-04 09:50:59.438092+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (980, 45, 986, 1101, 117, 90, 4010, 3, 1, '{"An injury, illness or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia, successful resuscitation or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1566, Genital Problems","There appeared to be penile pain.","The individual had not experienced an erection persisting for more than 4 hours.","There was no foreign body in or around the penis.","There did not appear to be abdominal or low back pain.","There was no testicular/scrotal pain, lump or swelling.","A sexual assault was disclosed.","DOS call","The individual needs to be referred to a treatment centre within 1 hour for Sexual Assault Assessment.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Don''t wash or change clothes until seen by a healthcare professional to avoid destroying important evidence.","When seen by the healthcare professional, inform them an assault has taken place.","SAFEGUARDING: From what I have heard there may be safeguarding concerns.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to, paracetamol OR ibuprofen can be used to relieve pain.","You don''t always need to treat a fever unless the child is very upset.","Don''t give both together unless recommended to by a healthcare professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","Any cuts can be covered with a dry dressing. Dirt or anything else should not be cleaned out of the wound as this may be important evidence.","Don''t wash or change clothes until seen by a healthcare professional to avoid destroying important evidence.","When seen by the healthcare professional, inform them an assault has taken place.","If the situation appears to endanger anyone - CALL 999 FOR THE POLICE.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-07-04 09:50:59.573165+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (981, 45, 989, 1192, 44, 60, 4192, 1, 1, '{"Medication information request was the main reason for the contact.","Symptoms were not present at the time of the assessment.","DOS call","I will pass your query on to the person who is responsible for dealing with this type of call.","I am going to connect you to someone who will be able to provide medication advice.","I am going to pass your information on to someone who will be able to provide medication advice.","I will arrange for them to call you back","Can I check we have the correct number for them to contact you?","Is there an answer phone? If so can we leave a message?","FOR CLINICIAN ONLY AS PER LOCAL POLICY: I will now give you some medication advice","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-07-04 09:50:59.641118+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2055, 1051, 1000, 1175, 4, 21, 4764, 1, 2, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW910, Vaginal Bleeding","The individual was under 55 years of age.","Pregnancy or possible pregnancy was reported.","The individual was less than 20 weeks pregnant.","There was abdominal or low back pain as well as vaginal bleeding.","There did not seem to be severe pain.","There was no significant vaginal bleeding.","There had been no blackout or faintness.","A sexual assault had not occurred.","There was no new shoulder tip or one-sided lower abdominal pain","The individual was less than 13 weeks pregnant.","DOS call","The individual needs to contact a local service within 2 hours.","I will arrange for a clinician to contact the individual. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to, paracetamol may be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use ibuprofen or any other anti-inflammatory medication until you have spoken to a healthcare professional.","Don''t use tampons or a menstrual cup. Use pads instead.","Keep a check of how many pads are used to determine the amount of bleeding.","Keep any towels, etc. that were used to mop up the blood. They will need to be checked.","If bleeding becomes heavy, and you start passing clots, save everything passed in case it needs to be checked.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-09-06 10:25:58.232415+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2056, 1051, 1001, 1175, 10, 27, 4765, 1, 2, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW910, Vaginal Bleeding","The individual was under 55 years of age.","Pregnancy or possible pregnancy was reported.","The individual was less than 20 weeks pregnant.","There was no abdominal or low back pain.","There was no significant vaginal bleeding.","A sexual assault had not occurred.","The individual was less than 13 weeks pregnant.","DOS call","The individual needs to speak to a local service within 2 hours.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","Don''t use tampons or a menstrual cup. Use pads instead.","Keep a check of how many pads are used to determine the amount of bleeding.","Keep any towels, etc. that were used to mop up the blood. They will need to be checked.","If bleeding becomes heavy, and you start passing clots, save everything passed in case it needs to be checked.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-09-06 10:25:58.353269+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2057, 1051, 991, 1018, 1, 18, 4758, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1749, Behaviour Change","There was no worsening of a known mental health problem.","The individual had not attacked, threatened or intended to harm anyone.","There was no ingestion/inhalation of something harmful in the last 72 hours.","The duration of the problem was less than 2 weeks.","They were able to carry out most or all everyday activities.","The individual was 25 years of age or older.","There had been no crushing chest, upper back or abdominal pain, or chest pain spreading to the arm, neck or jaw in the previous 24 hours.","There had been no episodes of inability to raise both arms, speech difficulty or unilateral facial weakness in the last week.","There had been no episode of unilateral leg weakness in the last week.","There was no fainting or loss of consciousness in the previous 24 hours.","There had been no exposure to extremes of temperature in the previous 24 hours.","There had been no head injury in the previous 4 weeks.","The individual was not responding normally.","There was no fever at the time of assessment or within the previous 12 hours.","The individual denied suicidal thoughts.","Withdrawing from alcohol was reported.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DO NOT abruptly stop using alcohol. This can cause serious side effects, including fits.","Getting the right support is important.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-09-06 10:25:58.531933+00', NULL);
