INSERT INTO pathwaysdos.scenarios VALUES (2060, 1051, 994, 1203, 1, 18, 4758, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1751, Mental Health Problems","There was no worsening of a known mental health problem.","The individual had not been hearing voices, seeing things or behaving abnormally.","The main problem was not depression, low mood or sleep difficulty.","Help or advice about drug, alcohol or solvent misuse was not required.","The individual was experiencing panic attacks.","The individual had not attacked or threatened anyone.","The individual was having suicidal thoughts.","The individual had not made a plan for a suicide attempt.","Alcohol consumption was considered to be contributing to the problem.","Withdrawing from alcohol was reported.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DO NOT abruptly stop using alcohol. This can cause serious side effects, including fits.","Getting the right support is important.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-09-06 10:25:58.91519+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2061, 1051, 995, 1210, 1, 18, 4758, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1764, Tremor","There was no seizure in the last 12 hours.","Withdrawing from alcohol was reported.","There had been no auditory or visual hallucinations.","The individual was confused, agitated or restless.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","DO NOT abruptly stop using alcohol. This can cause serious side effects, including fits.","Getting the right support is important.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-09-06 10:25:59.03202+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2063, 1051, 997, 1074, 21, 37, 4020, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1629, Eye or Eyelid Problems","The main problem involved a sticky or watery eye discharge.","There was no new disturbance of vision.","There was no eye pain at the time of assessment.","The individual had no problem related to contact lens use.","The duration of symptoms was less than 2 weeks.","There were cold or flu-like symptoms.","DOS call","The individual needs to contact a pharmacist within 24 hours.","I can provide information about the nearest pharmacist.","IF THE RECOMMENDED TIMEFRAME FALLS OUTSIDE OPENING HOURS: If they can''t be contacted, contact the individual''s GP practice or, if it is closed, call us back.","Before you go, I will just check whether I need to give you any further instructions or advice.","Rest and drink plenty of fluids.","Make sure someone checks on you regularly.","Always cover the mouth with a tissue when coughing or sneezing. Put used tissues into a bin immediately and wash the hands.","Feeling faint, about to pass out or collapse - CALL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - CALL 999.","Clean each eye using a separate piece of cotton wool soaked in boiled, cooled tap water.","Wash hands after touching the eye.","Don''t wear contact lenses until it''s cleared up.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-09-06 10:25:59.272304+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2064, 1051, 998, 1119, 1, 18, 4766, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","There was a minor injury (a scratch, graze, minor wound or blisters).","Pathway Selected: PW1241, Leg Injury, Blunt","The symptoms resulted from an injury.","The individual was unable to weight-bear at the time of assessment.","The individual was able to get up from the floor.","The injury was above the knee.","There was no new limb deformity or swelling.","There was no apparent shortening of the leg.","The pain was not severe.","There was somebody available to offer safe transport to hospital.","Avoid using the injured limb.","Try to support the injured limb but don''t straighten anything that looks out of shape.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","The individual should not eat or drink anything before going to hospital (a sip of water is fine if medication needs to be taken).","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-09-06 10:25:59.455299+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2065, 1051, 999, 1120, 1, 18, 4766, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","There was a minor injury (a scratch, graze, minor wound or blisters).","Pathway Selected: PW1234, Leg Injury, Penetrating","The wound was bleeding freely at the time of assessment.","There was no bone protruding through the skin.","The individual had no significant foreign body in the wound.","There was no apparent shortening of the leg.","The limb had not become cold, pale, blue or grey.","There was no new limb deformity.","The individual was able to get up from the floor.","The injury was above the knee.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery.","A decision about whether tetanus immunisation is needed can be made when the wound is checked.","Use a dry dressing or a clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","IN LIMBS: If possible raise the injured area and continue to apply pressure. Don''t use a tourniquet. If a tourniquet is already in place, do not remove it.","If the bleeding stops, secure the pad with a bandage or sticky tape. It should be firm but not tight.","Use pillows or a sling to keep the injured area raised.","If the bleeding cannot be controlled or is getting worse - CALL 999."}', '2023-09-06 10:25:59.590989+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2066, 1052, 1004, 1034, 1, 18, 4518, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW559, Breathing Problems, Breathlessness or Wheeze","There was no new or worsening swelling of the face, tongue or throat.","An oxygen reading was not declared.","An asthma attack was stated to be the cause of the problem.","Breathing harder or faster when doing nothing was described.","They were still able to carry out some everyday activities.","There had been chest pain spreading to the arm, neck or jaw in the previous 24 hours.","The individual had experienced pain in the previous 12 hours.","There was no previous diagnosis of a heart disease.","Cocaine use had not occurred in the previous 24 hours.","There was no previous history of diabetes.","There had been no previous diagnosis of Kawasaki''s disease.","There had been no episode of choking within the previous 24 hours.","There had been no inhalation of a hot or poisonous substance in the previous 24 hours.","There was no new or worsening confusion.","There had been no previous similar episode requiring hospital admission.","Previous similar episode(s) had occurred.","The breathing had not worsened.","The individual had not coughed up blood.","There was no previous history of pneumothorax.","The individual was not experiencing palpitations.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Sit upright.","Use prescribed inhalers, nebulisers or oxygen according to the instructions.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-10-30 12:09:07.297339+00', NULL);
