uctions or advice.","Sit upright.","Use prescribed inhalers, nebulisers or oxygen according to the instructions.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-10-30 12:09:07.852731+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2070, 1052, 1010, 1094, 2, 19, 4776, 3, 1, '{"An injury, illness or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was not trapped at the scene.","Fainting/loss of consciousness had not occurred just before the injury.","Pathway Selected: PW1320, Foreign Body, Penis","There was no foreign body in or around the penis.","There was no severe swelling of the penis and no inability to pass urine.","A sexual assault had not occurred.","DOS call","The individual needs to be referred to a treatment centre within 4 hours.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","SAFEGUARDING: From what I have heard there may be safeguarding concerns.","Before you go, I will just check whether I need to give you any further instructions or advice.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-10-30 12:09:07.976901+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2071, 1052, 1007, 1152, 7, 24, 4775, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1771, Skin Problems","The main problem was a rash.","There was no blistering rash.","The rash had appeared more than 6 hours previously.","They were able to carry out most or all everyday activities.","The skin problem did not relate to an assault.","There was no rash like blood spots or bruises under the skin.","There was no new or worsening confusion.","Breathing harder or faster when doing nothing was not described.","There was no known increased susceptibility to infection.","Lots of blisters or ulcers inside the mouth were not described.","Skin was not peeling off in sections.","There was no large area of redness like burnt or scalded skin.","The rash was confined to one patch or area.","The problem involved a single spot or blemish.","There was no fever at the time of assessment or within the previous 12 hours.","There had not been a recent vaccination at the site of the problem.","There were spots or patches with honey-coloured crusting.","DOS call","The individual needs to contact a local service within 24 hours.","I will arrange for a clinician to contact the individual. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-10-30 12:09:08.157953+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2072, 1052, 1006, 1135, 13, 30, 4774, 1, 2, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1865, Urinary Problems","There was no blood in the urine.","There was no inability to pass urine or reduced urine output.","They were able to carry out most or all everyday activities.","There was no spinal or lower back pain.","There was no new or worsening confusion.","Breathing harder or faster when doing nothing was not described.","There was a stinging sensation when passing urine.","There was no fever at the time of assessment or within the previous 12 hours.","There was no flank pain.","There was no extreme thirst or increased urine output during the previous 4 weeks.","There was no possibility of pregnancy.","There were no clinically relevant sores or blisters in the genital area.","The individual had not clinically deteriorated nor felt very unwell in the previous 24 hours.","There had been no recent sexual contact with a person known to have a sexually transmitted infection.","There was no recent abdominal/urogenital surgery or instrumentation.","Symptoms had persisted for 3 days or more.","DOS call","The individual needs to speak to a local service within 24 hours.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to, paracetamol may be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use ibuprofen or any other anti-inflammatory medication until you have spoken to a healthcare professional.","Continue to drink at least as much as usual.","Passing urine while having a warm bath or shower may be less painful.","Collect a urine sample in a clean jar to take to the GP practice or OOH service.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2023-10-30 12:09:08.352773+00', NULL);
