INSERT INTO pathwaysdos.scenarios VALUES (2075, 1053, 1011, 1024, 5, 22, 4777, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1771, Skin Problems","The main problem was a rash.","There was a blistering rash.","They were able to carry out most or all everyday activities.","The skin problem did not relate to an assault.","There was no rash like blood spots or bruises under the skin.","There was no new or worsening confusion.","Breathing harder or faster when doing nothing was not described.","There was no known increased susceptibility to infection.","Lots of blisters or ulcers inside the mouth were not described.","Skin was not peeling off in sections.","There was no large area of redness like burnt or scalded skin.","Blistering did not involve an eye.","The blisters were in a painful line or group.","The blisters appeared within the previous 7 days.","The blisters had appeared within the previous 3 days.","DOS call","The individual needs to contact a local service within 6 hours.","I will arrange for a clinician to contact the individual. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol can be used to relieve pain or fever. Follow the instructions in the pack.","Don''t use ibuprofen if chickenpox is suspected.","If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2024-02-07 09:35:08.615866+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2076, 1053, 1012, 1064, 6, 23, 4778, 2, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the contact was not an allergic reaction, chest/upper back pain, recent fit/seizure, suicide attempt, new confusion or suspected stroke.","The main reason for contact was not declared diabetic hypo/hyperglycaemia or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW656, Earache","They were able to carry out most or all everyday activities.","There was no foreign body in the ear.","There was no associated deafness or continuous ringing in the ear.","There was no new or worsening confusion.","There was no new tenderness behind an ear.","There was a fever at the time of assessment or within the previous 12 hours.","There were no signs of infection present to the ear.","There was no pain or swelling in front of the ear.","There was no ear discharge.","Symptoms had persisted for 3 days or more.","The individual had clinically deteriorated or felt very unwell in the previous 24 hours.","DOS call","The individual needs to contact a local service within 12 hours.","I will arrange for a clinician to contact the individual. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","Keep water out of the ears.","Drink lots of fluids, such as water or squash - take small sips if feeling sick.","Wear light clothing, don''t try to cool down by cold sponging or fanning.","Feeling faint, about to pass out or collapse - CALL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - CALL 999.","Check on them at least every 2-4 hours including overnight.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2024-02-07 09:35:08.770804+00', NULL);
