ever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2024-02-07 09:35:08.918104+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2078, 1054, 1016, 1115, 1, 18, 4786, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW777, Lower Limb Pain or Swelling","There was pain or swelling above the knee.","There was no low back pain.","There was no groin pain or swelling.","There was no new loss of bladder/bowel control or leg movement and no saddle or lower limb paraesthesia.","A leg had not suddenly become cold, pale, blue or grey.","The individual had not suddenly become breathless.","There was no sharp/stabbing pain in the chest/upper back on deep breathing.","The individual had not coughed up blood.","There was no sudden onset of pain and swelling of an entire leg.","The problem only involved one leg.","The individual was unable to weight-bear.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '