ing.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2024-03-26 12:00:26.396481+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2084, 1054, 1022, 1020, 6, 23, 4787, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","There was a minor injury (a bite or sting).","Pathway Selected: PW1575, Bites and Stings","The bite or sting was caused by an insect or spider.","The sting/bite had not occurred within the previous 6 hours.","The individual had been stung less than 10 times","The individual was not experiencing nausea and/or vomiting.","The sting did not involve the eyes, mouth or limb.","There was no insect/insect part remaining attached to the skin","There was no very severe, deep pain.","There was no fever at the time of assessment or within the previous 12 hours.","The problem did not involve a tick.","There was an area of rapidly spreading redness or a change in skin colour near the injury.","DOS call","The individual needs to contact a local service within 12 hours.","I will arrange for a clinician to contact the individual. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","Antihistamine treatments may help the symptoms. Follow the instructions in the pack or if in doubt ask a pharmacist.","Remove any jewellery or tight clothing from the area.","If the sting is visible in the skin, brush or scrape it out with your fingernail or the edge of a credit card. Don''t try to pull it out with tweezers.","Wash the area with soap and water.","Apply a cold flannel (face cloth) to the area. Raise the affected area if possible.","Don''t scratch the area.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2024-03-26 12:00:26.516809+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2085, 1054, 1020, 1156, 7, 24, 4788, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW854, Sore Throat or Hoarse Voice","The problem involved a sore throat and a hoarse voice.","There was no new or worsening breathlessness.","They were able to carry out most or all everyday activities.","There was no history of recent general anaesthetic or tonsillectomy.","There was no new or worsening confusion.","There was a fever at the time of assessment or within the previous 12 hours.","Lots of blisters or ulcers inside the mouth were not described.","There was no difficulty opening the mouth or speaking as if the mouth was full.","There was not a problem for which medical advice must always be sought.","There was no new rash.","There had been no contact with scarlet fever in the previous week.","The sore throat had persisted for 1 week or longer.","DOS call","The individual needs to contact a local service within 24 hours.","I will arrange for a clinician to contact the individual. I need to ask some further questions in order to determine the best way to do this.","Before you go, I will just check whether I need to give you any further instructions or advice.","Drink lots of fluids, such as water or squash - take small sips if feeling sick.","Wear light clothing, don''t try to cool down by cold sponging or fanning.","Feeling faint, about to pass out or collapse - CALL 999.","Becoming severely ill WITH new marks, like bruising or bleeding under the skin - CALL 999.","Unless advised not to take, paracetamol OR ibuprofen can be used to relieve pain or fever.","Follow the instructions in the pack. If in doubt ask a pharmacist.","Warm or cold drinks, ice lollies and ice cream can all help to soothe a sore throat.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2024-03-26 12:00:26.664145+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2092, 1056, 1034, 1127, 1, 18, 4796, 1, 2, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW774, Lower Limb Pain or Swelling","There was pain or swelling above the knee.","There was low back pain.","The problem was not caused by twisting, or sudden movement.","The individual has had no previous episodes of lower back pain or stiffness on movement.","The individual had experienced new leg pain and swelling since symptom onset.","There was no abdominal pain.","Pregnancy or possible pregnancy was reported.","The individual had been pregnant for 20 weeks or more.","The individual was not in labour.","Features of onset of labour were not present.","They were able to carry out most or all everyday activities.","There did not seem to be severe pain.","There was no significant vaginal bleeding.","The individual had experienced new leg pain and swelling since symptom onset.","A leg had not suddenly become cold, pale, blue or grey.","There was no sudden onset of pain and swelling of an entire leg.","There was new or worsening numbness or pins and needles around the anus or genitals in the previous 2 weeks.","There was somebody available to offer safe transport to hospital.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol can be used to relieve pain.","IN PREGNANCY: Don''t take ibuprofen, except on the advice of a healthcare professional.","Vaginal bleeding of more than just a few spots, or a gush of watery discharge from the vagina - CALL 999.","Severe and constant abdominal pain, or a feeling of wanting to push or of the baby coming - CALL 999.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2024-08-12 08:19:59.933217+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2086, 1054, 1021, 1156, 39, 55, 4788, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW854, Sore Throat or Hoarse Voice","The problem involved a sore throat and a hoarse voice.","There was no new or worsening breathlessness.","They were able to carry out most or all everyday activities.","There was no history of recent general anaesthetic or tonsillectomy.","There was no new or worsening confusion.","There was no fever at the time of assessment or within the previous 12 hours.","There was no difficulty opening the mouth or speaking as if the mouth was full.","There was no known increased susceptibility to infection.","There were no blisters involving only one side of the throat or palate.","The sore throat had persisted for 1 week or longer.","There was no marked deterioration in the previous 24 hours.","DOS call","The individual MUST contact a local service within 3 working days.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol OR ibuprofen can be used to relieve pain or fever.","Follow the instructions in the pack. If in doubt ask a pharmacist.","Warm or cold drinks, ice lollies and ice cream can all help to soothe a sore throat.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2024-03-26 12:00:26.802812+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2087, 1054, 1024, 1206, 181, 181, 4784, 1, 1, '{"Clinical Consultation","Same Day Emergency Care (SDEC)/Same Day Emergency Care (SDEC), Suspected","Referral to a SDEC.","Refer to  a Surgical SDEC.","Refer to a Trauma and Orthopaedic SDEC.","DOS call","General worsening advice given.","Condition specific worsening advice given.","If the condition changes, gets worse or you have other concerns, call back.","Remember to have a list of any current medications for further consultations."}', '2024-03-26 12:00:26.877519+00', NULL);
