INSERT INTO pathwaysdos.scenarios VALUES (2090, 1055, 1026, 1128, 1, 18, 4782, 3, 1, '{"An injury, illness or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW779, Lower Limb Pain or Swelling","The problem was not confined to the nail area.","There was no groin pain or swelling.","They were able to carry out most or all normal activities.","A leg had not suddenly become cold, pale, blue or grey.","There was sudden onset of pain and swelling of an entire leg.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to, paracetamol OR ibuprofen can be used to relieve pain.","You don''t always need to treat a fever unless the child is very upset.","Don''t give both together unless recommended to by a healthcare professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","Remove any jewellery or tight clothing from around the swelling.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2024-05-22 13:29:56.245492+00', NULL);
