INSERT INTO pathwaysdos.scenarios VALUES (2100, 1056, 1036, 1197, 1, 18, 4796, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1759, Loss of Bowel Control","There was low back pain.","There was no new loss of bowel control.","The main problem was faecal soiling.","The individual did not also have diarrhoea.","Constipation was not a current problem.","There was new or worsening numbness or pins and needles around the anus or genitals in the previous 2 weeks.","There was somebody available to offer safe transport to hospital.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2024-08-12 08:20:01.259843+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2118, 1059, 1049, 1192, 13, 30, 4803, 1, 1, '{"Reason for call menu - continued to next list.","A prescription request was the main reason for the contact.","The main reason for the contact was not a new or worsening illness.","The patient did not have enough medication to last until the surgery next opened.","The request was not for a repeat prescription.","A prescription for a controlled or restricted medicine was requested.","The next dose was due in over 12 hours time.","DOS call","The individual needs to speak to a local service within 24 hours.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2025-04-28 17:12:23.736447+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2101, 1056, 1037, 1241, 1, 18, 4796, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1865, Urinary Problems","There was no blood in the urine.","There was inability to pass urine.","They were able to carry out most or all everyday activities.","There was leg pain.","There was new or worsening numbness or pins around the anus or genitals in the previous 2 weeks.","There was somebody available to offer safe transport to hospital.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to, paracetamol may be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use ibuprofen or any other anti-inflammatory medication until you have spoken to a healthcare professional.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2024-08-12 08:20:01.393205+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2102, 1057, 1043, 1069, 1, 18, 4799, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was able to get up from the floor.","The injury did not involve a fall down stairs or a fall from over a metre.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW668, Eye Injury, Penetrating","The patient was not taking anti-platelet medication.","There was an associated head, facial or neck injury.","There was no new/worsening breathlessness since the injury.","The individual had not experienced a seizure before, during or after the injury.","The wound was not bleeding freely at the time of assessment.","There was no foreign body penetrating the eye or eye socket.","There was no new confusion or agitation or new difficulty speaking, reading or writing.","There was no new limb weakness, coordination problems or sensory change or loss.","There was no bleeding or fluid leak from an ear and no new deafness.","There was no new continuous neck pain following the injury.","The patient was responding normally.","There was no new visual disturbance.","There was no new skull or facial deformity.","The injury was not caused by falling onto the head from something moving or hitting the head when diving.","There was bruising around the uninjured eye or ear.","There was somebody available to offer safe transport to hospital.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","If there is an object stuck in or near the eye don''t try to remove it.","Don''t try to look in the eye if it is swollen shut.","Close both eyes, cover them with a soft pad or dressing and fasten it gently with some tape. Don''t put any pressure on the eyeball.","Don''t rub the eye.","Cover the wound with a clean cloth folded into a pad, but don''t put any pressure on the eye.","If the blood soaks through the pad don''t take it off, put another pad on top of it.","If helping someone else: try to keep their blood off your skin.","If the bleeding cannot be controlled or is getting worse - CALL 999.","A responsible adult should stay with anyone who has had a head injury to watch out for any problems.","Unless advised not to, or they have already been given, paracetamol can be used to relieve pain. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use any other painkillers, they can cause complications following a head injury.","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","They cannot be woken up, they have a seizure (fit), they become dazed or groggy.","They develop problems speaking, balancing, walking or understanding.","They cannot feel any part of their body, OR have general weakness or new deafness."}', '2024-10-28 13:56:10.122214+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2103, 1057, 1042, 1068, 1, 18, 4799, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","The injury was not minor in nature.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was able to get up from the floor.","The injury did not involve a fall down stairs or a fall from over a metre.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW660, Eye Injury, Blunt","The patient was not taking anti-platelet medication.","There was an associated head, facial or neck injury.","There was no new/worsening breathlessness since the injury.","The individual had not experienced a seizure before, during or after the injury.","There was no new confusion or agitation or new difficulty speaking, reading or writing.","There was no new limb weakness, coordination problems or sensory change or loss.","There was no bleeding or fluid leak from an ear and no new deafness.","There was no new continuous neck pain following the injury.","The patient was responding normally.","There was no new visual disturbance.","There was no new skull or facial deformity.","The injury was not caused by falling onto the head from something moving or hitting the head when diving.","There was bruising around the uninjured eye or ear.","There was somebody available to offer safe transport to hospital.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","To help reduce pain and swelling hold a cold flannel over the injured eye for 10-30 minutes.","A responsible adult should stay with anyone who has had a head injury to watch out for any problems.","Unless advised not to, or they have already been given, paracetamol can be used to relieve pain. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use any other painkillers, they can cause complications following a head injury.","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","They cannot be woken up, they have a seizure (fit), they become dazed or groggy.","They develop problems speaking, balancing, walking or understanding.","They cannot feel any part of their body, OR have general weakness or new deafness."}', '2024-10-28 13:56:10.343954+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2104, 1057, 1041, 1111, 1, 18, 4799, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An injury or symptom relating to an injury was the main problem.","Whether the injury was minor in nature could not be confirmed.","The individual was not fighting for breath.","The skin on the torso felt normal, warm or hot.","Major trauma had not occurred.","The individual was able to get up from the floor.","The injury did not involve a fall down stairs or a fall from over a metre.","The problem did not result from a suicide attempt or self-harm.","The individual was not trapped at the scene.","The individual did not use anticoagulant medication or have a bleeding/clotting disorder.","There was no feeling of illness or other unusual symptoms before the injury.","Pathway Selected: PW692, Head, Facial or Neck Injury, Penetrating","The patient was not taking anti-platelet medication.","There was no new/worsening breathlessness since the injury.","The individual had not experienced a seizure before, during or after the injury.","The wound was not bleeding freely at the time of assessment.","There was no foreign body in the wound.","There was no new confusion or agitation or new difficulty speaking, reading or writing.","There was no new limb weakness, coordination problems or sensory change or loss.","There was no bleeding or fluid leak from an ear and no new deafness.","The patient was responding normally.","There was no new continuous neck pain following the injury.","There was no new visual disturbance.","There was no new skull or facial deformity.","The injury was not caused by falling onto the head from something moving or hitting the head when diving.","There was bruising around the uninjured eye or ear.","There was somebody available to offer safe transport to hospital.","A tooth or teeth had not been knocked out.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","A responsible adult should stay with anyone who has had a head injury to watch out for any problems.","Unless advised not to, or they have already been given, paracetamol can be used to relieve pain. Follow the instructions in the pack. If in doubt ask a pharmacist.","Don''t use any other painkillers, they can cause complications following a head injury.","Remove any jewellery or tight clothing from around the swelling.","Wrap an ice pack (or bag of frozen peas) in a cloth and put it on the area for 15-20 minutes. Repeat every 2-3 hours when awake.","Don''t put ice directly on the skin. Don''t leave ice on while asleep.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","They cannot be woken up, they have a seizure (fit), they become dazed or groggy.","They develop problems speaking, balancing, walking or understanding.","They cannot feel any part of their body, OR have general weakness or new deafness.","A decision about whether tetanus immunisation is needed can be made when the injury is checked.","Use a dry dressing or a clean cloth folded into a pad and press firmly, directly onto the wound to stop the bleeding.","If the blood soaks through the pad don''t take it off. Put another pad on top of it and keep pressing on the wound.","If helping someone else: try to keep their blood off your skin.","If the bleeding cannot be controlled or is getting worse - CALL 999.","Cover it with a plaster, a non-stick dressing or a non-fluffy clean cloth."}', '2024-10-28 13:56:10.555692+00', NULL);
