INSERT INTO pathwaysdos.scenarios VALUES (2106, 1057, 1039, 1152, 12, 29, 4800, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1771, Skin Problems","The main problem was a rash.","There was no blistering rash.","The rash had appeared more than 6 hours previously.","They were able to carry out most or all everyday activities.","The skin problem did not relate to an assault.","There was no rash like blood spots or bruises under the skin.","There was no new or worsening confusion.","Breathing harder or faster when doing nothing was not described.","There was no known increased susceptibility to infection.","Lots of blisters or ulcers inside the mouth were not described.","Skin was not peeling off in sections.","There was no large area of redness like burnt or scalded skin.","The rash was generalised or affected more than one area of skin.","There was no fever at the time of assessment or within the previous 12 hours.","The problem did not begin after starting new medication.","There had been contact with measles in the previous 3 weeks.","DOS call","The individual needs to speak to a local service within 12 hours.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2024-10-28 13:56:10.914411+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2107, 1057, 1038, 1152, 11, 28, 4800, 1, 2, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1771, Skin Problems","The main problem was a rash.","There was no blistering rash.","The rash had appeared more than 6 hours previously.","They were able to carry out most or all everyday activities.","The skin problem did not relate to an assault.","There was no rash like blood spots or bruises under the skin.","There was no new or worsening confusion.","Breathing harder or faster when doing nothing was not described.","There was no known increased susceptibility to infection.","Lots of blisters or ulcers inside the mouth were not described.","Skin was not peeling off in sections.","There was no large area of redness like burnt or scalded skin.","The rash was confined to one patch or area.","The problem did not involve just one spot or blemish.","There was no inflammation of the skin in the affected area.","There was no fever at the time of assessment or within the previous 12 hours.","There were no genital sores.","There were no spots or patches with honey-coloured crusting.","Pregnancy or possible pregnancy was reported.","There had been no contact with chickenpox in the previous 3 weeks.","There had been contact with measles in the previous 3 weeks.","DOS call","The individual needs to speak to a local service within 6 hours.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2024-10-28 13:56:11.081633+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2108, 1058, 1045, 1146, 120, 93, 4320, 1, 2, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1684, Sexual or Menstrual Concerns","A sexual assault had not occurred.","There was a problem concerning contraception.","There had been a possible failure of contraception.","Whether Intercourse was with somebody known to have HIV or hepatitis could not be confirmed.","There had been no recent sexual contact with a person known to have a sexually transmitted infection.","The individual was under 55 years of age.","Intercourse took place between 72 and 120 hours previously.","DOS call","Emergency Contraception required within 12 hours.","Before you go, I will just check whether I need to give you any further instructions or advice.","There are two types of emergency contraception that can be used, morning after pill or the coil (IUD).","Both types of emergency contraception are effective at preventing pregnancy if they are used soon after unprotected sex or contraceptive failure.","It''s important to get advice from a healthcare professional as soon as possible.","IF UNDER 16 YEARS AND SEXUAL ACTIVITY MAY HAVE OCCURRED FOLLOW CHILD SAFEGUARDING GUIDELINES.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2025-01-29 14:04:07.661256+00', NULL);
