INSERT INTO pathwaysdos.scenarios VALUES (2114, 1059, 1053, 1182, 1, 18, 4807, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW1615, Wrist, Hand or Finger Pain or Swelling","The problem was not confined to the nail area.","The main problem involved both pain and swelling.","The hand had suddenly become cold, pale, blue or grey.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Remove any jewellery or tight clothing from around the swelling.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2025-04-28 17:12:23.257726+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2115, 1059, 1052, 1117, 1, 18, 4807, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW777, Lower Limb Pain or Swelling","The problem affected the lower leg only.","The problem affected the knee or lower leg.","The problem was not caused by twisting, or sudden movement of the knee.","The problem did not relate to a previously diagnosed leg ulcer.","There was no groin pain or swelling.","There was no new or worsening saddle paraesthesia, loss of bladder or bowel control or loss of movement of both legs in the previous 2 weeks.","The individual had not suddenly become breathless.","There was no sharp/stabbing pain in the chest/upper back on deep breathing.","The individual had not coughed up blood.","A leg was cold, pale, blue or grey.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","Remove any jewellery or tight clothing from around the swelling.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2025-04-28 17:12:23.395276+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2116, 1059, 1051, 1115, 1, 18, 4807, 1, 1, '{"An injury, illness or health problem was the reason for the contact.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for the assessment was not an allergic reaction, heart attack, chest/upper back pain, probable stroke, recent fit/seizure or suicide attempt.","The main reason for contact was not new confusion, declared diabetic hypo/hyperglycaemia, or ICD shock.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW777, Lower Limb Pain or Swelling","There was pain or swelling above the knee.","There was no low back pain.","There was no groin pain or swelling.","There was no new or worsening saddle paraesthesia, loss of bladder or bowel control or loss of movement of both legs in the previous 2 weeks.","The individual had not suddenly become breathless.","There was no sharp/stabbing pain in the chest/upper back on deep breathing.","The individual had not coughed up blood.","A leg was cold, pale, blue or grey.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to take, paracetamol or ibuprofen can be used to relieve pain or fever. Follow the instructions in the pack. If in doubt ask a pharmacist.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2025-04-28 17:12:23.51606+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2119, 1059, 1048, 1192, 12, 29, 4803, 1, 1, '{"Reason for call menu - continued to next list.","A prescription request was the main reason for the contact.","The main reason for the contact was not a new or worsening illness.","The patient did not have enough medication to last until the surgery next opened.","The request was not for a repeat prescription.","A prescription for a controlled or restricted medicine was requested.","The next dose was due within 12 hours.","DOS call","The individual needs to speak to a local service within 12 hours.","I will arrange for a clinician to speak to the individual.","Before you go, I will just check whether I need to give you any further instructions or advice.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2025-04-28 17:12:23.81678+00', NULL);
INSERT INTO pathwaysdos.scenarios VALUES (2121, 1059, 1054, 1128, 1, 18, 4807, 3, 1, '{"An injury, illness or health problem was the reason for the contact.","The individual was conscious at the time of the assessment.","There was no blood loss.","An illness or health problem was the main problem.","The individual was not fighting for breath.","The main reason for contact was not a probable allergic reaction, recent fit, new confusion, declared diabetic hypo/hyperglycaemia or ICD shock.","The child did not appear to be limp or floppy.","The child was able to stay awake.","The skin on the torso felt normal, warm or hot.","Pathway Selected: PW779, Lower Limb Pain or Swelling","The problem was not confined to the nail area.","There was no groin pain or swelling.","They were still able to carry out some normal activities.","A leg was cold, pale, blue or grey.","DOS call","The individual needs to be referred to a treatment centre within 1 hour.","Someone else should drive the individual.","Take any medicines and medical records with you.","Take a mobile phone if possible, in case symptoms get worse and an ambulance is needed.","Before you go, I will just check whether I need to give you any further instructions or advice.","Unless advised not to, paracetamol OR ibuprofen can be used to relieve pain.","You don''t always need to treat a fever unless the child is very upset.","Don''t give both together unless recommended to by a healthcare professional.","Consider alternating the medication ONLY if the symptoms continue or come back before the next dose is due.","Follow the instructions in the pack. If in doubt ask a pharmacist.","Remove any jewellery or tight clothing from around the swelling.","If there are any new symptoms, or if the condition gets worse, changes or you have any other concerns, call us back.","Remember to take a list of any current medications if you go to the out of hours surgery."}', '2025-04-28 17:12:24.053181+00', NULL);
